INSERT INTO `categories` (`id`, `slug`, `name`, `description`, `summary`, `test_id`, `rel`, `vars`) VALUES
(1, 'national', 'National Debates', '', '', 0, 0, ''),
(2, 'startup', 'Startup Law', 'Startups often face many legal decisions and need documents and contracts executed before they ever receive funding or begin earning revenue. These challenges include incorporation or LLC formation, copyright, patent, and trademark issues, and hiring employees or contractors. Use our free guides and articles to learn more about startup legal issues and whether you can bootstrap or need to hire a lawyer.', '', -1, 0, ''),
(3, 'tickets', 'Tickets', 'If you got a parking ticket or a speeding ticket, you still have rights. Make sure you learn whether you really deserve your fines.', '', 0, 0, ''),
(4, 'dui-california', 'DUI &mdash; California', 'Charged with a DUI in California? Not sure what to do or what penalties you might be facing? Use our free guide to find out the answers.', '', 4, 0, ''),
(5, 'drugs', 'Drugs', '', '', 0, 0, ''),
(6, 'small-claims', 'Small Claims', 'Many legal issues are disputed in small claims court. Learn how small claims court works and what you need to do to file a complaint or defend yourself in small claims court.', '', 0, 0, ''),
(7, 'restraining-order', 'Restraining Order', 'Learn if a restraining order could protect you and your loved ones!', 'A person can file for a restraining order if he or she is being harassed or abused and fears that this will continue. The order is meant to protect the person by placing restrictions on the abuser. The most common restriction is movement, which means that the abusing person cannot be near or around the other person. The order can also restrict contact, by barring phone calls or text messages. In order to get a restraining order, the person must show that he or she will probably face harm in the foreseeable future. Factors taken into consideration include past abuse and harassment, physical harm, threats of violence, verbal abuse, emotional distress, the presence of children, and potential of violence. If the risk of future harm is high, a person can most likely get a restraining order.', 69, 0, ''),
(8, 'asylum', 'Federal Asylum', 'Are you a refugee or foreign national who needs protection and asylum in the United States? Find out whether you could qualify with this free guide.', 'Asylum is the right of a person to be protected by another country when the person is being persecuted by his or her own country. It is usually granted to refugees or foreign nations who need protection from physical violence. The United States grants asylum to individuals that meet several conditions. First you must show that you have a fear of persecution in your home country. The persecution must be based on one of the following: race, religion, nationality, political opinion, and social group. If it is based on something such as typing skill, it will be harder to get asylum. Lastly, you must show that the government is involved or that the government is unable to prevent the persecution. You can apply for asylum if you are outside of the United States or once you arrive. Find out whether you could qualify with this free guide. ', 24, 0, ''),
(9, 'child-custody', 'Child Custody - California', 'Find out the answers to how child custody is determined in California. myRight can help you figure out whether you can keep your child and how a lawyer can help you.', 'In determining child custody, courts try to do what is in the best interest of the child. The preference is to award joint custody to both parents. Some important factors that are taken into account are: a history of domestic violence, substance abuse, criminal convictions, absence from the child’s life, the child preference, and disabilities. The court wants to make sure the child is a safe and loving environment. It also prefers not to move the child to a different state or school. If you have any negative facts in your case, a lawyer will try to show why those facts do not harm the child. ', 23, 0, ''),
(10, 'car-accident', 'Car Accident', 'Find out whether you have a right to recover from your accident!', 'Most damages in a car accident are resolved through insurance. However, a small number of car accidents end up in court, usually because the property damage and medical injury is more than what insurance will cover. To recover money in court from a car accident, the person suing must usually show that the other driver was at fault or caused the accident to happen. One way to prove fault is to show that the other driver broke a traffic law, such as texting while driving, speeding, failing to signal, etc. There are also some types of accidents that are always the other driver’s fault, such getting hit from behind or when making a left turn at an intersection. Some states will only allow a driver to sue if that driver was less than 50%, 51%, or 100% at fault. Other states will bar drivers from suing if they were even 1% at fault. If you want to sue for a car accident, you should speak with a personal injury lawyer. Personal injury lawyers do not charge unless you win the case.  ', 44, 0, ''),
(14, 'divorce-property', 'Divorce and Property', 'Going through a divorce can be tough, and a big question that you may have is what property do you end up with and what your spouse ends up with. This guide can help you understand how things might get split up. Property is anything that can be owned such as items, money, land, and housing.', 'Going through a divorce can be tough, and a big question that you may have is what property do you end up with and what your spouse ends up with. This guide can help you understand how things might get split up. Property is anything that can be owned such as items, money, land, and housing. During a divorce all property is classified as "community" or "separate" property. Community property is split 50/50 between the spouses. On the other hand, separate property is kept by the spouse who owns it. Generally you got before the marriage, gifts, and inheritances is yours to keep. However, it can get tricky when property was purchased with both community and separate funds.', 83, 0, ''),
(15, 'gun-rights', 'Can I Own a Gun?', 'Can that crazy neighbor buy a gun? Can you use laser sights? Find out the answers to these questions and other second amendment debates with our free guide to federal gun laws!', 'Given that the second amendment guarantees the "right to bear arms", federal law does not prohibit general firearm ownership. However, some types of guns are limited or outright banned by federal law. Automatic weapons are typically prohibited by federal law, although there can be loopholes around the law to obtain such weapons. Many mods are also limited but obtainable in the same fashion. State law also complicates things, as states often diverge greatly from the federal laws on gun control.', 62, 0, ''),
(16, 'employee-status', 'Independent Contractor or Employee', 'Is someone working for your company an independent contractor or an employee? The difference matters. Find out with this free test!', '', 72, 0, ''),
(17, 'independent-contractor-or-employee', 'Independent Contractor or Employee', 'Is someone working for your company an independent contractor or an employee? The difference matters. Find out with this free test!', 'Independent Contractors are desirable to a company because they are generally cheaper than employees. This is because employers must provide employees with a number of benefits and pay taxes such as Social Security and Medicare, unemployment benefits insurance, and workers’ compensation insurance. Oftentimes, in an effort to save money, companies will incorrectly classify an employee as an independent contractor. If audited, the company will most likely owe money to the government. Additionally, willful misclassification can result in a fine between $5000 and $15000 for each violation. Employee status determination is made by looking at a number of factors including: right to control how the work is done, the ability to fire at will, whether the worker is engaged in a distinct occupation, supervision of the work, amount of skill required, who supplies the equipment, place of work, investment by the worker, who decided the price, whether the work is a regular part of the business, how permanent the working relationship is, and the beliefs of the worker and employer. None of these factors are determinative and there is no formula. ', 63, 0, ''),
(18, 'wills', 'Why Get a Will', 'Have you thought about getting a will but weren''t sure if you needed one? Find out why getting a will is important and can save your family money!', 'A will is a contract that lays out how your property will be divided after you die. If you have any children under 18, you can also name a guardian to take care of them in the will. If you die without a will, the court will decide how to divide your property and who takes care of your children. There are already default laws in place on these issues for people that die without a will. Having the court apply these laws and figure it out costs the money and you can lose up to 5% of your property’s value just in administrative fees. Furthermore, the court system is slow and it can take almost a year for your family to get what they deserve. Last year almost 50% of people died without a will. However, making has never been easier and more affordable given the abundance of online document services. ', 66, 0, ''),
(19, 'daca', 'Deferred Action for Children Arrivals', 'On June 15, 2012, President Barack Obama announced that the U.S. Department of Homeland Security (DHS) would not deport certain eligible undocumented youth. This is called Deferred Action for Children Arrivals (DACA). Eligible youth will be given a type of temporary permission to stay in the U.S. for 2 years without fear of deportation. At the end of the 2 years, they may renew their status. They will also be allowed to apply for work authorization. In order to be eligible, applicants must have come to the United States before 16 years of age and be between the ages of 15 and 30. There are also several other conditions that must be met. In order to find out if you’re eligible, try this free guide. ', 'On June 15, 2012, President Barack Obama announced that the U.S. Department of Homeland Security (DHS) would not deport certain eligible undocumented youth. This is called Deferred Action for Children Arrivals (DACA). Eligible youth will be given a type of temporary permission to stay in the U.S. for 2 years without fear of deportation. At the end of the 2 years, they may renew their status. They will also be allowed to apply for work authorization. In order to be eligible, applicants must have come to the United States before 16 years of age and be between the ages of 15 and 30. There are also several other conditions that must be met. In order to find out if you’re eligible, try this free guide. ', 65, 0, ''),
(20, 'why-get-a-will', 'Why Get a Will', 'Why Get a Will? A will is a document with instructions on how your property should be split up after you die. It also lets you name guardians for your children under 18. Without a will, the government decides how your property should be split and who is responsible for your kids. This can get complex and your property can lose a lot of its value in court. Therefore, the main reasons to get a will are to  1. Prevent the government from making decisions about your property and children, 2. Avoid court fees and save money. Dying without a will means you have no say in what happens to your property or children. Although there are default rules on what will happen, if you have specific instructions, or want to save your family money, it’s a good idea to get a will. If your finances are simple, you can make a will quickly online with companies such as LegalZoom. If you would like to create something more complicated, you may want to hire an attorney to help you.', '', 66, 0, ''),
(21, 'should-i-get-a-will', 'Should I Get a Will', 'Should I Get a Will? A will is a document with instructions on how your property should be split up after you die. It also lets you name guardians for your children under 18. Without a will, the government decides how your property should be split and who is responsible for your kids. This can get complex and your property can lose a lot of its value in court. Therefore, the main reasons to get a will are to  1. Prevent the government from making decisions about your property and children, 2. Avoid court fees and save money. Dying without a will means you have no say in what happens to your property or children. Although there are default rules on what will happen, if you have specific instructions, or want to save your family money, it’s a good idea to get a will. If your finances are simple, you can make a will quickly online with companies such as LegalZoom. If you would like to create something more complicated, you may want to hire an attorney to help you.', '', 68, 0, ''),
(22, 'how-do-i-get-a-restraining-order', 'Restraining Order', 'A restraining order can help protect you and your loved ones from people who want to intimidate and abuse you. Find out how to get a restraining order today.', '', 69, 0, ''),
(23, 'security-deposit', 'Security Deposit - California', 'In California, landlords can deduct your security deposit for four reasons: 1) unpaid rent, 2) cleaning the rental, but only to make it as clean as it was when you moved in, 3) repairs of damages caused by you or your guests, other than normal wear and tear, 4) if the lease allows it, like lost keys.  Your security deposit cannot be used for damages that happened before you moved in. Under California law, your landlord has 21 days after you move out to return your deposit or tell you any deductions that were taken. If there are deductions, your landlord must give you an itemized statement describing the amount and reasons for the deductions. Any repairs or cleaning costs must be reasonable. Your landlord can’t deduct $1000 for a $100 job. To get your deposit back, first send a formal letter to your landlord stating reasons why you deserve it back. If this doesn’t work, you can try third-party mediation. If all else fails, you can try small claims court or superior court. A lawyer can help you out here.', 'In California, landlords can deduct your security deposit for four reasons: 1) unpaid rent, 2) cleaning the rental, but only to make it as clean as it was when you moved in, 3) repairs of damages caused by you or your guests, other than normal wear and tear, 4) if the lease allows it, like lost keys.  Your security deposit cannot be used for damages that happened before you moved in. Under California law, your landlord has 21 days after you move out to return your deposit or tell you any deductions that were taken. If there are deductions, your landlord must give you an itemized statement describing the amount and reasons for the deductions. Any repairs or cleaning costs must be reasonable. Your landlord can''t deduct $1000 for a $100 job. To get your deposit back, first send a formal letter to your landlord stating reasons why you deserve it back. If this doesn''t work, you can try third-party mediation. If all else fails, you can try small claims court or superior court. A lawyer can help you out here.', 70, 0, ''),
(24, 'dui-texas', 'DUI &mdash; Texas', 'Charged with a DUI in Texas? Not sure what to do? Use our free guide!', '', 6, 0, ''),
(25, 'dui-florida', 'DUI &mdash; Florida', 'Charged with a DUI in Florida? Not sure what to do? Use our free guide!', '', 7, 0, ''),
(26, 'dui-pennsylvania', 'DUI &mdash; Pennsylvania', 'Charged with a DUI in Pennsylvania? Not sure what to do? Use our free guide!', '', 8, 0, ''),
(27, 'dui-arizona', 'DUI &mdash; Arizona', 'Charged with a DUI in Arizona? Not sure what to do? Use our free guide!', '', 10, 0, ''),
(28, 'bankruptcy', 'Can I Declare Bankruptcy?', 'Financial troubles keeping you down? Find out if you have the option to declare bankruptcy for relief.', '', 25, 0, ''),
(29, 'assault', 'Assault', 'Find out if a threat or a punch can qualify as assault.', '', 47, 0, ''),
(30, 'battery', 'Battery', 'What does it take for a fight or an attack to turn into battery?', '', 26, 0, ''),
(31, 'spousal-support', 'Divorce &mdash; Spousal Support', 'Is spousal support or alimony going to be part of your divorce? Find out.', '', 30, 0, ''),
(32, 'is-my-internship-legal', 'Is My Internship Legal?', 'Been hired as an intern? Not sure whether you are doing too much work to still be called an intern? Find out your employment status with this guide.', 'In order for an unpaid internship to be legal, a number of conditions have to be met. If a condition is not met, then the intern is misclassified and probably owed wages. The factors include: 1) the internship is similar to an educational experience; 2) the internship is for the benefit of the intern; 3) the intern does not replace regular employees and works under close supervisor of existing staff; 4) the employer gains no immediate advantage from the activities for the intern; 5) the intern is not guaranteed a job at the end of the internship; 6) The intern and employer understand that the intern is not to be paid.', 74, 0, ''),
(33, 'hiring-interns', 'Can I Hire an Intern?', 'Hired an intern but aren''t sure of their status? Find out if your worker qualifies as an intern or is actually an employee.', 'Unpaid paid interns can be great for your startup or business, especially if you’re bootstrapping. However, there are federal regulations that must be followed to keep your internship legal. Failure to comply with these conditions could mean that your intern is actually an employee and is owed wages. If your intern sues you or you are audited by the government, you can end up paying any wages owed and waiting time penalties, interest, and attorney fees. The key factor is to structure your intern program in a way that is educational to the worker. It’s a good idea to take extra steps to make sure that your interns are being treated differently than regular employees. The fact is most employers are not audited; they usually get trouble because disgruntled interns report them. Therefore, remember to treat your interns well!', 75, 0, ''),
(34, 'gay-marriage', 'Gay Marriage', 'Want to learn more about what laws have been passed regarding gay marriage? Find the answers here.', '', 0, 0, ''),
(35, 'healthcare-reform', 'Healthcare Reform', 'Want to be up to date on healthcare reform law? Learn more here.', '', 0, 0, ''),
(36, 'immigration-reform', 'Immigration Reform', 'Want to keep up to date on the progress of immigration reform in the United States? Find the answers here.', '', 0, 0, ''),
(37, 'sopa', 'SOPA', 'Want to know the law behind SOPA, PIPA, CISPA and other anti-piracy bills? Find the answers here.', '', 0, 0, ''),
(38, 'corporation-or-llc', 'Corporation or LLC?', 'If you''re thinking about forming a corporation or an LLC, find out which entity may be right for your business.', 'Choosing between a corporation or LLC is an important decision for your company and can have an lasting impact. It is also far easier to create a corporation than convert an existing LLC to a corporation. A corporation is better if your company plans on getting outside investment or issuing stock options. However, a corporation suffers from double taxation; money is first taxed when it comes into the corporation and again when it is paid out to shareholders. On the other hand, LLCs have pass-through taxation; money is only taxed when it is paid out. Therefore, the money “passes” through the company. Most venture capitalists prefer investing in corporations, and in particular Delaware C-Corporations.', 2, 0, ''),
(39, 'when-to-incorporate', 'When to Incorporate', 'Thinking about incorporating your business, but not sure if it is time yet? Find out the answers with this quick, free guide.', 'Incorporating has many benefits and may be right for a startup depending on what stage it is at. A startup should incorporate when: it has more than one founder, is creating intellectual property, is raising money in exchange for equity, is issuing stock options, is at risk of getting sued, or is hiring employee or independent contractors. It is often easier to handle these conditions with a separate entity (the company) than individually. Although pre-incorporation contracts can be created, they can get complicated, especially when the startup does decide to incorporate. ', 76, 0, ''),
(40, 'hiring-documents', 'Hiring Documents', 'Every business needs certain documents signed by their employees and contractors to keep their business protected. Find out which documents with this quick, free guide.', 'When hiring an employee or independent contractors, there are several important documents a startup should have the person sign: NDA, non-compete, and IP assignment. An NDA (Non-disclosure Agreement) is a contract that prevents a person from disclosing non-public business information, such as trade secrets, methods, and internal communications. This document is important if you plan on sharing confidential information and want that person to not say anything. A Non-compete is a contract that prevents a worker from using the knowledge gained with the startup to form a competing business or consult other businesses that are competitors. They usually last for a period of 18 or 24 months. An IP Assignment transfers all intellectual property created by the worker to the startup. This is important if the startup plans on using work created by others. Without this, the worker owns all rights to the IP, not the startup.', 77, 0, ''),
(41, 'intellectual-property', 'Intellectual Property', 'Got an invention you want to patent, work you want to copyright, a mark to trademark, or just wondering what it takes? Find the answers here.', 'Intellectual Property includes patents, copyrights, trademarks, trade secrets and more. Patents must be filed with the USPTO and are usually reserved for tangible inventions such as machines or devices. However, software, business model, and design patents have increased in popularity. Copyrights are usually created upon the creation of an original work of art and do not require registration. However, proving copyright infringement is often the center of big legal battles. Trademarks are also generated automatically simply by doing business and being publicly known. Trademarks, unlike copyrights, can be registered to help increase protection. Trade secrets are pieces of information that are deliberately kept private and internal to a company''s employees. Intellectual property is one of the biggest barriers to entry that a company can possess, and a lawyer can help consult you on how to maximize your IP protections. ', 0, 0, ''),
(42, 'workers-compensation', 'Workers'' Compensation', 'Were you hurt at work and want to find out if you are owed workers'' compensation? Find the answers with this quick, free guide.', 'Workers’ Compensation is a government insurance program that provides payments to people who have been hurt at work. A person who receives workers’ compensation generally cannot sue his or her employer for the injury. In order to be eligible, the person must be an employee and the injury suffered must be work related. Independent contractors are not eligible for workers’ compensation. In some states, including California, undocumented workers are entitled to workers’ compensation benefits. Most cases are disputed on whether the injury was in fact work-related. This issue becomes tricky if the injury occurred during a lunch break, company event, traveling, or as a result of misconduct. A workers’ compensation attorney can help you file an appeal for workers’ compensation if you have been previously denied. ', 78, 0, ''),
(43, 'fmla-eligibility', 'FMLA Eligibility', 'Not sure whether you should benefit from the Family and Medical Leave Act (FMLA)? Find out the answers with this free, quick guide.', 'The Family and Medical Leave Act (FMLA) allows employees to take unpaid leave for specified family and medical reasons, without losing their job or group health insurance coverage. Leave can be taken for 12 weeks for the birth of a child, placement and care of a child for adoption, a serious health condition, or to care for a spouse, child, or parent in serious health condition. Twenty-six weeks may be taken to care for a servicemember with a serious injury or illness. Employers that have FMLA coverage include schools, private employers that have 50 or more employees for more than 20 weeks, and government agencies. In order to be eligible for FMLA, employees of covered employers must have worked 12 month or more, 1250 hours or more, and at a worksite where 50 or more employees worked there or 75 miles of it. ', 79, 0, ''),
(45, 'dui', 'DUI', 'DUI penalties are determined by a number of factors including number of prior DUIs, BAC level, the presence of a minor passenger, and refusing the breath test. Penalties almost always include a license suspension and fines.', 'DUI penalties are determined by a number of factors including number of prior DUIs, BAC level, the presence of a minor passenger, and refusing the breath test. Penalties almost always include a license suspension and fines. There are many different ways to fight a DUI charge. It’s almost always a good idea to hire a lawyer that can help you craft a strong defense and negotiate a better deal. ', -1, 0, ''),
(46, 'workplace-harassment', 'Workplace Harassment', 'Have you felt like the way your boss or coworkers have treated you might actually be considered harassment? Find out whether you have a claim for harassment using our free, interactive guide.', 'Harassment in the workplace is a form of employment discrimination that violates federal law. The harassment must be based on a person’s race, color, religion, sex (including pregnancy), national origin, age (40 or older), disability or genetic information. Furthermore, it must be constant and severe enough that most people in your situation would feel as if they are in a hostile, abusive, or threatening environment. If you were harassed only a few times or once, it must have been an extreme incident to qualify as discrimination. Minor annoyances do not count and are probably not illegal. Forms of behavior that qualify as workplace harassment include offensive jokes, slurs, name calling, physical threats, intimidation, mockery, insults or put-downs, offensive pictures, and work distractions. Try this quick guide to learn if you employer might be liable for harassment.', 80, 0, ''),
(47, 'wrongful-termination', 'Wrongful Termination', 'Were you fired or laid off from work and do you feel that you employer discriminated against you or otherwise terminated you illegally? Find out whether your termination was wrongful with this free, interactive guide.', 'If you were laid off or fired due to discrimination, you might have a claim for wrongful termination and be able to recover money lost wages or other economic hardship experienced as a result. Under federal law, your employer cannot terminate you based on your race, color, religion, sex (including pregnancy), national origin, age (40 or older), disability, veteran status, familial status or genetic information. These restrictions are meant to protect employees from arbitrary terminations that go against public policy. For example, it would be bad policy to allow employers to terminate employees solely based on their race. Although, most employment relationships are “at-will,” which means your employer can terminate you almost whenever it pleases, this is an exception. Furthermore, you cannot be terminated without good cause if you have a contract with your employer. If there is no good cause, you can probably sue for breach of contract and get what you deserve. ', 81, 0, ''),
(48, 'employment', 'Employment', 'There are many legal issues that arise out of being at work for an individual or a company. You have certain rights when it comes to how your employer treats you and cares for your safety, and understanding those rights can ensure that you get paid what you deserve and can work in a safe environment. Find out more about your rights here.', '', -1, 0, ''),
(49, 'expungement', 'Expungement - California', 'Did you get convicted for a crime and want your record wiped clean? Learn about expungements and whether you qualify for an expungement in California. A lawyer can help you get your criminal record cleared so you can move on with your life.', 'In California, there are a few ways you can clear your criminal record and start fresh. If you have successfully completed probation as part of your sentence, you are probably eligible to apply for an Expungement. You can also apply for this if you were convicted for a misdemeanor or infraction but did not receive probation. If you were convicted of a felony and when to state prison, you need to apply for a Certificate of Rehabilitation in order to clear the crime from your record. California also allows you to clear an arrest from your record if you can prove factual innocence. However, not every crime is eligible for Expungement or record clearing. For example, most sex crimes with a minor are excluded.  ', 82, 0, ''),
(50, 'car-accident-california', 'Car Accident Comparative', 'Car accident in California?', '', 84, 0, ''),
(51, 'car-accident-modified-50', 'Car Accident Modified 50', '', '', 85, 0, ''),
(52, 'car-accident-modified-51', 'Car Accident Modified 51', '', '', 86, 0, ''),
