INSERT INTO `links` (`id`, `type`, `url`, `category`, `summary`, `title`, `votes`, `tags`, `slug`, `source`, `poster`, `date_created`, `location`, `views`) VALUES
(1, 'secondary', 'http://www.ca1.uscourts.gov/pdf.opinions/10-2204P-01A.pdf', 34, 'DOMA is a federal law that defines marriage as the legal union between one man and one women. This law allows states the right to not recognize a same-sex marriage as valid.  ', 'Opinion of Case Finding DOMA Unconstitutional ', 8, 'same-sex marriage, doma, federal law, first circuit, unconstitutional', 'opinion-of-case-finding-doma-unconstitutional', '', 0, 0, '', 39),
(2, 'secondary', 'http://en.wikipedia.org/wiki/Massachusetts_v._United_States_Department_of_Health_and_Human_Services', 34, 'The First Circuit Court of Appeals found that DOMA''s definition of marriage was unconstitutional because the States have traditionally held the power to define marriage, not the federal government. The Supreme Court will probably hear the case soon to ultimately decide DOMA''s fate. ', 'Court Rules DOMA Unconstitutional', 20, 'same-sex marriage, doma, federal law, first circuit, unconstitutional ', 'court-rules-doma-unconstitutional', '', 0, 0, '', 65),
(3, 'secondary', 'http://www.law.cornell.edu/uscode/text/1/7', 34, 'Section 3 of DOMA defines marriage as the legal union between one man and one women. The word "spouse" refers only to a person of the opposite sex who is a husband or a wife. ', 'What the Federal Government Defines as Marriage', 15, 'same-sex marriage, doma, federal law, section 3, marriage defintion', 'what-the-federal-government-defines-as-marriage', '', 0, 0, '', 55),
(4, 'secondary', 'http://www.law.cornell.edu/uscode/text/28/1738C', 34, 'Section 2 of DOMA states that States are not required to recognize another States'' same-sex marriage laws.', 'Section 2 of DOMA', 10, 'same-sex marriage, doma, federal law, section 2, supremacy clause', 'section-2-of-doma', '', 0, 0, '', 40),
(5, 'secondary', 'http://en.wikipedia.org/wiki/Defense_of_Marriage_Act', 34, 'The Defense of Marriage Act (DOMA) is a federal law that defines marriage as the legal union between one man and one women. It was signed into law in 1996 by President Bill Clinton. Recently the First Circuit found that DOMA is unconstitutional, sparking national debate on the issue of gay rights.', 'Learn more about DOMA', 17, 'same-sex marriage, doma, federal law, Clinton ', 'learn-more-about-doma', '', 0, 0, '', 47),
(6, 'secondary', 'http://caselaw.lp.findlaw.com/data/constitution/amendment10/', 34, 'The 10th Amendment directly from the US Constitution. Powers that are not delegated in the Constitution, nor prohibited by the states are reserved to the states. ', 'Tenth Amendment of the US Constitution', 7, 'same-sex marriage, federalism, constitution, tenth amendment  ', 'tenth-amendment-of-the-us-constitution', '', 0, 0, '', 38),
(7, 'secondary', 'http://en.wikipedia.org/wiki/Tenth_Amendment_to_the_United_States_Constitution', 34, 'The Tenth Amendment states the Constitution''s principle of federalism, which delagates powers not granted to the federal government to the States or people. ', 'Learn more about the 10th Amendment', 9, 'same-sex marriage, federalism, constitution, tenth amendment', 'learn-more-about-the-10th-amendment', '', 0, 0, '', 63),
(8, 'secondary', 'http://law-dictionary.clearpointlaw.com/f/federalism_Aut.aspx', 1, 'Federalism is a system of government where state governments and the federal government share power. The United States is an example of a federal government.  ', 'Quick Definition of Federalism', 7, '', 'quick-definition-of-federalism', '', 0, 0, '', 4),
(9, 'secondary', 'http://rightdirection.com/2011/05/05/federalism-explained/', 1, 'Federalism divides power between the federal government and States. This gives States greater freedom to define and create different laws. Federalism works because states are given discretion in defining laws tailored to their own political, economic, and social situation. Since the early 1800s, the power of the national government has been broadly expanded. This has led to a trend in which large national policies have been favored over small state delegation. ', 'Federalism Explained ', 9, '', 'federalism-explained', '', 0, 0, '', 2),
(141, 'photo', 'http://www.plantingempowerment.com/storage/thumbnails/6628851-17520211-thumbnail.jpg?__SQUARESPACE_CACHEVERSION=1333726618592', 1, 'On April 5, 2012, Obama signed into law the Jumpstart Our Business Startups (JOBS) Act. The bill, among other things, enable startups to raise equity financing for their businesses through crowdfunding platforms. ', 'Jobs Act', 15, 'jobs act, crowdfunding', 'jobs-act', '', 0, 0, '', 3),
(10, 'secondary', 'http://en.wikipedia.org/wiki/Federalism_in_the_United_States', 34, 'Federalism defines the relationship between state governments and the federal government. Certain powers are reserved for the states, whereas others are controlled by the federal government. Some powers are shared. States have traditionally held the exclusive power to define marriage. Thus, DOMA''s definition of marriage may be unconstitutional because it is a state power, not a federal power. ', 'Learn more about Federalism', 13, 'same-sex marriage, federalism ', 'learn-more-about-federalism', '', 0, 0, '', 40),
(11, 'secondary', 'http://usgovinfo.about.com/od/rightsandfreedoms/a/federalism.htm', 34, '<p>The federal government and state governments have certain exclusive and shared powers. This system of dividing responsibilities is called Federalism.</p>\n\n<p>Exclusive <b>federal government</b> powers means that the states cannot make laws or decisions relating to them. Some examples include the power to print money, declare war, establish an army and navy, and regulate commerce between the states.</p>\n\n<p>Exclusive <b>state</b> powers means the states can make their own laws and decisions related to them, and the federal government cannot interfere. Some examples include: the power to issue licenses, conduct local elections, regulate commerce within the state, and provide for public health and safety.</p>\n\n<p>Some <b>shared powers</b> include setting up courts, creating and collecting taxes, and building highways.</p>\n\n<p>Sometimes there is a <b>conflict</b> between the state and federal governments in defining who an exclusive power belongs to. For examples, the federal government might make a law that is related to an exclusive state power, such as the Defense of Marriage Act (DOMA). DOMA is a federal law that defines marriage, however, the power to define marriage has been traditionally an exclusive state power. Other times, states will make a law that is related to an exclusive federal power, such as local medicinal marijuana laws. Marijuana is federally regulated because the federal government has an exclusive power to regulate interstate commerce (goods moving from state to state). In these situations, the courts may make the final decision.</p>', 'Exclusive Powers of State Governments', 10, 'same-sex marriage, federalism, states'' rights ', 'exclusive-powers-of-state-governments', '', 0, 0, '', 120),
(12, 'secondary', 'http://www.law.cornell.edu/supct/html/historics/USSC_CR_0017_0316_ZS.html', 1, 'This landmark decision reinforced the concept that the Constitution of the U.S. is the supreme law of the land. The case establishes that the Constitution grants congress implied powers for implementing the enumerated powers that Congress is given. Furthermore, a state''s action may not impede valid constitutional exercises of power by the federal government. ', 'Landmark Case Establishing Federalism', 10, '', 'landmark-case-establishing-federalism', '', 0, 0, '', 2),
(13, 'secondary', 'http://en.wikipedia.org/wiki/Same-sex_marriage_in_California', 34, 'California use to grant same-sex marriages licenses starting in June 16, 2008. However due to the passage of Proposition 8, same-sex marriage licenses were discontinued in November 5, 2008.', 'Learn More About Gay Marriage in California', 11, 'same-sex marriage, california, prop 8', 'learn-more-about-gay-marriage-in-california', '', 0, 0, '', 43),
(14, 'secondary', 'http://en.wikipedia.org/wiki/California_Proposition_8', 34, 'Proposition 8 was ballot passed in the November 2008 election. It added an amendement to the California Constitution, which provides that "only marriage between a man and a woman is valid or recognized in California."', 'Learn more about Proposition 8', 13, 'same-sex marriage, california, prop 8,', 'learn-more-about-proposition-8', '', 0, 0, '', 50),
(16, 'secondary', 'http://law.onecle.com/california/constitution/article_1/7.5.html', 34, 'Article 1, Section 7.5 of the California Constitution states that California only recognizes marriage between a man and a woman. ', 'Legal Definition of Marriage in California', 12, 'same-sex marriage, california, california constitution, marriage definition', 'legal-definition-of-marriage-in-california', '', 0, 0, '', 48),
(22, 'secondary', 'http://statesthatallowgaymarriage.com/', 34, 'The status of same-sex marriage varies in different states. This is because states have traditionally reserved the right to define marriage. Click on a state for a detailed summary of that State''s same-sex marriage laws. ', 'Same-sex Marriage Facts For Every State', 7, 'same-sex marriage, states, legal status ', 'same-sex-marriage-facts-for-every-state', '', 0, 0, '', 43),
(18, 'secondary', 'http://www.law.cornell.edu/constitution/amendmentxiv/', 1, 'The Fourteenth Amendment provides protection to all American citizens and ensure their rights in due process and equal protection in relation to race or ethnic identity. Notably, the amendment contains a section on citizenship being granted to individuals who are born in the U.S. but have parents that are not.', 'Fourteenth Amendment of the US Constitution', 7, '', 'fourteenth-amendment-of-the-us-constitution', '', 0, 0, '', 2),
(19, 'secondary', 'http://en.wikipedia.org/wiki/Fourteenth_Amendment_to_the_United_States_Constitution', 34, 'The Fourteenth Amendment is composed of several clauses including Due Process, Equal Protection, and Citizenship. Due Process refers to an individual''s procedural and substantive rights. Equal Protection refers to laws disallowing segregated treatment or individuals based on ethnicity or race. Citizenship rights enumerate the types of rights that individuals in the U.S. have. \n', 'Learn more about the 14th Amendment', 15, 'same-sex marriage, constitution, fourteenth amendment, equal protection ', 'learn-more-about-the-14th-amendment', '', 0, 0, '', 42),
(20, 'secondary', 'http://en.wikipedia.org/wiki/Same-sex_marriage_status_in_the_United_States_by_state', 34, 'As of July 10, 2012, same-sex marriage will be legal in Vermont, New Hampshire, Massachusetts, Connecticut, New York, Washington D.C., Iowa, and Washington. ', 'Which States Allow Same Sex Marriage?', 15, 'same-sex marriage, states, legal status ', 'which-states-allow-same-sex-marriage', '', 0, 0, '', 63),
(21, 'secondary', 'http://www.ca9.uscourts.gov/datastore/general/2012/02/07/1016696com.pdf', 34, 'The Ninth Circuit Court of Appeals ruled that Proposition 8 was unconstitutional because it''s sole purpose was to deny the right of marriage to gay couples, thereby violating the Fourteenth Amendment.', 'Opinion of Case Finding Prop 8 Unconstitutional ', 17, 'same-sex marriage, california, ninth circuit, prop 8, unconstitutional, fourteenth amendment', 'opinion-of-case-finding-prop-8-unconstitutional', '', 0, 0, '', 44),
(23, 'news', 'http://www.huffingtonpost.com/2012/07/11/pelosi-house-dems-doma-repeal_n_1665621.html?utm_hp_ref=politics&ir=Politics', 1, 'Led by Minority Leader Nancy Pelosi (D-Calif.), 132 House Democrats filed a brief in the Ninth Circuit Court of Appeals on Tuesday arguing that the Defense of Marriage Act (DOMA) is discriminatory and unconstitutional. In the brief, which was filed in the case of Golinski v. U.S. Office of Personnel Management, the members of Congress argued that DOMA "lacks a rational relationship to any legitimate federal purpose and accordingly is unconstitutional."', 'Nancy Pelosi And House Democrats File Brief Supporting DOMA Repeal In California Court', 10, 'doma, federal law, repeal, democracts', 'nancy-pelosi-and-house-democrats-file-brief-supporting-doma-repeal-in-california-court', '', 0, 0, '', 10),
(24, 'photo', 'http://statesthatallowgaymarriage.com/wp-content/themes/Gay%20Marriage/images/garymap.gif', 34, 'As of June 2012, eight states will recognize same-sex marriages and a total of six states (plus the District of Columbia) will recognize some form of same-sex civil unions or domestic partnerships.', 'States That Allow Gay Marriage', 20, 'same-sex marriage, states, legal status ', 'states-that-allow-gay-marriage', '', 0, 0, '', 6),
(490, 'secondary', 'http://www.law.cornell.edu/wex/child_custody', 9, '<p>Parents who have children together while married have joint ownership over their child. Courts often try to serve the best interests of the child in determining custody. This includes taking into account the child''s opinion and his or her relationship with either parent, relatives, and communities. There are a variety of factors that may influence a court''s decision, and state law can vary. However, child custody judgment is very discretionary in general, as there are many intangible factors to consider.</p>', 'Child Custody Overview', 12, '', 'child-custody-overview', '', 0, 0, '', 65),
(44, 'secondary', 'http://www.supremecourt.gov/opinions/11pdf/11-393c3a2.pdf', 35, 'National Federation of Independent Business v. Sebelius (2012). Supreme Court rules that individual mandate is constitutional under the taxation clause of the US Constitution', 'Individual Mandate is Constitutional!', 14, 'healthcare reform, supreme court, individual mandate, taxing power', 'individual-mandate-is-constitutional', '', 0, 0, '', 31),
(38, 'secondary', 'http://en.wikipedia.org/wiki/Individual_mandate', 35, 'The individual mandate is a provision in the Affordable Care Act (2010). It imposes a penalty on individuals required to have health insurance coverage. The law will come into effect in 2014 has generated substantial controversy. However, the Supreme Court has ruled that the provision is constitutional under the ''taxing power'' designated to Congress by the Constitution. ', 'Learn More About the Individual Mandate', 13, 'healthcare reform, individual mandate, taxing power, health insurance', 'learn-more-about-the-individual-mandate', '', 0, 0, '', 29),
(40, 'secondary', 'http://en.wikipedia.org/wiki/Patient_Protection_and_Affordable_Care_Act', 35, 'Summary', 'Long Summary of Patient Protection and Affordable Care Act (2010)', 10, 'healthcare reform, affordable care act, obamacare', 'long-summary-of-patient-protection-and-affordable-care-act-2010', '', 0, 0, '', 36),
(41, 'secondary', 'http://www.kff.org/healthreform/upload/8023-R.pdf', 35, 'The Affordable Care Act (2010), also known as Obamacare, contains many provisions on healthcare reform including: an individual mandate requiring most individuals to have health insurance, employer requirements, new regulations to private insurance providers, an expansion of Medicaid, and Health Benefit Exchanges. ', 'Obamacare Basics', 14, 'healthcare reform, affordable care act, obamacare, medicaid', 'obamacare-basics', '', 0, 0, '', 80),
(42, 'secondary', 'http://www.gpo.gov/fdsys/pkg/PLAW-111publ148/pdf/PLAW-111publ148.pdf', 35, 'Patient Protection and Affordable Care Act. This is commonly referred to as "Obamacare." This act seeks to increase the number of Americans that are insured and reduce the cost of health care in the nation. The Supreme Court has upheld the constitutionality of this act in the case of National Federation of Independent Business v. Sebelius.', 'The Law: Patient Protection and Affordable Care Act (2010)', 9, 'healthcare reform, affordable care act, obamacare, health insurance', 'the-law-patient-protection-and-affordable-care-act-2010', '', 0, 0, '', 36),
(43, 'secondary', 'http://www.healthcare.gov/law/timeline/index.html', 35, 'The Affordable Care Act will be implemented in phases over the next three years. One big event coming up is that in 2014 a tax will be imposed on individuals without healthcare coverage. Check out this cool timeline to see when and what changes are being implemented. ', 'Obamacare: Cool Time Line', 15, 'healthcare reform, affordable care act, obamacare, timeline, ', 'obamacare-cool-time-line', '', 0, 0, '', 49),
(487, 'secondary', 'http://www.law.cornell.edu/uscode/text/26/5000A', 35, 'Read the Individual Mandate in the Affordable Care Act 26 USC Section 5000A', 'Individual Mandate Law', 14, '', 'individual-mandate-law', '', 0, 0, '', 23),
(488, 'secondary', 'http://en.wikipedia.org/wiki/Individual_mandate', 35, 'Individual Mandate - The Individual Mandate is a clause in the Patient Protection and Affordable Care Act (2010) that imposes a "tax" on persons who do not purchase health insurance. It''s purpose is to induce action (have everyone buy health insurance). ', 'What is the Individual Mandate?', 5, '', 'what-is-the-individual-mandate', '', 0, 0, '', 24),
(46, 'secondary', 'http://en.wikipedia.org/wiki/Taxing_and_Spending_Clause', 35, 'The Taxing and Spending Clause of the Constitution gives the federal government the power to lay and collect taxes. In June 2012, The Supreme Court used this clause to validate the constitutionality of the individual mandate part of Obamacare. It reasoned that the penalty imposed by the act is a tax, and therefore legitimate. ', 'Taxing Power of Congress', 15, 'healthcare reform, taxing power, constitution', 'taxing-power-of-congress', '', 0, 0, '', 39),
(47, 'secondary', 'http://www.law.cornell.edu/constitution/articlei#section8', 35, 'Congress has the power to lay and collect taxes, duties, imports, and excises, to pay the debts and provide for the common defense and general welfare of the US. Congress'' powers in regards to monetary affairs of the nation are enumerated within the taxing and clause of the Constitution. ', 'Taxing and Spending in the Constitution', 7, 'healthcare reform, taxing power, constitution', 'taxing-and-spending-in-the-constitution', '', 0, 0, '', 40),
(48, 'news', 'http://www.tax.com/taxcom/features.nsf/Articles/1A096E99F74042BC8525766D005D5147?OpenDocument', 35, 'Featured Articles As if healthcare reform weren''t complex enough, a growing chorus of legal commentators is raising alarms that the tax provisions of the mammoth healthcare bills that have cleared the House and the Senate Finance Committee would violate the Constitution. It''s a debate that played out (without resolution) in 1993-1994 during the Clinton administration''s foray into healthcare reform.', 'Healthcare Reform Tax Constitutionality a Hot Topic', 17, 'healthcare reform, taxing power, constitution, debate', 'healthcare-reform-tax-constitutionality-a-hot-topic', '', 0, 0, '', 42),
(49, 'secondary', 'http://www.hrsa.gov/womensguidelines/', 35, 'The Affordable Care Act expand prevention coverage for women covering services such as HPV testing, mammograms, screenings, prenatal care, and other services. These will be covered with no cost sharing for the new health plan.', 'Obamacare: Preventative Healthcare for Women', 6, 'healthcare reform, women, obamacare', 'obamacare-preventative-healthcare-for-women', '', 0, 0, '', 42),
(50, 'news', 'http://politicalticker.blogs.cnn.com/2012/07/09/perry-texas-will-stand-against-obamacare/', 35, '(CNN) - Texas Gov. Rick Perry announced Monday the Lone Star State will not execute major parts of the Affordable Care Act, the controversial federal health care law recently upheld by the Supreme Court.', 'Perry: Texas will stand against ''Obamacare''', 11, 'healthcare reform, texas, perry, obamacare', 'perry-texas-will-stand-against-obamacare', '', 0, 0, '', 44),
(51, 'news', 'http://politicalticker.blogs.cnn.com/2012/07/09/perry-texas-will-stand-against-obamacare/', 35, '(CNN) - Texas Gov. Rick Perry announced Monday the Lone Star State will not execute major parts of the Affordable Care Act, the controversial federal health care law recently upheld by the Supreme Court.', 'Perry: Texas will stand against ''Obamacare''', 7, 'healthcare reform, texas, perry, obamacare', 'perry-texas-will-stand-against-obamacare2', '', 0, 0, '', 38),
(52, 'news', 'http://www.cnn.com/2012/07/10/politics/house-health-care/', 35, 'Washington (CNN) -- House Republicans launched an all-out assault Tuesday against President Barack Obama''s signature health care reform law, holding a series of committee hearings and other events ahead of a planned vote Wednesday on repealing the measure.', 'House debate on health care repeal: Boss Hogg or Groundhog Day? - CNN.com', 11, 'healthcare reform, texas, perry, obamacare', 'house-debate-on-health-care-repeal-boss-hogg-or-groundhog-day-cnncom', '', 0, 0, '', 38),
(53, 'news', 'http://www.washingtonpost.com/blogs/she-the-people/post/rick-perry-upholds-the-right-of-texans-to-have-the-worst-health-care-in-the-country/2012/07/10/gJQAblcTaW_blog.html', 35, 'Posted at 11:45 AM ET, 07/10/2012 DALLAS - Texas has the sovereign right to keep the very worst health care in the country, Gov. Rick Perry insisted on Monday.', 'Rick Perry upholds the right of Texans to have the worst health care in the country', 11, 'healthcare reform, texas, perry, obamacare', 'rick-perry-upholds-the-right-of-texans-to-have-the-worst-health-care-in-the-country', '', 0, 0, '', 37),
(54, 'news', 'http://www.nytimes.com/2012/07/10/us/politics/perry-says-texas-rejects-health-law-intrusions.html?_r=1', 35, 'HOUSTON - Gov. Rick Perry of Texas told federal officials on Monday that the state had no intention of expanding Medicaid or establishing a health insurance exchange, two major provisions of President Obama''s health care overhaul.', 'Perry Says Texas Rejects Health Law ''Intrusions''', 15, 'healthcare reform, texas, perry, obamacare', 'perry-says-texas-rejects-health-law-intrusions', '', 0, 0, '', 36),
(56, 'secondary', 'http://nhfreedomtomarry.org/resources/doma-explained/', 34, '<p>The Defense of Marriage Act (DOMA) is a federal law signed by President Bill Clinton in 1996. Section 2 of the law  defines marriage as the legal union between one man and one woman. Section 3 says that States do not have to recognize same-sex marriage laws of another State. Under the Supremacy Clause of the Constitution, States usually have to recognize and respect another State''s laws. However, DOMA says this is not necessary in the case of same-sex marriage. The law has generated controversy and at least one court has found DOMA unconstitutional.</p>', 'What is DOMA?', 7, 'same-sex marriage, doma, federal law, Clinton ', 'what-is-doma', '', 0, 0, '', 82),
(57, 'secondary', 'http://www.article-3.com/doma-challenge-unites-gay-rights-and-states-rights-97967', 1, 'The Defense of Marriage Act, or DOMA, is a 1996 law that defines marriage as the legal union of one man and one woman. Sixteen years later, the question (as with the recent healthcare battle) is whether this federal law is constitutional or not -- more specifically, whether the federal government has the right to interfere with the workings of state governments.', 'DOMA Challenge Unites Gay Rights and States'' Rights', 6, 'doma, federal law, federalism, states'' rights', 'doma-challenge-unites-gay-rights-and-states-rights', '', 0, 0, '', 7),
(58, 'news', 'http://www.huffingtonpost.com/nigel-barber/gay-marriage-young-people_b_1659360.html', 34, 'If you want to know what the future holds, talk to young people. On social issues, young American adults today are far more liberal than their parents. The majority support gay marriage (50 percent in favor versus 36 percent against with the remainder undecided.)', 'Is the Debate on Gay Marriage Effectively Over?', 12, 'same-sex marriage, debate, liberal, support', 'is-the-debate-on-gay-marriage-effectively-over', '', 0, 0, '', 44),
(60, 'news', 'http://www.washingtonblade.com/2012/07/11/romney-stresses-same-sex-marriage-opposition-in-naacp-speech/', 34, 'Presumptive Republican presidential nominee Mitt Romney stressed during a speech at the National Association for the Advancement of Colored People''s annual convention in Houston on Wednesday that he would represent Americans of "every race, creed and sexual orientation" if elected. The former Massachusetts governor also stressed his opposition to nuptials for gays and lesbians.', 'Romney stresses same-sex marriage opposition in NAACP speech', 14, 'same-sex marriage, romney, opposition, NAACP', 'romney-stresses-same-sex-marriage-opposition-in-naacp-speech', '', 0, 0, '', 41),
(59, 'news', 'http://www.upi.com/Top_News/US/2012/07/11/Gay-marriage-referendum-on-ballot-in-Maryland/UPI-95111342038537/?spt=hts&or=4', 34, 'ANNAPOLIS, Md., July 11 (UPI) -- Maryland voters will be able to decide in November if the state''s new law legalizing same-sex marriage will stand. The state Board of Elections announced Tuesday the Maryland Marriage Alliance, which opposes the law, had gathered enough valid signatures for certification, The Baltimore Sun reported.', 'Gay marriage referendum on ballot in Maryland', 13, 'same-sex marriage, Maryland, ballot, referendum ', 'gay-marriage-referendum-on-ballot-in-maryland', '', 0, 0, '', 35),
(61, 'news', 'http://www.care2.com/causes/facebook-gay-marriage-icons-provoke-russian-ban-campaign.html', 34, 'Conservative religious groups in Russia are campaigning to ban Facebook and return the nation to its criminalization of homosexuality after Facebook created new icons so users could show they are in a same-sex marriage. The campaign was launched in Saratov and several other Russian regions - including St Petersburg, Novosibirsk and Arkhangelsk - where gay propaganda is banned by law.', 'Anti-Gay Russians Boycott Facebook', 13, 'same-sex marriage, boycott, facebook, russian', 'anti-gay-russians-boycott-facebook', '', 0, 0, '', 40),
(63, 'secondary', 'http://startuplawyer.com/incorporation/what-is-four-years-with-a-one-year-cliff', 38, 'Four Years with a One Year Cliff is the typical vesting schedule for startup founders’ stock. The one year cliff means that none of the founder''s shares will vest until after one year. After the cliff, shares gradually vest. After 4 years from issuance, all shares vest. ', 'What is Four Years With a One Year Cliff', 4, 'corporation, entity, founders, stock ', 'what-is-four-years-with-a-one-year-cliff', '', 0, 0, '', 47),
(64, 'secondary', 'http://www.law.cornell.edu/uscode/text/26/83', 38, 'If stock vests overtime, each vesting milestone is a taxable event for the founder. The amount taxed is the difference between the fair market value of the stock vesting and the original purchase price of that stock. However, to avoid this potentially disastrous tax consequence, a founder should make an 83(b) which prevents this. Section 83 in Title 26, Chapter 1 of the United States Code codifies this. ', '83(b) Election: 26 USC § 83(b)', 13, 'corporation, entity, tax, founders, stock ', '83b-election-26-usc-83b', '', 0, 0, '', 52),
(65, 'secondary', 'http://www.startupcompanylawyer.com/2008/02/15/what-is-an-83b-election/', 38, '<p>If stock vests overtime, each vesting milestone is a taxable event for the founder. The amount taxed is "income" and equals the difference between the fair market value of the stock vesting and the original purchase price of that stock. Usually the original purchase price of founder''s stock is very low ($0.01 or less in most cases). Furthermore, if the founders are putting some effort into their startup, the fair market value of stock is expected to rise.</p>\n<p>For example, a founder''s original stock price was $0.01 and after one year more stock vests. A portion of stock that is vesting has a fair market value of $1.00. The difference between these two portions of stock is $0.99. Thus, this is the amount that will be taxed for each stock.</p>\n<p>To avoid this potentially disastrous tax consequence, a founder should make an 83(b) election. By making this election, income is not recognized until purchase of the stock. Typically purchase price is the same as fair market value. Therefore, if the election is made, no income is recognized and nothing is taxed.</p>', 'Avoid Disastrous Tax Consequences: 83(b) Election', 11, 'corporation, entity, tax, founders, stock ', 'avoid-disastrous-tax-consequences-83b-election', '', 0, 0, '', 54),
(66, 'secondary', 'http://delcode.delaware.gov/title8/c001/sc03/index.shtml', 38, 'Title 8, § 131 requires every Delaware corporation  to maintain a registered agent in Delaware. The registered agent can be an individual, corporation, or another entity. ', 'DE Registered Agent Law', 5, 'corporation, entity, delaware, registered agent', 'de-registered-agent-law', '', 0, 0, '', 48),
(67, 'secondary', 'http://startuplawyer.com/incorporation/what-is-a-registered-agent', 38, '<p>A registered agent is someone, either a company or an individual, that a corporation appoints to receive official notices. This person is usually served a summons or complaint if your company is being sued. Corporations must have a registered agent. This agent must be available during normal business hours and be located within the relevant state that they''re registered in. If you fail to update your address or other contact information as a registered agent, the secretary of state might become the registered agent.</p>', 'What is a Registered Agent?', 9, 'corporation, entity, registered agent, llc', 'what-is-a-registered-agent', '', 0, 0, '', 49),
(68, 'secondary', 'https://delecorp.delaware.gov/tin/EntitySearch.jsp', 38, 'Search a name and entity type to see if it is available in Delaware. If it is, you will be able to register that name. ', 'Is Your Startup''s Name Available in Delaware', 8, 'corporation, llc, entity, name search, delaware', 'is-your-startups-name-available-in-delaware', '', 0, 0, '', 57),
(69, 'secondary', 'http://startuplawyer.com/incorporation/top-5-reasons-to-incorporate-in-delaware', 38, '<p>Delaware has flexible laws, a well established court for business issues, and relatively cheap fees. For these reasons, over 50% of U.S. publicly traded corporations and 60% of Fortune 500 companies are incorporated in Delaware.</p>\n1) <b>Flexible laws</b> - Delaware has the most flexible corporation laws in the United States. It is designed to provide flexibility om formation, structuring, and defining rights and duties.\n<br/><br/>\n2) <b>Judges</b> - Delaware has a special court to deal with corporation disputes called the Court of Chancery. This court uses judges instead of juries. Judges are more experienced in handling complex business matters and will probably decide cases better than a jury filled with laypersons.\n<br/><br/>\n3) <b>History</b> - Delaware has a long history of business litigation and court cases. For each case, judges issue opinions, which basically define how laws should be applied. Given the Court''s long history in Delaware, the laws are well defined and you can settle your case faster under these rules.\n<br/><br/>\n4) <b>Low Fees</b> - Delaware has lower incorporation fees than most other states. Right now it costs about $89. New York is about $125, and Texas is $300. California is $100 but you will have to pay about $800 a year in franchise fees.\n<br/><br/>\n5) <b>Privacy</b> - Delaware does not require the names of officers and directors to be named. Thus, you can protect this information more easily. ', 'Why Incorporate in Delaware?', 11, 'corporation, delaware, entity', 'why-incorporate-in-delaware', '', 0, 0, '', 96),
(70, 'document', 'http://www.docracy.com/5393/certificate-of-incorporation', 38, 'A certificate of incorporation (COI) is a legal document relating to the formation of a company. It contains a corporation''s articles of incorporation, which are the primary rules governing the management. This is an example of a COI.', 'Example Certificate of Incorporation', 5, 'corporation, entity, document, certificate of incorporation', 'example-certificate-of-incorporation', '', 0, 0, '', 45),
(72, 'secondary', 'http://www.nolo.com/legal-encyclopedia/corporation-basics-29867.html', 38, 'Corporations provide limited liability, which means \nthat creditors of the company can''t go after personal assets of members. However, corporate owners face double taxation because corporate income is taxed separately from personal income. Furthermore, corporations must follow certain formalities to retain its corporate status. ', 'Corporation Basics', 21, 'corporation, entity, limited liability, tax', 'corporation-basics', '', 0, 0, '', 155),
(73, 'secondary', 'http://www.nolo.com/legal-encyclopedia/corporations-vs-llcs-29025.html', 38, 'A LLC might be better for small businesses that prefer a simple and flexible management structure. A corporation might be preferable for businesses that expects to have multiple investors, provide extensive fringe benefits to owners, or offer stock options to employees. ', 'Corporations vs. LLCs', 11, 'corporation, s-corporation, llc, entity', 'corporations-vs-llcs', '', 0, 0, '', 74),
(75, 'secondary', 'http://www.nolo.com/legal-encyclopedia/llc-basics-30163.html', 38, '<p>A limited liability company (LLC) is a type of legal entity that has grown popular in the past 10 years. Here are some benefits of forming an LLC.</p>\n<b>Limited liability</b> - Similar to a corporation, an LLC provides limited liability to its members. Limited liability means that creditors of the company can''t go after personal assets of any member. Furthermore, if your LLC is sued and is ordered to pay out, you won''t have to pay from your personal account. You cannot be personally sued if the LLC breaches a contract or commits a tort.\n<br/><br/>\n<b>Flexible management</b> - Members of a LLC can operate their business with a flexible management structure. For example, owners can be designated to to take responsibility for managing the LLC, or they can just sit back.\n<br/><br/>\n<b>Tax advantage</b> - To the federal government, a LCC is not a separate tax entity. It is often referred to as a pass through tax entity, which means that the company''s income is "passed through" to the members, and then taxed. Thus, money is only taxed once in an LLC. Corporations on the other hand suffer the problem of double taxation.', 'LLC Basics', 13, 'llc, entity, limited liability, tax, management', 'llc-basics', '', 0, 0, '', 58),
(76, 'secondary', 'http://www.irs.gov/businesses/small/article/0,,id=98277,00.html', 38, '<p>An LLC is a business structure allowed by state statute. However, the federal government does not recognize it as a separate classification for federal tax purposes. An LLC business entity must file as a corporation, partnership or sole proprietorship tax return.</p>', 'LLCs and IRS Classification', 14, 'llc, tax, entity', 'llcs-and-irs-classification', '', 0, 0, '', 48),
(77, 'secondary', 'http://www.nolo.com/legal-encyclopedia/key-advantages-llc.html', 38, '<p>LLCs have flexibility, limited liability, pass-through taxation, and less administrative paperwork.  Most states allow single member or multiple member LLCs that can create their own operating agreements. Like most legal entities, LLCs protect members from liability, which prevents creditors of the company from pursuing personal assets of any member. Further, a LCC avoids double taxation because all income is passed through to the members and then taxed.</p>', 'Key Advantages of an LLC', 12, 'llc, tax, management, entity', 'key-advantages-of-an-llc', '', 0, 0, '', 100),
(78, 'secondary', 'http://mashable.com/2010/08/02/legal-structure-startup/', 38, 'Information on LLC, S-Corporation, and C-Corporation.', 'HOW TO: Legally Structure your Startup', 14, 'llc, corporation, s-corporation, entity', 'how-to-legally-structure-your-startup', '', 0, 0, '', 60),
(79, 'secondary', 'https://www.upcounsel.com/Public/Project/4ee287a3be61490db444739b', 38, 'Investors tend to prefer a Delaware Corporation. If the corporation is not incorporated in Delaware, it is advisable to form the corporation in your home state. If you plan on primarily compensating investors through cash disbursements then you should consider forming an LLC. Note that a corporate structure is far more suited for business developers that plan to pay employees, advisors, and contractors with equity ownership. Ultimately determining what type of business to form will depend on the pay structure of the corporation and the type of inventory/assets that will be held.', 'Choose A Legal Entity For Your Business', 11, 'llc, corporation, s-corporation, entity', 'choose-a-legal-entity-for-your-business', '', 0, 0, '', 51),
(80, 'secondary', 'http://startuplawyer.com/incorporation/how-many-shares-should-a-startup-company-authorize-at-incorporation', 38, 'Although the numbers of shares to issue at incorporation is somewhat arbitrary, some people like to have a larger absolute number of stock options. This can be enticing to certain individuals.', 'How Many Shares Should a Startup Company Authorize at Incoportation?', 12, 'stock, corporation, entity', 'how-many-shares-should-a-startup-company-authorize-at-incoportation', '', 0, 0, '', 62),
(81, 'secondary', 'http://startuplawyer.com/incorporation/par-value-for-a-startup-companys-stock', 38, 'Par value is the minimum price that a corporation can issue its shares. Many stocks have a par value of $1. It is recommended that a stock''s par value should be set at $0.0001 to as low as $0.00001. Thus, when a startup issues 7,000,000 shares at $0.0001 value, the founders pay $700.', 'Par Value for a Startup Company''s Stock', 14, 'stock, corporation, entity, par value', 'par-value-for-a-startup-companys-stock', '', 0, 0, '', 55),
(82, 'secondary', 'http://startuplawyer.com/preferred-stock/what-is-preferred-stock', 2, '<p>Preferred stock is a type of stock that provides certain economic rights such as liquidation preference, anti-dilution protection, and conversion rights. These protections are not given to holders of common stock. Generally, preferred stock dividends must be paid out before dividends to common stockholders. Further, in the event of liquidation, preferred stock holders are paid before common stock holders.</p> \n<p>Preferred stock is commonly issued when a startup undergoes a large financing, such as a venture capital fund. Common stock typically gets a lower valuation than preferred stock for the purposes of stock option grants.</p> ', 'What is Preferred Stock?', 17, 'stock, preferred stock, investors', 'what-is-preferred-stock', '', 0, 0, '', 60),
(83, 'secondary', 'http://www.investopedia.com/ask/answers/182.asp#axzz20AIxv9Ov', 2, 'Preferred stockholders have two advantages over common stockholders. First, they have a greater claim to a company''s assets and earnings. When dividends are distributed, preferred stockholders must be paid before common stock holders. Second, they generally receive greater dividends than common stock holders. Dividends for preferred stock are paid at regular intervals. However, this is not necessarily the case for common stock. Due to this, preferred stocks typically don''t fluctuate as often as common stock.', 'What is the difference between preferred stock and common stock?', 8, 'stock, preferred stock, common stock', 'what-is-the-difference-between-preferred-stock-and-common-stock', '', 0, 0, '', 65),
(84, 'secondary', 'http://startuplawyer.com/stock-options/what-is-an-option-pool', 2, 'An option pool is an amount of common stock that''s reserved for future issuances to employees, directors, advisers, and consultants. Unused portions of the option pool is included in the fully-diluted capitalization of the start-up, but the same unused portion isn''t included in the outstanding share count upon an acquisition or distribution. ', 'What is an Option Pool?', 5, 'stock, stock options', 'what-is-an-option-pool', '', 0, 0, '', 46),
(85, 'secondary', 'http://www.investopedia.com/university/mergers/', 2, 'A merger is a when two or more companies combine to make one new company. There are several types of mergers including horizontal (companies in direct competition), vertical (supplier and buyer companies), and a conglomeration (two companies that have no common business areas). An acquisition is when one company takes over another, destroying that original company. Mergers and acquisitions are done in order to create synergies and economies of scale, expand operations, and cut costs. Synergies and economies of scale are enhanced cost efficiencies, such as staff reductions, acquiring new technology, and having greater purchasing power.\n', 'Merger and Acquisition Introduction', 8, 'M&A', 'merger-and-acquisition-introduction', '', 0, 0, '', 40),
(86, 'secondary', 'http://business-law.lawyers.com/buying-selling-businesses/Business-Basics-of-Mergers-and-Acquisitions.html', 2, '<p>A merger occurs when two or more businesses join together to create a new business. Each business''s assets, debts, and liabilities are combined, as well as any real estate, and become part of the new business. An acquisition is when one business buys or takes over another business. The buying company remains intact in an acquisition. The acquired company is integrated into the buying company, and its owners are often compensated with cash or stock.</p>\n\n<p>When approaching a merger or acquisition, lawyers and financial experts are almost always consulted for their role in making the process as smooth as possible. Many terms can be negotiated between the parties involved. An experienced M&A lawyer can help you negotiate and define terms as well as help you close with potential acquirers.</p>', 'Business Basics of Mergers and Acquisitions', 20, 'M&A', 'business-basics-of-mergers-and-acquisitions', '', 5, 0, '', 1024),
(87, 'document', 'https://www.docracy.com/3835/assignment-of-copyright', 41, 'When a employee or contractor produces work, he or she owns the property rights to that work. A assignment of a copyright agreement is used to transfer those rights to the company. The agreement  contains a description of the types of rights that an owner has and which will be transferred. This is a generic document that can be tailored.', 'Assignment of Copyright', 5, 'ip, copyright, ip assignment, document', 'assignment-of-copyright', '', 0, 0, '', 50),
(88, 'secondary', 'http://www.iplawforstartups.com/why-copyright-assignments-can-be-critical-for-startups/', 41, 'Copyright assignments are important because you want to be the owner of copyrighted worked done by independent contractors for your business. Otherwise, the contractor will be the copyright owner and you will need permission to use the work. This is especially important if you paid for the work, such as a logo or website design. ', 'Why Copyright Assignments Can Be Critical for Your Company', 8, 'ip, copyright, ip assignment', 'why-copyright-assignments-can-be-critical-for-your-company', '', 0, 0, '', 70),
(89, 'secondary', 'http://www.iplawforstartups.com/does-copyright-law-protect-apis-google-and-oracle-want-to-know/', 41, 'A recent case between Google and Oracle has sparked debate as to whether or not API''s should be protected. API''s are a set of instructions that allows software components to talk to one another. Since copyrights do not protect all written expression, API''s could be considered merely methods or operation or interface access buttons. ', 'Does Copyright Law Protect APIs? ', 14, 'ip, copyright, api, google', 'does-copyright-law-protect-apis', '', 5, 0, '', 50),
(90, 'secondary', 'http://www.law.cornell.edu/uscode/text/17/chapter-1', 41, 'Title 17, Chapter 1 of the United States Code contains the laws on copyright. For example, 17 § 102 states that the following can be copyrighted: literary works, musical works, dramatic works, sound recordings, motion pictures, graphics, etc. You can explore the different sections here. ', 'Definition of Copyright', 15, 'ip, copyright, definition', 'definition-of-copyright', '', 0, 0, '', 47),
(91, 'secondary', 'http://www.law.cornell.edu/uscode/text/17/107', 41, 'The fair use exception allows for the limited use of copyrighted materials without permission from the rights holder. It serves as a perfect defense to claims of copyright infringement based on a four-factor balancing test codified in 17 U.S.C. 106A.  Under this statute, the purpose of use may include, but is not limited to “criticism, comment, news reporting, teaching (including multiple copies for classroom use), scholarship, or research.”', 'Fair Use Exception', 9, 'ip, copyright, fair use', 'fair-use-exception', '', 0, 0, '', 48),
(93, 'secondary', 'http://www.uspto.gov/patents/resources/general_info_concerning_patents.jsp#heading-2', 41, 'A patent is a grant by a government that gives a creator of an invention the sole right to make, use, and sell that invention for a period of time. The grant also gives the creator the right to exclude other from making, using, offering for sale, or selling the invention. In the US, patent grants usually last for 20 years.  The following things can be patented: a process, machine, manufacture, and composition of matter.  One exception is that the use of special nuclear material or atomic energy in an atomic weapon cannot be patented. Patents must also be "new" and "useful." A "useful" item refers to an invention or process that serves a beneficial purpose and operates/performs in the way that it was designed. “New” means that the invention is not described in a printed publication or patented by others in the US or a foreign country. If neither of these are met, then a patent probably cannot be obtained.', 'What is a Patent?', 12, 'ip, patent', 'what-is-a-patent', '', 0, 0, '', 47),
(94, 'news', 'http://techcrunch.com/2012/06/21/do-patents-really-matter-to-startups-new-data-reveals-shifting-habits/', 41, 'Arguments about the value of patents have heated up over the past few years. Software patents in particular have come under increasing scrutiny from thought leaders in the start-up ecosystem, yet later-stage companies like Facebook continue to pay huge sums to acquire patent portfolios. Just how much attention are start-ups paying to patents?', 'Do Patents Really Matter To Startups?', 10, 'ip, patent, investors', 'do-patents-really-matter-to-startups', '', 0, 0, '', 54),
(95, 'secondary', 'http://blog.upcounsel.com/should-i-get-a-patent-for-startups-and-young-companies/', 41, 'There are several things to consider before applying for a patent including: whether the idea is patentable, is there already a patent out there for the idea, if the idea is better protected with a trade secret, and if it is the right time to get a patent. Timing is very important because you want to make sure that the product will not change before reaching consumers. Otherwise, a lot of money can be wasted filing the patent. ', 'Should I Get A Patent?', 8, 'ip, patent, register', 'should-i-get-a-patent', '', 0, 0, '', 55),
(96, 'news', 'http://techcrunch.com/2012/04/15/why-startups-should-pay-attention-to-skyrocketing-patent-prices/', 41, 'As large companies increasingly look to protect their revenue streams through IP risk mitigation, startups with strong patent holdings will become increasingly valuable because they provide an opportunity to remove dual potential threats to the potential acquirer''s revenue stream -- as a competitor and as a patent threat.', 'Why Startups Should Pay Attention To Skyrocketing Patent Prices', 9, 'ip, patent', 'why-startups-should-pay-attention-to-skyrocketing-patent-prices', '', 0, 0, '', 48),
(97, 'secondary', 'http://www.trademarkia.com/', 41, 'A trademark is a distinctive sign or indicator that is used to help consumers identify and distinguish products or services of a specific business. A trademark is usually a word, phrase, name, symbol, logo, design, image or combination of the above. Use trademarkia to preform a free search to see if a trademark is available.', 'Free Trademark Search Online', 11, 'ip, trademark, name search', 'free-trademark-search-online', '', 0, 0, '', 110),
(98, 'secondary', 'http://www.law.cornell.edu/uscode/text/15/1052', 41, 'Title 15, Chapter 22 of the United States Code contains the laws on trademarks. You can explore the different sections here. ', 'Law on Registering a Trademark', 9, 'ip, trademark, register', 'law-on-registering-a-trademark', '', 0, 0, '', 38),
(99, 'secondary', 'http://www.thomasfirm.com/trademarks.html', 41, '<p>A trademark is a distinctive sign or indicator that is used to help consumers identify and distinguish products or services of a specific business or person. A trademark is usually a word, phrase, name, symbol, logo, design, image or combination of the above. The main purpose of a trademark is to identify a business as the source of specific goods or services. You are not required to register a trademark and can establish rights over that mark based on legitimate use.</p>', 'What is a Trademark?', 12, 'ip, patent, trademark, name search', 'what-is-a-trademark', '', 5, 0, '', 87),
(100, 'secondary', 'http://www.uspto.gov/trademarks/index.jsp', 41, 'Before registering a Trademark it is important to know: 1) the mark you want to register; 2) the goods and/or services in connection to the mark; and 3) whether you are filing based on existing use of the mark or intention to use the mark.  Knowing this will make your search of the existing USPTO database of registered trademarks simpler.   ', 'Trademark Basics', 5, 'ip, trademark, register', 'trademark-basics', '', 0, 0, '', 46);
INSERT INTO `links` (`id`, `type`, `url`, `category`, `summary`, `title`, `votes`, `tags`, `slug`, `source`, `poster`, `date_created`, `location`, `views`) VALUES
(102, 'news', 'http://techcrunch.com/2012/06/01/whoshere-vs-wnm-live/', 41, 'So here''s a story that hopefully will be an eye-opener for entrepreneurs and startups, while providing a painful peek into trademark harassment and the importance of due diligence. It goes a little something like this: About two years ago, software engineer Brian Hamachek decided to build an app first on Windows Mobile (how some horror stories have been known to begin), then on Windows Phone, that enables location-based chat -- and calling.', 'Startups Vs. Startups: App Developer Gets Sued By Lightbank-Backed WhosHere', 7, 'ip, trademark, whoshere, litigation, apps', 'startups-vs-startups-app-developer-gets-sued-by-lightbank-backed-whoshere', '', 0, 0, '', 51),
(104, 'document', 'http://www.docracy.com/1/generic-nda', 40, 'A Non-disclosure Agreement is a contract between two parties that restricts the sharing of confidential materials to others. It is necessary if a company is sharing confidential information to another person, such as an employee or contractor, and wants that person not to disclose the information to others. Here is an example of a generic NDA that can be tailored to fit the needs of a business.  ', 'Generic NDA that can be Tailored', 14, 'document, nda, ip', 'generic-nda-that-can-be-tailored', '', 0, 0, '', 63),
(105, 'document', '', 40, '<p>A Non-disclosure agreement (NDA) is a contract between two parties that outlines confidential information which cannot be shared or disclosed to others. It typically protects non-public business information. NDAs are important to make sure a person does not disclose confidential information, such as trade secrets. This is a short sample NDA for an internet startup that can be tailored:</p>\nTHIS Nondisclosure Agreement (the "Agreement") is made and entered into as of Date, by and between Name of Company (the "Company") and Name of Other Party, (the "Recipient") (collectively, the "Parties").\n<br/><br/>\nThe Parties hereby agree as follows:\n<br/><br/>\n1. For purposes of this Agreement, "Confidential Information" shall mean any and all non-public information the Company has disclosed or may disclose to the Recipient, including but not limited to information related to: production of legal materials, software development and design, business or software architecture, software not yet known to the public, clients or prospective clients, internal communications, events, or meetings, or any other research, development, operations, marketing, transactions, regulatory affairs, discoveries, inventions, methods, processes, articles, materials, algorithms, formulas, specifications, designs, drawings, data, strategies, plans, prospects, know-how and ideas, whether tangible or intangible, and including all copies, analyses and other derivatives thereof.\n<br/><br/>\n2. The Recipient agrees (i) not to disclose any Confidential Information or any information derived therefrom to any third person, (ii) to keep the Company’s Confidential Information confidential and take all the reasonable precautions to protect the confidentiality of such Confidential Information with the same degree of care with which it protects the confidentiality of its own confidential information, but in no event with less than a reasonable degree of care, and (iii) not to use any Confidential Information for any purpose whatsoever except to advance the legitimate business interests of the Company under written or oral instruction of the Company’s authorized officers.\n<br/><br/>\n3. All right, title, and interest in and to the Confidential Information shall remain with Company or its licensors. Nothing in this Agreement is intended to grant any rights to Recipient under any patents, copyrights, trademarks, or trade secrets of Company.\n<br/><br/>\n4. The validity, construction and enforceability of this Agreement shall be governed in all respects by the law of the State of Delaware. This Agreement may not be amended except in writing signed by a duly authorized representative of the respective Parties. This Agreement shall control in the event of a conflict with any other agreement between the Parties with respect to the subject matter hereof. The failure of either party to enforce its rights under this Agreement at any time for any period shall not be construed as a waiver of such rights.\n<br/><br/>\nIN WITNESS WHEREOF, the Parties have executed this Agreement as of the date first above written.', 'Short NDA for Internet Startup', 21, 'document, nda, ip', 'short-nda-for-internet-startup', '', 0, 0, '', 106),
(106, 'secondary', 'http://www.investopedia.com/terms/n/nda.asp#axzz20jirrd3v', 40, 'A Non-disclosure agreement (NDA) is an agreement between two parties that outlines confidential information that cannot be shared or disclosed to others. It is necessary if a company is sharing confidential information to another person, such as an employee, and wants that person not to disclose the information to others. ', 'What is an NDA?', 11, 'nda', 'what-is-an-nda', '', 0, 0, '', 85),
(107, 'secondary', 'http://www.ehow.com/how_4456521_write-nondisclosure-agreement.html', 40, 'A non-disclosure agreement (NDA) is a contract where the signer agrees to not disclose proprietary or confidential information about a business. The best way to write an NDA is to determine the worst case scenario and tailor the NDA to prevent that situation from occurring. It is important to define what confidential information you do not want disclosed.', 'How to Write an NDA', 11, 'nda, document', 'how-to-write-an-nda', '', 0, 0, '', 56),
(108, 'document', 'http://contracts.onecle.com/type/21.shtml', 40, 'A Non-compete is a contract used to stop a person (usually an employee) from pursuing a similar profession or trade in competition against a company. This is important because upon termination the employee might begin working for a competitor or start a business that is in direct competition with the original company, and use knowledge gained from that original company to his or her advantage. Here are examples of non-compete agreements that can be tailored to fit your needs.     ', 'Example Non-compete Agreements', 9, 'document, non-compete', 'example-non-compete-agreements', '', 0, 0, '', 38),
(109, 'secondary', 'http://www.ehow.com/how_4486945_write-noncompete-agreement.html', 40, 'A Non-compete is a contract used to stop a person (usually an employee) from pursuing a similar profession or trade in competition against a company. In writing a Non-compete Agreement it is important to define what the employee or contractor can or cannot do. It is also a good idea to include a non-consulting clause and a penalty clause in case the agreement is broken. Check out examples to help you write your non-compete. ', 'How to Write a Non-compete Agreement', 7, 'non-compete', 'how-to-write-a-non-compete-agreement', '', 0, 0, '', 36),
(110, 'document', 'http://www.docracy.com/48/technology-assignment-agreement', 41, 'A Technology Assignment Agreement or IP Assignment Agreement transfers IP rights to your company with respect to work produced by an employee or contractor. Otherwise, the employee or contractor will be the copyright holder and you will need permission to use the work. Therefore, it''s important to make sure you have these documents. Here is an example of a Technology Assignment Agreement. ', 'Technology Assignment Agreement', 8, 'ip, document, ip assignment', 'technology-assignment-agreement', '', 0, 0, '', 50),
(111, 'document', 'http://www.docracy.com/6480/short-ip-assignment-agreement-for-internet-startup', 41, 'When an employee or contractor produces work, he or she holds the intellectual property rights to the work. However, an IP Agreement transfers those rights to the company, thereby allowing the company to use the work in whichever way it pleases. Here is an example of an IP Assignment Agreement that can be tailored.', 'IP Assignment Agreement', 12, 'ip, document, ip assignment', 'ip-assignment-agreement', '', 0, 0, '', 65),
(112, 'secondary', 'http://www.baercrossey.com/892/startup-killer', 40, 'Investors typically dislike to invest in a company that doesn''t have exclusive ownership of its IP. For this reason, it is important to have IP Assignment and Non-disclosure Agreements (NDA) from your employees and contractors. An IP Assignment Agreement transfers to the company IP rights to work product created by the employee or contractor. A NDA is used to make sure that the employee or contractor does not disclose confidential information to third parties about any non-public business information. Both are important to protect a company''s ip rights. ', 'Startup Killer: Not Getting Confidentiality/IP Assignment Agreements From Employees', 7, 'ip, ip assignment, nda', 'startup-killer-not-getting-confidentialityip-assignment-agreements-from-employees', '', 0, 0, '', 76),
(113, 'document', 'http://www.docracy.com/42/docracy-terms-of-service-1-', 40, 'Terms of Service are rules which a user must agree to abide by in order to use a service. Commonly, Terms of Service will have rules in which visitors have to follow. Different types of websites will have different kinds of Terms of Service. This is an example of Terms of Service for Docracy.', 'Terms of Service for Your Website', 17, 'document, terms of service, website', 'terms-of-service-for-your-website', '', 0, 0, '', 45),
(114, 'secondary', 'http://en.wikipedia.org/wiki/Terms_of_service', 2, 'Terms of Use are rules that a user must agree to follow in order to use a service. A disclaimer is often found within a Terms of Use. Websites that require a high level of community trust or handle transactions involving money tend to have carefully designed terms of service. Most organization will restrict a user''s access to the service if that person violates the Terms of Use.', 'Terms of Service Overview', 7, 'terms of service', 'terms-of-service-overview', '', 0, 0, '', 47),
(115, 'secondary', 'http://curiosity.discovery.com/question/terms-service-agreement-important', 2, 'Terms of Use lay out the rules people should know to navigate your website. It helps protect the website from legal claims. The terms should inform visitors that information can change without notice and as an owner of the website you set the rules.  ', 'Why is a Terms of Service Important', 14, 'terms of service', 'why-is-a-terms-of-service-important', '', 0, 0, '', 52),
(116, 'document', 'http://www.docracy.com/25/wordpress-privacy-policy-', 40, 'A privacy policy is used to inform visitors what type of information will be collected from them. This legal document discloses some or all of the ways a party gathers, uses, discloses, and manages a customer or client''s data. This is a sample of WordPress.org''s privacy policy and contains the common issues that privacy policies should contain.  ', 'Privacy Policy', 12, 'privacy policy, document, website', 'privacy-policy', '', 0, 0, '', 42),
(117, 'secondary', 'http://www.privacytrust.org/guidance/privacy_policy.html', 2, 'A privacy policy is one of the most important documents on any website because it details your company''s views and procedures on the information collected from visitors. Although a privacy policy is technically a legal document, great effort should be made to craft a document that is both accurate and easy to understand. It''s probably not a good idea to have obscure or hidden clauses.', 'Why is a  Privacy Policy Important?', 8, 'privacy policy', 'why-is-a-privacy-policy-important', '', 0, 0, '', 43),
(118, 'secondary', 'http://www.markwelchblog.com/2010/11/10/why-is-a-privacy-policy-important/', 2, 'Websites that do not have a privacy policy are seen as less professional and not as trustworthy. Consumers constantly evaluate the types of websites they visit. A reputable or trustworthy website will often have a "privacy policy," "about us," and "contact us" section.  ', 'Why Is a Privacy Policy Important?', 17, 'privacy policy, website', 'why-is-a-privacy-policy-important2', '', 0, 0, '', 67),
(119, 'secondary', 'http://blog.upcounsel.com/hiring-interns/', 33, '<p>There are federal requirements that must be followed in order to legally use unpaid interns. This includes:</p>\n1) the internship is similar to training given in an educational environment \n<br/><br/>\n2) the internship is for the benefit of the intern\n3) the intern does not replace regular employees and works under close supervision\n<br/><br/>\n4) the employer does not receive any immediate advantage from the intern and is occasionally slowed down by the intern\n<br/><br/>\n5) the intern is not entitled to a job at the end of the internship and\n<br/><br/>\n6) the employer and intern understand that the intern is not entitled to wages.\nCalifornia has additional requirements.', 'The Basics Of Hiring Interns For Your Startup', 11, 'interns, employment', 'the-basics-of-hiring-interns-for-your-startup', '', 0, 0, '', 99),
(120, 'secondary', 'http://www.dol.gov/whd/regs/compliance/whdfs71.htm', 33, 'An internship should be designed as an extension of the worker''s educational experience and should be for the benefit of the worker, not your company. The worker should not be engaged in the regular and routine work of your company''s operations that benefit the company. If the purpose of the internship is to derive benefit to your company, the worker is probably not an intern.', 'Educational Experience for Your Intern', 5, 'interns, employment', 'educational-experience-for-your-intern', '', 0, 0, '', 48),
(121, 'news', 'http://techcrunch.com/2012/06/10/startup-act-2-0-great-for-foreign-graduate-students-but-not-foreign-tech-entrepreneurs/', 36, 'When it comes to U.S. visas, company founders are among the most discriminated folks. Unlike employees, they cannot get a work visa (called H1-B) – or any other long-term visa.', 'Startup Act 2.0: Great For Foreign Graduate Students, But Not Foreign Tech Entrepreneurs', 17, 'immigration', 'startup-act-20-great-for-foreign-graduate-students-but-not-foreign-tech-entrepreneurs', '', 0, 0, '', 34),
(122, 'news', 'http://techcrunch.com/2012/03/16/crowdfundingstartups/', 2, 'Last week, the U.S. House of Representatives passed the JOBS Act, a bipartisan bill aimed at supporting small businesses by making it easier for them to access capital. A key feature of the bill enables crowdfunding, the process by which small companies raise growth capital from a large number of individual investors.', 'How The JOBS Act Could Change Startup Investing Forever', 11, 'jobs act, investors', 'how-the-jobs-act-could-change-startup-investing-forever', '', 0, 0, '', 44),
(123, 'news', 'http://www.forbes.com/sites/theyec/2012/07/13/10-common-pitfalls-of-new-entrepreneurs-and-how-to-avoid-them/', 40, 'Starting a business is pretty tricky for the uninitiated, and what you don''t know can be disastrous. Most small business fail within the first five years, but that''s often because of easily avoidable mistakes. If you''re planning to start a new business, especially one that''s service-based, here are some pointers to help you avoid some of the most common startup pitfalls: Use a contract.', '10 Common Pitfalls of New Entrepreneurs - and How to Avoid Them', 21, 'employment, tax, document', '10-common-pitfalls-of-new-entrepreneurs-and-how-to-avoid-them', '', 0, 0, '', 110),
(124, 'secondary', 'https://www.upcounsel.com/Public/Overview/4f6a8156be61497c3c59c585', 40, '<p>An advisor can be a great asset for a startup. In most instances, an advisor is someone who is well respected in your industry and will lend his or her name to your startup, giving it credibility. When you add an advisor to your company, it''s a good idea to follow several steps.</p> \n\n<b>NDA (Opitional)</b> - Although optional, it might be a good idea to execute a pre-relationship non-disclosure agreement (NDA) with a potential advisor, especially if you plan on disclosing private business information. For example, your potential advisor might also be a potential competitor. An NDA will make sure that any important information you disclose will remain confidential.\n<br/><br/>\n<b>Equity</b> - Equity is the standard form of compensation for an advisor and it is important to decide how your startup is willing to give up. This usually depends on how developed your startup is and how involved the advisor is expected to be. Typically advisors receive 0.10-1%, though it may be high as 2% sometimes. Make sure the equity vest over time; a 2 year vesting schedule is common. This way if your advisor is not performing up to par, you can cut your loses without losing more equity. As always, the amount is negotiable. \n<br/><br/>\n<b>Advisory Agreement</b> - An advisory agreement is a contract that lays out what is expected from the advisor in exchange for equity. Be sure to negotiate exact terms and keep things clear. That way both you and your advisor know what the rules are. You can put almost anything in a contract, so make sure you reach an agreement you are comfortable with.', 'How to Add an Advisor', 14, 'advisor, nda, document', 'how-to-add-an-advisor', '', 0, 0, '', 72),
(125, 'secondary', 'http://www.law.cornell.edu/constitution/articlei#section8', 36, 'The federal government has reserved the right to regulate immigration, although it is not explicitly mentioned in the Constitution. The power is an extension of its explicit right to establish the rules of naturalization. Naturalization Clause: Article I Â§ 8 Clause 4.    ', 'The Federal Government Regulates Immigration: Not States', 11, 'immigration, constitution', 'the-federal-government-regulates-immigration-not-states', '', 0, 0, '', 41),
(126, 'secondary', 'http://supreme.justia.com/cases/federal/us/426/88/case.html', 36, 'In Hampton v. Mow Sun Wong, the Supreme Court found that the power of the federal government to establish a uniform Rule of Naturalization implies the federal power to regulate immigration. This ruling granted greater leeway for the federal government than what the states had.', 'Case That Affirmed the Federal Government''s Right to Regulate Immigration ', 11, 'immigration, federal', 'case-that-affirmed-the-federal-governments-right-to-regulate-immigration', '', 0, 0, '', 42),
(127, 'secondary', 'http://www.dhs.gov/xlibrary/assets/s1-exercising-prosecutorial-discretion-individuals-who-came-to-us-as-children.pdf', 36, 'The Secretary of Homeland Security, Janet Napolitano, wrote a memo outlining the department''s new policy to not prosecute illegal aliens who were brought into this county as children. In order to qualify, the person must have 1) entered the US under the age of sixteen, 2) has continuously lived in the US for at least five years, 3) is currently in school, graduated high school, or obtained a general education development certificate, 4) has not been convicted of serious or multiple crimes, and 5) is not above the age of thirty. The department is allowed to do this because it has discretion in prosecuting immigrants.', 'Obama: Illegal Children Will Not be Deported', 15, 'immigration, obama', 'obama-illegal-children-will-not-be-deported', '', 0, 0, '', 48),
(128, 'secondary', 'http://dreamact.info/', 36, 'The DREAM Act (Development, Relief, and Education for Alien Minors, is a bill that provides conditional permanent residency to certain illegal individuals. The individuals must have arrived in the US as minors, have lived in the US continuously for five years, and graduate from high school. The bill was first introduced in 2001 and has yet to pass.', 'What is the DREAM Act?', 15, 'immigration, dream act', 'what-is-the-dream-act', '', 0, 0, '', 41),
(129, 'secondary', 'http://www.youtube.com/watch?v=MXnqhG2h9QA', 36, 'Around 20% of illegal immigrants are under the age of 18. The DREAM Act seeks to provide young immigrants U.S. residency to those that 1. entered the country before the age of 16; 2. have an American high school diploma or GED; 3. are 35 years or younger; 4. have no criminal record. Those that are eligible are allowed to complete a 2-year degree or serve for 2 years in the military. This program will result in an annual fiscal contribution of $9,200 per person.  ', 'A Dream Act Infographic', 4, 'immigration, dream act', 'a-dream-act-infographic', '', 0, 0, '', 51),
(130, 'photo', 'http://www.stokelybaksh.com/wp-content/uploads/2011/08/state_legislations_CL.jpg', 36, 'In the past couple years, several states, including Arizona and Alabama, have taken anti-illegal immigration measures. Such bills have been challenged under constitutional and civil rights protections. In 2012, the Supreme Court struck down several provisions of Arizona''s controversial immigration law because they violated the Supremacy Clause of the Constitution. However, the status of illegal immigrants remain uncertain under the Obama administration. ', 'Immigration Reform', 10, 'immigration, states', 'immigration-reform', '', 0, 0, '', 0),
(131, 'secondary', 'http://www.azdatapages.com/sb1070.html', 36, 'SB 1070 was a legislative act enacted by the state of Arizona. This act was considered one of the broadest and strictest anti-immigration acts in recent U.S. History. The law required all aliens over the age of 14 to register with the U.S. government and be in possession of these registration documents at all times. The legislation is said to encourage racial profiling due to the broad and arbitrary powers that the state police force are given. The Supreme Court later struck down three of the main provisions in the act in the case, Arizona v. United States.', 'Arizona''s Controversial Immigration Law', 8, 'immigration, arizona', 'arizonas-controversial-immigration-law', '', 0, 0, '', 39),
(132, 'secondary', 'http://en.wikipedia.org/wiki/Arizona_SB_1070', 36, 'Arizona SB 1070 is an anti-illegal immigration bill signed into law in 2012. It has received national attention for its strict regulations and encouragement of racial profiling. Some of its provisions include: an alien must carry required documents at all time and the police can investigate a person''s immigration status during a legal stop. In June 2012, the Supreme Court struck down some of the bill''s provisions as unconstitutional.   ', 'Overview of Arizona''s Controversial Immigration Law', 13, 'immigration, arizona', 'overview-of-arizonas-controversial-immigration-law', '', 0, 0, '', 47),
(133, 'secondary', 'http://www.supremecourt.gov/opinions/11pdf/11-182b5e1.pdf', 36, 'The Supreme Court ruled that it was unconstitutional for Arizona to pass laws that: 1. required legal immigrants to carry registration documents at all times; 2. have state police arrest any individual on suspicion of being an illegal immigrant; 3. disallow an illegal immigrant to search for a job (or to hold one) in the state. The Supreme Court, however, upheld the policy that allowed Arizona state police to investigate the immigration status of individuals that were stopped, detained, or arrested as long as there was reasonable suspicion that the individual was in America illegally. ', 'Arizona''s Immigration Law Ruled Unconstitutional', 12, 'immigration, arizona, supreme court, unconstitutional', 'arizonas-immigration-law-ruled-unconstitutional', '', 0, 0, '', 46),
(134, 'secondary', 'http://en.wikipedia.org/wiki/Arizona_v._United_States', 36, 'In Arizona v. United States (2012), the Supreme Court ruled that some provisions of Arizona''s anti-illegal immigration (Arizona SB 1070) bill were unconstitutional under the theory of federal preemption. The federal government has the authority to regulate immigration. However, Arizona passed regulations that conflicted with federal law. Thus, those regulations were found to be invalid. The three provisions struck down were: 1) requiring immigrants to carry legal documents at all times; 2) allowing police to arrest any person for suspicion of being an illegal immigrant; and 3) making it a crime for an illegal immigrant to search for a job. ', 'The Supreme Court Case That Invalided Arizona''s Immigration Law', 8, 'immigration, arizona, supreme court, unconstitutional', 'the-supreme-court-case-that-invalided-arizonas-immigration-law', '', 0, 0, '', 47),
(135, 'secondary', 'http://latindispatch.com/2011/06/09/text-of-alabama-immigration-law-hb-56/', 36, 'Alabama recently enacted a statute that requires public schools to check the immigration status of students, criminalize citizens that give rides to illegal immigrants, requires employers to use E-Verify to check potential employee''s status, and instruct police to check the immigration status of anyone they stop if that person is suspected of being an undocumented immigrant. ', 'Alabama''s Controversial Immigration Law', 12, 'immigration, alabama', 'alabamas-controversial-immigration-law', '', 0, 0, '', 41),
(136, 'secondary', 'http://en.wikipedia.org/wiki/Alabama_HB_56', 36, 'Alabama HB 56 is an anti-immigration bill, signed into law on June 2011. Some of its provisions include: allowing officers to attempt to investigate a person''s immigration status midst any legal stop, requiring public schools to ascertain the immigration status of students, and prohibiting landlords from renting property to illegal aliens. These regulations are stricter than Arizona''s anti-immigration bill, which received national attention in summer 2012. ', 'Overview of Alabama''s Controversial Immigration Law', 14, 'immigration, alabama', 'overview-of-alabamas-controversial-immigration-law', '', 0, 0, '', 61),
(137, 'secondary', 'http://caselaw.lp.findlaw.com/data/constitution/article06/', 36, 'Federal laws may invalidate conflicting State laws. This is laid down in the Supremacy Clause of the Constitution and is called federal premption. In the case of immigration laws...', 'Supremacy Clause and Immigration', 13, 'immigration, supremacy clause, constitution', 'supremacy-clause-and-immigration', '', 0, 0, '', 40),
(138, 'secondary', 'http://www.immigrationworksusa.org/index.php?p=192', 36, 'Federal preemption is a legal term used to describe a situation where a federal law invalidates a State law. This  usually happens when there is a State law that conflicts with a federal law. Federal preemption is derived from the Supremacy Clause in the Constitution, which declares that federal law is the supreme law of the land. ', 'Federal Preemption Invalidates State Immigration Laws', 10, 'immigration, federal preemption', 'federal-preemption-invalidates-state-immigration-laws', '', 0, 0, '', 49),
(139, 'secondary', 'http://legal-dictionary.thefreedictionary.com/Supremacy+Clause', 36, 'The Supremacy Clause ensures that the laws and articles of the U.S. Constitution is the supreme law of the land. Chief Justice John Marshall discussed the concept of federal supremacy in the landmark case McCulloch v. Maryland. Essentially, though state legislatures are free to enact and enforce laws, each state much be aware and conscious of federal laws and potential conflicts that may occur.', 'What is the Supremacy Clause?', 14, 'immigration, supremacy clause', 'what-is-the-supremacy-clause', '', 0, 0, '', 41),
(140, 'photo', 'http://3.bp.blogspot.com/_N_aDa0MnjQE/S9jnIqCWQwI/AAAAAAAAAGI/Z7wZ_LLlB2c/s1600/transparency-1.jpg', 35, 'In 2010, Obama signed into law the Patient Protection and Affordable Care Act, also known as Obamacare. The law is meant to provide incentives for people to secure health benefits. One controversial section of the bill is the individual mandate, which imposes a penalty on persons who do not purchase health insurance. However, the Supreme Court has ruled that the mandate is constitutional under Congress''s designated taxing power. ', 'Healthcare Reform', 19, 'healthcare reform, obamacare', 'healthcare-reform', '', 0, 0, '', 6),
(142, 'photo', 'http://images.onlineuniversity.net.s3.amazonaws.com/new-student-loan-deal.jpg', 1, 'In 2010, Obama signed into law the Health Care and Education Reconciliation Act of 2010, which included a number of loan reforms for students. Its provisions included: an increase in Pell Grant awards, loan forgiveness after 20 years (previously 25), a cap on repayments at 10% (previously 15%), and increasing funding.', 'Education Reform', 11, 'education, student loans', 'education-reform', '', 0, 0, '', 0),
(143, 'photo', 'http://sociable.co/wp-content/uploads/2011/12/SOPA-business-infographic-488x2761.png', 37, 'The Stop Online Piracy Act (SOPA) is a bill that expands the rights of law enforcement to fight illegal sharing of copyrighted materials. One big concern over this legislation centers over the possibility that it can cause serious complications instead of solutions. The government could essentially have the power to censor larges portions of popular public websites.', 'SOPA', 11, 'sopa, business, innovation', 'sopa', '', 0, 0, '', 8),
(292, 'news', 'http://www.buzzfeed.com/chrisgeidner/federal-trial-court-in-connecticut-strikes-down-do', 1, 'U.S. District Court Judge Vanessa L. Bryant today held in a federal case in Connecticut that Section 3 of the Defense of Marriage Act - the federal definition of marriage - is unconstitutional. Bryant, in a case brought by Gay & Lesbian Advocates & Defenders, follows several other federal judges over the past two years to have reached the same conclusion.', 'Federal Trial Court In Connecticut Strikes Down DOMA''s Marriage Definition', 11, 'doma, unconstitutional', 'federal-trial-court-in-connecticut-strikes-down-domas-marriage-definition', '', 0, 0, '', 35),
(145, 'news', 'http://www.huffingtonpost.com/2012/06/28/obamacare-women-supreme-court-contraception-pregnancy_n_1634480.html', 35, 'WASHINGTON -- Although the requirement that contraception be covered by employers'' health care plans was not an issue addressed by the Supreme Court on Thursday, the measure has become one of the most controversial aspects of the Affordable Care Act.', 'Obamacare Ruling Is ''Major Victory'' For Women', 10, 'healthcare reform, women, obamacare', 'obamacare-ruling-is-major-victory-for-women', '', 0, 0, '', 42),
(146, 'secondary', 'http://inventors.about.com/od/trademarks/a/register.htm', 41, 'You are not required to register a trademark and can establish rights over that mark based on legitimate use. However, the benefits of having a registered trademark include: constructive notice nationwide of the trademark owner''s claim, additional evidence of the ownership of the trademark, jurisdiction of federal courts may be invoked, and registration can be used as a basis for obtaining registration in other countries.', 'Why You Should Register a Trademark', 13, 'ip, trademark, register', 'why-you-should-register-a-trademark', '', 0, 0, '', 64),
(147, 'secondary', 'https://www.google.com/?tbm=pts&hl=en', 41, 'With Google Patents, you can search the full text of the U.S. patent corpus. The search engine covers the entire collection of issued patents and millions of patent application made available by the USPTO, from patents issued in the 1790s through the present.', 'Search for Patent', 16, 'ip, patent, name search', 'search-for-patent', '', 0, 0, '', 50),
(148, 'news', 'http://walkercorporatelaw.com/entrepreneurship/issuing-stock-options-ten-tips-for-entrepreneurs/', 2, 'Stock options should be issued ASAP. This is so that employees can profit from any increase in revenue. Moreover, a company should establish a realistic vesting schedule. This will incentivize the employees to remain with the company to help grow the business.', 'Issuing Stock Options: Ten Tips For Entrepreneurs', 7, 'tax, stock, stock options, employment', 'issuing-stock-options-ten-tips-for-entrepreneurs', '', 0, 0, '', 45),
(149, 'news', 'http://money.msn.com/auto-insurance/7-ways-to-talk-your-way-out-of-a-ticket', 3, 'Cities and counties are in huge budget deficits. They need more revenue to make up for lavish spendings and high cost. Reasonable or not, there is no excuses any more. It used to be about education, warnings, and reasonable fine.', '7 ways to talk your way out of a ticket', 9, 'traffic', '7-ways-to-talk-your-way-out-of-a-ticket', 'Msn', 0, 1343079037, '', 54),
(150, 'news', 'http://www.executivetravelmagazine.com/articles/best-and-worst-states-for-traffic-tickets', 3, 'Where are you most (and least) likely to get traffic tickets? Don''t put that pedal down until you read this list. Last spring, cops clocked a car on a rural road outside Charlotte, N.C., doing 128 mph in a 45 mph zone. The offender was NASCAR racer Kyle Busch, who apparently forgot he wasn''t at work.', 'Best & Worst States for Traffic Tickets', 16, 'traffic', 'best-worst-states-for-traffic-tickets', 'Executivetravelmagazine', 0, 1343079644, '', 71),
(151, 'Secondary', 'http://www.canorml.org/history.html', 5, 'NULL', 'Historical Information | California NORML', 8, '', 'historical-information-california-norml', 'Canorml', 0, 1343084988, '', 0),
(152, 'Secondary', 'http://www.canorml.org/camp.html', 5, 'CAMP Eradicates 4.3 Million Plants - More Than State''s Annual Consumption October 30, 2010 - California''s CAMP (Campaign Against Marijuana Planting) marijuana eradication reported 4,320,314 plant seizures in 2010, slightly less than last year''s all-time record of 4,463,917.Read more.', 'CAMP (Campaign Against Marijuana Planting) | California NORML', 5, '', 'camp-campaign-against-marijuana-planting-california-norml', 'Canorml', 0, 1343084988, '', 0),
(153, 'Secondary', 'http://www.canorml.org/costs/federal_medical_marijuana_prisoners_and_cases', 5, 'LAST UPDATED: 7/17/2012 Pending Cases in California and Elsewhere In Prison Sentenced or Case Terminated Died Pending Prosecution Raided by DEA (partial list) Current California Defendants and Prisoners: * = currently incarcerated Pending Cases in California and Elsewhere 7/17/2012 - Federal agents raided a medical marijuana dispensary in unincorporated Lake Elsinore, for the second time in three months.', 'Federal Medical Marijuana Prisoners and Cases | California NORML', 13, '', 'federal-medical-marijuana-prisoners-and-cases-california-norml', 'Canorml', 0, 1343084988, '', 0),
(154, 'Secondary', 'http://canorml.org/background/CA_legalization2.html', 5, 'Marijuana Legalization Could Yield California Taxpayers Over $1.2 Billion Per YearAdditional Spinoff Benefits Up To $12 -$18 Billion While California struggles to address the state''s swelling budget deficit, the legalization of marijuana looms as an attractive way of raising revenue for the state.', 'Benefits of Marijuana Legalization in California | California NORML', 13, '', 'benefits-of-marijuana-legalization-in-california-california-norml', 'Canorml', 0, 1343084988, '', 0),
(155, 'Secondary', 'http://www.canorml.org/arrestsprisoners.html', 5, 'Marijuana Arrests Decline in California in 2010 September 14, 2011 - California reported a moderate decline in marijuana arrests in 2010, according to the latest figures from the Criminal Justice Statistics Center.', 'California Arrest and Prisoner Data | California NORML', 5, '', 'california-arrest-and-prisoner-data-california-norml', 'Canorml', 0, 1343084988, '', 0),
(156, 'Secondary', 'http://www.canorml.org/costs.html', 5, 'Marijuana prohibition is costly, not only in the amount spent on law enforcement and prisons, but also in the lost revenue from taxing a legally regulated market, as well as the loss of jobs, payroll taxes, etc.', 'Costs of Prohibition | California NORML', 7, '', 'costs-of-prohibition-california-norml', 'Canorml', 0, 1343084988, '', 0),
(157, 'Secondary', 'http://www.canorml.org/paincomplaints.html', 5, 'UPDATE: July 19, 2010 - The Veterans Health Administration has made it known that it will allow use of medical marijuana by VA patients on opiod therapy. This is good news for the many chronic pain patients who have been told that they must give up', 'Pain Doctors Discriminate Against Medical Marijuana Patients | California NORML', 8, '', 'pain-doctors-discriminate-against-medical-marijuana-patients-california-norml', 'Canorml', 0, 1343084988, '', 0),
(158, 'Secondary', 'http://www.canorml.org/health/student.html', 5, 'CALIFORNIA SURVEY SHOWS STUDENT MARIJUANA USE STABLE, PRESCRIPTION DRUG USE HIGH Jan 30, 2009 -- The newly released biennial Attorney General''s Survey of Student Drug Use in California shows that marijuana use among 7th. 9th and 11th graders remained stable during 2007-8, but reports an "alarming rate" of prescription drug abuse.', 'Student/Youth Usage Studies | California NORML', 11, '', 'studentyouth-usage-studies-california-norml', 'Canorml', 0, 1343084988, '', 0),
(159, 'Secondary', 'http://canorml.org/news/ringtest.html', 5, 'Cal NORML Release - Sep 21, 2011 California NORML and Project CBD release the results of the first "Ring Test" to assess the accuracy of analytical laboratories Mixed findings show strengths and problems among analytic testing services In the winter of 2010/11, California NORML and Project CBD initiated a "Ring Test" to assess the accuracy of analytical cannabis testing laboratories that have recently emerged to serve medical marijuana collectives, breeders, growers and patients.', 'How Accurate Is Cannabis Potency Testing? | California NORML', 15, '', 'how-accurate-is-cannabis-potency-testing-california-norml', 'Canorml', 0, 1343084988, '', 0),
(160, 'Secondary', 'http://canorml.org/news/cbcsurvey2011.html', 5, 'Cal. NORML Estimates 750,000 - 1,125,000 Medical Marijuana Patients in California Retail Medical Market is $1.5 - $4.5 Billion Per Year May 31st, 2011. California NORML estimates that there are now over 750,000 medical marijuana users in the state, or 2% of the population, according to the most recent data.', 'Medical Marijuana Patient Population in CA | California NORML', 8, '', 'medical-marijuana-patient-population-in-ca-california-norml', 'Canorml', 0, 1343084988, '', 0),
(161, 'Secondary', 'http://www.canorml.org/bizorgs.html', 5, 'Accounting and Business Development Liana Limited - Experienced support in business development for the medical cannabis industry. Accounting, human resources, permit applications, business plans, public relations and more. Consultants MarijuanaTech.com (213) 435-7794 Technology Support for Medical Marijuana Collectives.', 'Business and NonProfit Listings | California NORML', 12, '', 'business-and-nonprofit-listings-california-norml', 'Canorml', 0, 1343084988, '', 0),
(162, 'Secondary', 'http://www.canorml.org/medical-marijuana/local-growing-limits-in-California', 5, 'UPDATED 7/20/2012 2/20/2012 - California NORML has filed an appeal to a judge''s ruling in a lawsuit against Tehama county''s ordinance, a test case for the rest of the state. Read more. Explanation of SB420 Cultivation Guidelines Localities NOT listed below adhere to CA state default guidelines, which are: 6 mature OR 12 immature plants and 8 oz.', 'Local Medical Marijuana Cultivation & Possession Guidelines in California | California NORML', 10, '', 'local-medical-marijuana-cultivation-possession-guidelines-in-california-california-norml', 'Canorml', 0, 1343084988, '', 0),
(163, 'Secondary', 'http://www.canorml.org/prop/listings.html', 5, 'The Original The Most Respected The Most Cost-Effective California NORML maintains a weblist of dispensaries and a delivery services page. We are the originator of these lists, the most respected and cost-effective on the web. Three million visitors come to CalNORML.org yearly for information they can trust about medical marijuana, and our collective listings get over 500,000 page views yearly.', 'How to List on CaNORML''s Collective and Delivery Service Pages | California NORML', 11, '', 'how-to-list-on-canormls-collective-and-delivery-service-pages-california-norml', 'Canorml', 0, 1343084988, '', 0),
(164, 'Secondary', 'http://listings.canorml.org/medical-marijuana-doctors-in-California/list.lasso', 5, 'The licensed California physicians searchable on this page are available for consultation as medical cannabis specialists. Patients should have a documented medical record of diagnosis and treatment or a physician referral. Medical marijuana patients should begin by consulting with their own physicians about medical use of cannabis.', 'NULL', 9, '', 'null', 'Canorml', 0, 1343084988, '', 0),
(165, 'Secondary', 'http://www.legislature.ca.gov/legislators_and_districts/legislators/your_legislator.html', 5, 'The portal site for the California State Legislature--State Senate and Assembly. Look up your state representative and search our legislation database.', 'California State Legislature-Your Legislator', 5, '', 'california-state-legislature-your-legislator', 'Ca', 0, 1343084988, '', 0),
(166, 'Secondary', 'http://canorml.org/medical-marijuana/California-collectives-and-dispensaries-guide', 5, 'The Collectives on these pages are California NORML supporters. Cannabis Delivery Services are listed here. Northern California North Coast Arcata, Clearlake, Corte Madera, Cotati, Fort Bragg, Guerneville, Kelseyville, Lower Lake, Lucerne, Middletown, Napa, Santa Rosa, Sebastopol, Ukiah Central Valley to Redding Anderson, Chico, Colfax, Dunsmuir, Marysville, Shasta, Redding, Rocklin, San Andreas, Stockton, Tahoe, Tracy, Yuba Sacramento Area Auburn, Orangevale, Sacramento, Shingle Springs San Francisco (S.F.)', 'Medical Marijuana Collectives and Dispensary Guide to California | California NORML', 15, '', 'medical-marijuana-collectives-and-dispensary-guide-to-california-california-norml', 'Canorml', 0, 1343084988, '', 0),
(167, 'Secondary', 'http://www.canorml.org/background/CA_legalization2.html', 5, 'Marijuana Legalization Could Yield California Taxpayers Over $1.2 Billion Per YearAdditional Spinoff Benefits Up To $12 -$18 Billion While California struggles to address the state''s swelling budget deficit, the legalization of marijuana looms as an attractive way of raising revenue for the state.', 'Benefits of Marijuana Legalization in California | California NORML', 6, '', 'benefits-of-marijuana-legalization-in-california-california-norml2', 'Canorml', 0, 1343084988, '', 0),
(168, 'Secondary', 'https://www.wepay.com/stores/982287', 5, 'California NORML is a non-profit, membership organization dedicated to reforming California''s marijuana laws. Established in 1972, our mission is to establish the right of adults to use cannabis legally. We are the only state organization devoted specifically to marijuana reform. We publish a newsletter, lobby lawmakers, sponsor events, offer legal, educational, and consumer health advice, and sponsor scientific research.', 'CalNORML Store', 11, '', 'calnorml-store', 'Wepay', 0, 1343084988, '', 0),
(169, 'Secondary', 'http://www.canorml.org/staff.html', 5, 'CalNORML Director Dale Gieringer, Ph.D. dale@canorml.org Dale Gieringer has been the state coordinator of California NORML (National Organization for the Reform of Marijuana Laws) since 1987. He is also Vice-Chairman of the national NORML board of directors, director of the California Drug Policy Forum (DPFCA) and treasurer of the Oakland Civil Liberties Alliance (OCLA).', 'Our Staff | California NORML', 13, '', 'our-staff-california-norml', 'Canorml', 0, 1343084988, '', 0),
(170, 'Secondary', 'http://norml.org/laws/item/new-york-penalties-2?category_id=876', 5, 'Marijuana and its synthetic "equivalents" are considered Schedule I hallucinogenic substances under New York Public Health Law. Synthetic equivalents include resinous extracts and derivatives with similar chemical properties. See: New York Pub. Health §3306(d)(13) New York Pub. Health §3306(d)(21) Possession for Personal Use For a first offender, possession of up to 25 grams of marijuana is punishable by a fine of $100.', 'New York Penalties', 9, '', 'new-york-penalties', 'Norml', 0, 1343086139, '', 0),
(171, 'secondary', 'http://norml.org/laws/item/pennsylvania-penalties-2?category_id=882', 5, 'Marijuana is a Schedule I drug. See: Pennsylvania Consolidated Statutes Possession Possession of 30g or less is a misdemeanor punishable by 30 days in jail and a $500 fine. Possession of more than 30g is a misdemeanor with a maximum penalty of one year in jail and a $5,000 fine.', 'Pennsylvania Penalties', 9, '', 'pennsylvania-penalties', 'Norml', 0, 1343086169, '', 0),
(172, 'Secondary', 'http://norml.org/laws/item/texas-penalties-2?category_id=888', 5, 'Possession Possession of 2 ounces or less of marijuana is a Class B misdemeanor, punishable by up to 180 days imprisonment and a fine not to exceed $2,000. Possession of between 2 and 4 ounces of marijuana is a Class A misdemeanor, punishable by imprisonment of up to 1 year and a fine not to exceed $4,000.', 'Texas Penalties', 13, '', 'texas-penalties', 'Norml', 0, 1343086200, '', 0),
(173, 'Secondary', 'http://norml.org/laws/item/illinois-penalties?category_id=857', 5, 'Possession for Personal Use Possession of less than 2.5 grams of marijuana is a Class C misdemeanor, punishable by a jail term of up to 30 days. Possession of between 2.5 - 10 grams of marijuana is a Class B misdemeanor, punishable by up to 6 months imprisonment.', 'Illinois Penalties', 5, '', 'illinois-penalties', 'Norml', 0, 1343086217, '', 0),
(174, 'Secondary', 'http://norml.org/laws/item/massachusetts-penalties-2?category_id=865', 5, 'Marijuana is a class D controlled substance under the Massachusett''s Controlled Substances Act. Possession for Personal Use Possession of 1 ounce or less of marijuana is decriminalized and is punishable as a civil offense. If the offender is over the age of 18 they must pay a fine of $100.', 'Massachusetts Penalties', 15, '', 'massachusetts-penalties', 'Norml', 0, 1343086233, '', 0),
(175, 'Secondary', 'http://www.shouselaw.com/marijuana-possession-sale.html', 5, 'Marijuana Possession for the Purpose of Sale in California It''s very common in Southern California to be falsely accused of violating California Health and Safety Code 11359, which makes it a felony crime to possess marijuana with the intent to sell it. Police often mistake innocent evidence or simple marijuana possession for a marijuana sale waiting to happen.', 'Possession of Marijuana for Sale | CA Health & Safety Code 11359', 13, '', 'possession-of-marijuana-for-sale-ca-health-safety-code-11359', 'Shouselaw', 0, 1343086347, '', 0),
(176, 'Secondary', 'http://www.mcsocal.com/medical-marijuana-legal-guide', 5, '© Americans For Safe Access Table of Contents Becoming A Patient How to become a medical marijuana patient in the state of California Registration Fee Eligible medical conditions: "Serious Medical Condition" Written Certification Must be Provided to Prove Eligibility Finding a Doctor Renewal Applications Personal Records Limitations and Protections under Initiative Possession and Growing Limitations Consumption of Medical Marijuana Paraphernalia associated with medical use Access to Medical Marijuana Growing/Dispensing Collectives and Cooperatives Caregivers Employment Reciprocity Law Enforcement Confidentiality I.', 'Medical Marijuana Legal Guide | MCSocal', 11, '', 'medical-marijuana-legal-guide-mcsocal', 'Mcsocal', 0, 1343086409, '', 0),
(177, 'secondary', 'http://www.sdcourt.ca.gov/portal/page?_pageid=55,1424500&_dad=portal&_schema=PORTAL', 6, 'Back to Top Rental Income Garnishment If the judgment debtor owns rental property, you may garnish the rents paid by the current tenants. The procedure is the same as wage garnishment, except you instruct the Sheriff''s Department to do a rent garnishment instead of a wage garnishment.', 'How to Collect Judgment', 12, '', 'how-to-collect-judgment', 'Ca', 0, 1343086525, '', 29),
(178, 'secondary', 'http://www.sdcourt.ca.gov/portal/page?_pageid=55,1424410&_dad=portal&_schema=PORTAL&a=1#1', 6, 'Small Claims Frequently Asked Questions 1. Who can file a claim? 2. Where can I file a claim? 3. Does the court provide an interpreter? 4. Does the court provide a small claims advisor? 5. What are the rules about designating a defendant? 6. How does the defendant find out about the lawsuit?', 'Small Claims FAQs', 12, '', 'small-claims-faqs', 'Ca', 0, 1343087565, '', 33),
(179, 'Secondary', 'http://www.sandiegotriallaw.com/blog/handling-your-own-case-in-small-claims-court/', 6, 'If you have a dispute over money with a person or business, you may be considering filing a small claims court lawsuit. In San Diego Small Claims Court, an individual may file a claim against a person or business for up to $7,500.00. Businesses may file claims for up to $5,000.00.', 'Handling Your Own Case in Small Claims Court | San Diego Trial Law', 14, '', 'handling-your-own-case-in-small-claims-court-san-diego-trial-law', 'Sandiegotriallaw', 0, 1343088209, '', 20),
(180, 'secondary', 'http://www.sdcourt.ca.gov/pls/portal/docs/PAGE/SDCOURT/GENERALINFORMATION/FORMS/SMALLCLAIMSFORMS/PKT019.PDF', 6, '[PDF] How to File a Small Claims Case', 'Small Claims Packet - How to File a Small Claims Case', 13, '', 'small-claims-packet-how-to-file-a-small-claims-case', 'Ca', 0, 1343088952, '', 23),
(181, 'secondary', 'http://www.courts.ca.gov/sc100info.pdf', 6, '', 'Information for the Plaintiff (Small Claims)', 10, '', 'information-for-the-plaintiff-small-claims', 'Ca', 0, 1343089249, '', 34),
(182, 'secondary', 'http://www.sdcourt.ca.gov/pls/portal/docs/PAGE/SDCOURT/GENERALINFORMATION/FORMS/SMALLCLAIMSFORMS/SC024.PDF', 6, '[PDF] SC-024', 'Zip Code List - Small Claims ', 6, '', 'zip-code-list-small-claims', 'Ca', 0, 1343089301, '', 24),
(183, 'secondary', 'http://www.sdcourt.ca.gov/pls/portal/docs/PAGE/SDCOURT/GENERALINFORMATION/FORMS/SMALLCLAIMSFORMS/SC023.PDF', 6, '[PDF] SC-023', 'How to File a Small Claims Case (SC-023)', 14, '', 'how-to-file-a-small-claims-case-sc-023', 'Ca', 0, 1343089043, '', 21);
INSERT INTO `links` (`id`, `type`, `url`, `category`, `summary`, `title`, `votes`, `tags`, `slug`, `source`, `poster`, `date_created`, `location`, `views`) VALUES
(184, 'secondary', 'http://www.sdcourt.ca.gov/pls/portal/docs/PAGE/SDCOURT/GENERALINFORMATION/FORMS/SMALLCLAIMSFORMS/SC100.PDF', 6, '[PDF] SC-100', 'Plaintiff''s Claim and Order to Go to Small Claims Court (Small Claims) ', 5, '', 'plaintiffs-claim-and-order-to-go-to-small-claims-court-small-claims', 'Ca', 0, 1343089327, '', 23),
(185, 'secondary', 'http://www.sdcourt.ca.gov/pls/portal/docs/PAGE/SDCOURT/GENERALINFORMATION/FORMS/SMALLCLAIMSFORMS/SC-100A_FILLABLE.PDF', 6, '[PDF] SC-100A', 'Other Plaintiffs and Defendants ', 14, '', 'other-plaintiffs-and-defendants', 'Ca', 0, 1343089353, '', 27),
(186, 'secondary', 'http://www.courts.ca.gov/sc104b.pdf', 6, '[PDF] SC-104B', 'What is "Proof of Service"? (Small Claims) ', 14, '', 'what-is-proof-of-service-small-claims', 'Ca', 0, 1343089376, '', 21),
