(189, 'secondary', 'http://www.sdcourt.ca.gov/pls/portal/docs/PAGE/SDCOURT/GENERALINFORMATION/FORMS/SMALLCLAIMSFORMS/SC026.PDF', 6, '[PDF] SC-026', 'Notice to Party(ies) Filing Small Claims Action ', 10, '', 'notice-to-partyies-filing-small-claims-action', 'Ca', 0, 1343089468, '', 22),
(190, 'secondary', 'http://www.sdcourt.ca.gov/pls/portal/docs/PAGE/SDCOURT/GENERALINFORMATION/FORMS/SMALLCLAIMSFORMS/SC044.PDF', 6, '[PDF] SC-044', 'Request for Dismissal - Small Claims', 9, '', 'request-for-dismissal-small-claims', 'Ca', 0, 1343089490, '', 25),
(191, 'secondary', 'http://www.sdcourt.ca.gov/portal/page?_pageid=55,1424466&_dad=portal&_schema=PORTAL', 6, 'San Diego Small Claims Forms', 'Small Claims Forms', 10, '', 'small-claims-forms', 'Ca', 0, 1343089538, '', 22),
(192, 'secondary', 'http://www.dmv.ca.gov/pubs/vctop/d11_5/vc23538.htm', 4, '<p>Penalties are determined by a number of circumstances including prior convictions, speeding, minor passengers, BAC level, and injury. Prior convictions are determined by how many DUIs you had in the past 10 years. Here are some possible penalties.</p>\n<b>First offense</b>: 4 days to 6 months in jail, a fine between $390 to $1000, and a license suspension between 30 days and 10 months.\n<br/><br/> \n<b>Second offense</b>: 10 days to 1 year in jail, a fine between $1800 and $2800, and a license suspension of 2 years.\n<br/><br/> \n<b>Third offense</b>: 120 days to 1 year in jail, a fine between $1800 and $18000 and a license suspension of 3 years.\n<br/><br/> \n<b>Fourth or more offense</b>: This is a felony DUI, you can face up to 3 years in state prison, permanent loss of license, and more.\n', 'California DUI Penalties', 12, 'penalties, priors, refusal', 'california-dui-penalties', '', 0, 0, 'California', 165),
(198, 'secondary', 'http://www.dmv.ca.gov/pubs/vctop/d11_5/vc23572.htm', 4, '<p>If you have a passenger under the age of 14 in the car at the time of your DUI arrest, you may be additionally charged with DUI with a minor passenger. It does not matter whether you were driving safely or had a low level of intoxication. Prosecutors may also choose to file child endangerment charges as well. Here are the possible penalties that may be imposed, regardless of whether or not probation is granted.</p>\n<b>First offense</b> - an additional 48 hours of jail time.\n<br/><br/>\n<b>Second offense</b> - an additional 10 days of jail time.\n<br/><br/>\n<b>Third offense</b> - an additional 30 days of jail time.\n<br/><br/>\n<b>Fourth offense</b> - an additional 90 days of jail time.', 'California DUI with Child Under 14 in the Car', 13, 'penalties, child passenger', 'california-dui-with-child-under-14-in-the-car', '', 0, 0, 'California', 48),
(201, 'secondary', 'http://www.shouselaw.com/dui-checkpoint.html', 45, '<p>According to the Supreme Court, DUI checkpoints are constitutional. However, police must follow certain guidelines. For example, in Ingersoll v. Palmer (1987) the California Supreme Court ruled that DUI checkpoints must use specific patterns or neutral formulas, such as stopping every 5th car. This formula must be determined before installing the checkpoint. Police cannot stop cars at random. Furthermore, police must adequately inform drivers that the checkpoint will be in place. Most departments issue statements detailing when and where they plan on having the checkpoint.</p>\n<p>There are several ways to fight a DUI checkpoint arrest including: there was no adequate warning for the upcoming checkpoint, there was no way to avoid the checkpoint, and the supervising officers were not present at the checkpoint. Failure to do so might mean that you were stopped and arrested illegally, and your case might get thrown out. A lawyer can help you figure out whether police followed the strict regulations and guidelines.</p>', 'How to Fight a DUI Checkpoint Arrest', 6, 'checkpoints', 'how-to-fight-a-dui-checkpoint-arrest', '', 0, 0, 'California', 66),
(205, 'secondary', 'http://www.law.cornell.edu/constitution/fourth_amendment', 45, '<p>The Fourth Amendment of the Constitution prohibits unreasonable searches and seizures. This means that an officer can''t stop or arrest you for no reason. The officer must provide "specific articulable facts," or probable cause, that a crime is or was taking place. Any evidence found as a result of an illegal stop or arrest may be thrown out of court under the <b>fruit of the poisonous tree doctrine</b>. Two situations where you can argue that the officer had no probable cause is when you were stopped and arrested.</p>\n<p><b>Traffic stop</b> -  Police must have a specific reason (probable cause) to pull over a car, and can''t do so randomly. A traffic violation is usually enough to satisfy this condition. Also, if the police officer already knows that the individuals in a car are the suspects in a crime, then he can pull the car over as well. If you were speeding or made an illegal turn, you broke a traffic law and it will be harder to argue that the stop was illegal. </p>\n<p><b>Arrest</b> - Before making a DUI arrest, the police must show that they had probable cause to arrest you. This can be established by showing that you had driving and physical symptoms commonly seen in drunk individuals, such as weaving and slurred speech. If you lacked any signs of intoxication, your arrest might have been illegal.</p>', 'Was your Traffic Stop and Arrest Legal?', 15, 'probable cause, driving, arrest, evidence', 'was-your-traffic-stop-and-arrest-legal', '', 0, 0, '', 70),
(208, 'secondary', 'http://www.law.cornell.edu/wex/fruit_of_the_poisonous_tree, http://en.wikipedia.org/wiki/Fruit_of_the_poisonous_tree', 45, '<p>Under the fruit of the poisonous tree doctrine, evidence gathered through illegal means will be excluded from court. The rule is used to discourage police from engaging in misconduct and violating people''s rights. In DUI cases, sometimes officers make illegal stops or arrests. In such instances, a person''s breathalyzer results may be excluded. This is because any evidence obtained from an illegal arrest or stop in violation of the Fourth Amendment.</p>', 'Fruit of the Poisonous Tree Doctrine', 3, 'evidence, constitution, police misconduct', 'fruit-of-the-poisonous-tree-doctrine', '', 0, 0, '', 74),
(211, 'secondary', 'http://www.dmv.ca.gov/pubs/vctop/d11_5/vc23582.htm', 4, '<p>In California, driving recklessly over the speed limit during a DUI may get you an additional 60 day jail sentence. Reckless driving is driving that will probably injure someone and you are aware of that risk. The penalty enhancement may apply if you were driving 30 mph over the speed limit on a freeway or 20 mph over the speed limit on any other road.</p>', 'Were you Speeding? Increased DUI Penalty', 6, 'penalties, speeding', 'were-you-speeding-increased-dui-penalty', '', 0, 0, 'California', 61),
(213, 'secondary', 'http://www.fredthia.com/felony-dui', 4, '<p>A DUI is typically a misdemeanor charge. However, it may be upgraded to a felony in the following situations:</p> \nfourth DUI within 10 years<br/>\na DUI with injury or<br/>\na DUI with death. \n<p>Felonies typically carry harsher penalties than misdemeanors, including possible jail time and large fines.</p>', 'Is your California DUI a Felony?', 12, 'injury, felony', 'is-your-california-dui-a-felony', '', 0, 0, 'California', 61),
(214, 'secondary', 'http://www.dmv.ca.gov/pubs/vctop/d11/vc23153.htm', 4, '<p>If you caused an accident and injured somebody, you may be charged with DUI causing injury. This charge is a a "wobbler," which means that it may be prosecuted as either a misdemeanor or as a felony, depending on some factors including how many people were hurt and how badly the injuries were. A felony DUI with injury carries a possible penalty of two to six years of jail time and a fine between $1000 to $5000.</p>', 'California DUI Accident Causing Injury', 11, 'penalties, injury, felony, misdemeanor', 'california-dui-accident-causing-injury', '', 0, 0, 'California', 60),
(542, 'secondary', 'http://www.womenslaw.org/laws_state_type.php?statelaw_name=Custody&state_code=CA', 9, '<p>When a court issues a custody order, it addresses two parts of custody: physical and legal.  Physical custody addresses who the child will live with on a day-to-day basis, while legal custody grants the right to make major decisions regarding the child, like where he or she goes to school and what kind of healthcare he or she receives.  The parent with sole physical custody is usually referred to as the custodial parent, while the other parent is called the noncustodial parent.</p>\n\n<p>The noncustodial parent normally has visitation rights; the parents can agree to visitation terms or the court can decide for them if they can’t come to an agreement.  Typically, a noncustodial parent is allowed visitation without the presence of anyone else. In certain situations, however, visitation may be supervised, such as when the parent has a history of violent behavior or substance abuse.  An authorized adult (not the custodial parent) supervises the visitation.  The supervisor may be court-appointed, or the parents may choose the supervisor with the approval of the court.</p>\n', 'Difference Between Custody and Visitation', 15, '', 'difference-between-custody-and-visitation', '', 2, 0, '', 46),
(216, 'secondary', 'http://leginfo.ca.gov/cgi-bin/displaycode?section=veh&group=23001-24000&file=23610-23614', 4, '<p>In California, there is no legal obligation to take the handheld breathalyzer. In fact, the police must tell you this before administering it, although they rarely do. Further, its result cannot be used in court against you to prove guilt for the DUI and you will not be penalized for refusing (People v. Jackson (2010)).</p>\n<p>The handheld breathalyzer is really just a tool used to help gather evidence needed to make a DUI arrest, similar to field sobriety tests. Blowing a low BAC on it won''t really help you. But blowing a high BAC will be used as evidence that the arrest was legal. You have a right to refuse it and you probably should, since taking it can only be used as evidence to hurt your case.</p>', 'Were you Given a Handheld Breathalyzer in California?', 6, 'breath test, evidence', 'were-you-given-a-handheld-breathalyzer-in-california', '', 0, 0, 'California', 53),
(219, 'secondary', 'http://www.dmv.ca.gov/pubs/vctop/d06/vc13353.htm', 4, '<p>Automatic penalties may be imposed for refusing a chemical test, such as a license suspension. The length of the suspension will depend on how many prior DUI convictions you had within the last 10 years. This is because by driving a car, you agree to take a breath or blood test if you are arrested for a DUI. This is called implied consent laws. Further, you have a choice between a blood or breath test and you can''t be forced to take one over the other. Here are some possible penalties.</p>\n<b>First offense</b> – 1 year license suspension<br/><b>Second offense</b> – 2 year license suspension<br/><b>Third offense</b> – 3 year license suspension', 'Did You Refuse Breathalyzer Test in California?', 19, 'refusal, license, breath test ', 'did-you-refuse-breathalyzer-test-in-california', '', 0, 0, 'California', 91),
(220, 'secondary', 'http://www.dmv.ca.gov/pubs/vctop/d11_5/vc23612.htm', 4, '<p>By driving a car, you agree to take a breath or blood test if you are arrested for a DUI. You have a choice between a blood or breath test and you can''t be forced to take one over the other. If neither options are available, you must take a urine test.</p>\n<p>An officer can''t pressure you to take one test over another. For example, if you choose the blood test, an officer can''t tell you that a breath test will be easier and faster in order to get you to change your mind.</p> ', 'Overview of California Implied Consent Laws ', 16, 'penalties, refusal, license, breath test, blood test ', 'overview-of-california-implied-consent-laws', '', 0, 0, 'California', 54),
(223, 'secondary', 'http://www.shouselaw.com/gerd.html, http://heartburn.about.com/b/2010/09/07/can-having-gerd-get-you-out-of-a-dwi.htm', 45, '<p><b>Inaccurate Results</b>. Medical conditions that will lead to an inaccurate BAC result on a breathlyzer test include: GERD, Acid Reflux, and Heartburn. If you experience any of these conditions shortly before your test, your results are probably inaccurate. Furthermore, eating a spicy or greasy meal may cause temporary acid reflux, which can mess up a breath test.</p>\n<p><b>Why</b>. This is due to the fact that a breathalyzer is designed to measure the alcohol concentration on your breath. However, medical conditions such as GERD, acid reflux, and heartburn, cause stomach acids to travel to your throat and mouth. These acids usually have a small amount of alcohol in them. Since the breathalyzer only measures breath alcohol, the introduction of concentrated alcohol in the acids is picked up and returns an overly high readings.</p>\n<p><b>Defense</b>. These conditions can be raised as a defense to a DUI by showing that they caused an inaccurate BAC reading. A doctor''s testimony can be extremely important as proof.</p>', 'GERD, Acid Reflux, and Heartburn Effect on Breathalyzer', 6, 'breath test, inaccurate', 'gerd-acid-reflux-and-heartburn-effect-on-breathalyzer', '', 0, 0, '', 67),
(224, 'secondary', 'http://en.wikipedia.org/wiki/Arizona_SB_1070', 36, 'Arizona SB 1070 was a legislative act that provided the state law enforcement officers broad powers in checking an individual''s immigration status. Core provisions in the act were found unconstitutional and struck down by the Supreme Court of the U.S. Critics to the legislation note that provisions, such as allowing police to demand immigration papers based on "reasonable suspicion" encouraged racial profiling of citizens.', 'Arizona SB 1070', 17, 'immigration, arizona, supreme court, unconstitutional', 'arizona-sb-1070', '', 0, 0, '', 43),
(225, 'secondary', 'What is a rising BAC defense?', 45, '<p>What matters in a DUI case is your BAC when you were driving, not when you were at the station being tested. However, while driving, no one is giving you a breathalyzer. For this reason, prosecutors will try to estimate a person''s BAC at the time of driving, to prove that the person''s BAC was above the legal limit.</p>\n<p>All too often, they will estimate a higher BAC at the time of driving than when a person took the chemical test, because they assume that the person''s body was burning off alcohol in the time period between arrest and testing. However, this assumption is clearly false if the person had a drink shortly before being arrested and tested, because the person''s body was still absorbing that drink. On average, it takes between 45 minutes and 3 hours for alcohol to be absorbed into the system</p>\n<p><b>For example</b>, let''s say at the time of testing your BAC is .07% and you were arrested one hour earlier. Prosecutors will estimate your BAC to be .09% when you were actually driving, because they assume that your body burned off .02% in one hour. This is just above the legal limit and you will get charged with a DUI.</p>\n<p>But let''s say your BAC while driving was actually .05% and you had a drink right before getting arrested. In the hour between arrest and testing, your body was still absorbing this last drink. So when you were tested it showed up as .07%. But clearly you were driving with a lower (and legal) BAC! This is called the rising BAC defense and can be used to show that your BAC while driving was legal.</p>', 'What is the Rising BAC Defense?', 10, 'defenses, bac, rising bac defense', 'what-is-the-rising-bac-defense', '', 0, 0, '', 64),
(544, 'secondary', 'http://www.drugdetection.net/PDF%20documents/Title%2017%20California%20Code%20of%20Regulations%20Jan%202006.pdf', 45, '<p>There are a number of things that can cause an inaccurate breathalyzer result including <b>burping</b> and vomiting 15 minutes before taking the test. This is because the breathalyzer assumes it is only measuring breath alcohol and not mouth alcohol. However, burping or vomiting introduces small amounts of mouth alcohol that will be picked up by the machine, resulting in an overly high BAC reading.</p><p>This is so important that under California law an officer must observe you for 15 minutes before administering a breathalyzer test, to make sure you do not burp or vomit. However, officers rarely do this.</p> ', 'Burping Your Way to Freedom', 15, 'breath test, inaccurate', 'burping-your-way-to-freedom', '', 4, 0, '', 795),
(227, 'secondary', 'http://www.dmv.ca.gov/pubs/vctop/d11_5/vc23578.htm', 4, 'In California, a BAC of 0.15% or greater may result in increased penalties in either sentencing or probation.', 'Was your BAC 0.15% or Higher in California?', 16, 'penalties, bac', 'was-your-bac-015-or-higher-in-california', '', 0, 0, 'California', 98),
(228, 'secondary', 'http://www.dmv.ca.gov/pubs/vctop/d06/vc13353_2.htm', 4, '<p>You have 10 days from the date of arrest to request a DMV hearing in order to fight a possible license suspension. The DMV will handle your license suspension, whereas the criminal court will decide whether you are guilty and deserve jail time, fines, or probation. These are two separate processes and it''s important to be aware that your DMV hearing will proceed in a different manner than your criminal case.</p>', 'You Have 10 Days to Request a DMV Hearing in California', 6, 'license, dmv', 'you-have-10-days-to-request-a-dmv-hearing-in-california', '', 0, 0, 'California', 79),
(230, 'secondary', 'http://www.fredthia.com/underage-duis', 4, '<p>California has a zero-tolerance policy towards underage drinking and driving.  If a driver under the age of 21 has a BAC of .005% or more (basically any amount of alcohol), then he or she can be subjected to criminal and DMV penalties. If you do not have a license, your opportunity to get one will be delayed. An underage DUI will affect your future career and you may have to list it on college and graduate school applications. Here are some possible penalties for different BAC levels</p>\nBAC between <b>.01% to .04%</b> - no jail time, and fines, 1 year license suspension or delay (if no license).\n<br/><br/>\nBAC between <b>.05% to .79%</b> - no jail time, greater fines, and 1 year license suspension or delay (if no license).\n<br/><br/>\nBAC of <b>.08% or greater</b> - will be charged as a regular DUI with possible jail time and fine. You will also lose driver''s license for 1 year.', 'Under 21 DUI California', 13, 'penalties, under 21', 'under-21-dui-california', '', 0, 0, 'California', 101),
(232, 'news', 'http://www.entrepreneur.com/article/217464', 2, 'Three tips to help you avoid tax troubles down the road. 1) Hire a tax pro and bookkeeper - in addition to paying income tax, you also have to pay self-employment tax. Your tax pro can help you minimize expenses. 2) choose a legal entity - different entities have different tax consequences and it''s important to choose what is right for your business. 3) Make estimated tax payments - because you taxes are being withheld from your paychecks, you have to do it yourself. ', 'Tax Basics for Startups', 10, 'tax', 'tax-basics-for-startups', '', 0, 0, '', 51),
(233, 'secondary', 'http://ladot.lacity.org/tf_Parking_regulations.htm', 3, '<p>The following general provisions of law apply in Los Angeles whether or not there are signs or curb markings present.</p>\n\nParking is prohibited in front of a driveway, in alleys (unless unloading goods or people), and in a center median strip (unless signs permit).\n<br/><br/>\nNo vehicle may be parked continuously at one location on any public roadway for more than 72 hours.<br/><br/>\nClick to see more.', 'General Parking Laws That Always Apply in Los Angeles', 16, 'parking', 'general-parking-laws-that-always-apply-in-los-angeles', '', 0, 0, 'Los Angeles', 61),
(234, 'secondary', 'http://ladot.lacity.org/tf_Colored_Curb_Zones.htm', 3, '<p>In LA there are red, yellow, white, green, blue curb zones.</p>\nRed curb zones indicate that drivers are not allowed to stop or park in that area. <br/><br/>\nYellow curb zones are for commercial districts and are used commonly for loading or unloading freight. Cars are not allowed to park for more than 30 minutes on a yellow curb. <br/><br/>\nWhite curb zones are for passenger loading, these zones are limited to 5 minutes of parking. <br/><br/>\nGreen curb zones are for short-term parking. Green curbs are commonly found for convenience stores or other businesses that require only 15 minutes of parking. <br/><br/>\nBlue curb zones are reserved for those that are disabled. Blue curb zones require a handicap placard. ', 'Los Angeles Color Curb Zones', 12, 'parking, colored curbs', 'los-angeles-color-curb-zones', '', 0, 0, 'Los Angeles', 51),
(235, 'secondary', 'http://ladot.lacity.org/tf_Parking_Restrictions.htm', 3, '<p>There are several different types of parking signs including time limit, no parking, no stopping, street cleaning, preferential parking, and disabled zones. No Parking means you can drop off and pick up passengers for up to 5 minutes or perform commercial loading for up to 30 minutes. No Stopping means you cannot stop your car there at all. Preferential parking restricts parking to certain time period, unless you have a residential permit.</p> ', 'Different Kinds of Los Angeles Parking Signs', 8, 'parking, signs', 'different-kinds-of-los-angeles-parking-signs', '', 0, 0, 'Los Angeles', 56),
(236, 'news', 'http://articles.glendalenewspress.com/2012-07-04/the818now/tn-gnp-cashstrapped-la-raises-parking-fines-for-6th-time-in-7-years-20120704_1_parking-fines-city-parking-tickets-parking-proposal', 3, 'Los Angeles is once again raising fines for parking violations an additional $5, for the sixth time in seven years. The City Council voted unanimously for the fine increases, which will apply to the 2.5 million city parking tickets issued annually and are expected to generate an extra $8.4 million in the next year for the city''s general fund budget, which pays for basic services such as police and firefighters.', 'Cash-strapped L.A. raises parking fines for 6th time in 7 years', 15, 'parking, fines', 'cash-strapped-la-raises-parking-fines-for-6th-time-in-7-years', '', 0, 0, 'Los Angeles', 49),
(237, 'news', 'http://blogs.laweekly.com/informer/2012/07/can_you_be_ticketed_at_broken_parking_meters_california_la.php', 3, 'Here in Los Angeles, city officials will do everything within their power to indirectly tax us for driving (even though driving is often the only way to traverse the sprawl, and dreams for a full L.A. subway system probably won''t be realized for another half-century).', 'You Can No Longer Be Ticketed at Broken Parking Meters in California -- But L.A. Is Expected to Opt Out of State Policy', 13, 'parking, meters', 'you-can-no-longer-be-ticketed-at-broken-parking-meters-in-california-but-la-is-expected-to-opt-out-of-state-policy', '', 0, 0, 'Los Angeles', 50),
(238, 'news', 'http://www.huffingtonpost.com/2012/07/03/la-parking-ticket-increase_n_1648024.html', 3, 'The Los Angeles City Council has approved a $5 increase on parking tickets Tuesday. The fee hike is LA''s sixth parking ticket increase in seven years. Officials hope the increased revenue will make a dent in the city''s $238 million budget deficit. Here are the ticket fines for some of the most common parking violations.', 'Parking Ticket Fines Are Going Up AGAIN', 9, 'parking, fines', 'parking-ticket-fines-are-going-up-again', '', 0, 0, 'Los Angeles', 62),
(239, 'secondary', 'http://www.sandiego.gov/parking/enforcement/rules.shtml', 3, '<p>In San Diego parking meter and time restrictions imposed do not apply on Sundays and major U.S. holidays. Standard DMV regulations, such as prohibited parking in an intersection, apply in San Diego. Additionally, it is unlawful for a driver to drive between vehicles comprising a funeral procession. Click source for detailed information on San Diego driving regulations.</p>', 'General Parking Rules for San Diego', 9, 'parking', 'general-parking-rules-for-san-diego', '', 0, 0, 'San Diego', 35),
(240, 'secondary', 'http://docs.sandiego.gov/municode/MuniCodeChapter08/Ch08Art06Division00.pdf', 3, '<p>Parking meters have certain time and date restrictions. During major holidays, such as President''s Day or Christmas the restrictions do not apply. Click for a detailed listing of San Diego''s parking laws.</p>', 'San Diego Parking Code', 14, 'parking', 'san-diego-parking-code', '', 0, 0, 'San Diego', 38),
(241, 'secondary', 'http://www.amlegal.com/nxt/gateway.dll?f=templates&fn=default.htm&vid=amlegal:lamc_ca', 3, 'The city of Los Angeles has a separate municipal code for drivers to follow. Click to check Chapter VIII of the Municipal Code for the Traffic Code.', 'The Traffic Code: Los Angeles', 12, 'parking, traffic', 'the-traffic-code-los-angeles', '', 0, 0, 'Los Angeles', 50),
(242, 'secondary', 'https://pci.etimspayments.com/pbw/include/la/input.jsp', 3, 'Drivers are able to pay for their parking tickets online. The ticket number and driver''s information are required. Click to be redirected to the website where you can pay.', 'Pay your Los Angeles Parking Ticket Here', 14, 'parking, fines, pay ticket', 'pay-your-los-angeles-parking-ticket-here', '', 0, 0, 'Los Angeles', 51),
(243, 'secondary', 'https://step1.caledoncard.com/tickets/sandiego.html', 3, '<p>Drivers in San Diego can pay for their traffic tickets online. Be sure to have your traffic ticket number, driver''s license information, and either a debit or credit card. Click to be redirected to the online application.</p>', 'Pay your San Diego Parking Ticket Online', 9, 'parking, fines, pay ticket', 'pay-your-san-diego-parking-ticket-online', '', 0, 0, 'San Diego', 34),
(244, 'secondary', 'http://ladot.lacity.org/tf_contesting_citation.htm', 3, '<p>Contesting a parking ticket has a three-stage review process.</p>\n<p>The first stage is an Initial Review request. You have 21 days from the date of the ticket to request an initial review.</p>\n<p>The second stage is the Administrative Hearing. Individuals that are dissatisfied with the Initial Review result may further contest the ticket by requesting an Administrative Hearing. You must pay in advance all fines or money owed on a ticket and request the Administrative Hearing within 21 days from the date of the initial decision.</p>\n<p>The third step is Appealing the Administrative Hearing. This only occurs if an individual is dissatisfied with the findings for the first two hearings. This appeal must be requested within 30 days from the date of the Administrative Hearing Examiner''s decision.</p>', 'How to Fight Your Los Angeles Parking Ticket', 12, 'parking, appeal', 'how-to-fight-your-los-angeles-parking-ticket', '', 0, 0, 'Los Angeles', 74),
(245, 'secondary', 'http://www.lotustalk.com/forums/f106/how-fight-parking-ticket-los-angeles-67203/', 3, 'This is an example letter someone wrote to fight a parking ticket because the sign was covered by tree branches and leafs. ', 'Example Letter Fighting Parking Ticket', 13, 'parking, appeal', 'example-letter-fighting-parking-ticket', '', 0, 0, 'Los Angeles', 80),
(246, 'secondary', 'https://pci.etimspayments.com/pbw/include/la/complaintform.jsp?complainttype=6', 3, '<p>Traffic violators in Los Angeles are allowed to fight their parking tickets online. You can use the sample letter for your "Citizen''s Statement", which is your side of the story. Be sure to have the citation issue date, violation number, and other relevant personal information ready.</p>', 'Fight Your Los Angeles Ticket Online', 6, 'parking, appeal', 'fight-your-los-angeles-ticket-online', '', 0, 0, 'Los Angeles', 69),
(247, 'secondary', 'https://wmq.etimspayments.com/pbw/include/santamonica/revform.jsp', 3, '<p>Drivers in Santa Monica can file a request online to contest a parking citation. This request for review must be filed within 21 days of the citation issue date or 14 days from the reminder notice. Click souce to be directed to the Santa Monica request form.</p>', 'Santa Monica: Fight Your Ticket Online', 11, 'parking, appeal, santa monica', 'santa-monica-fight-your-ticket-online', '', 0, 0, 'Los Angeles', 58),
(248, 'secondary', 'http://www.sandiego.gov/parking/citations/appeal/index.shtml', 3, '<p>In San Diego, there are 3 levels of appeal an individual can pursue.</p>\n<p>The first level is an Administrative Review, this review will determine if the citation was validly issued. The request for review must be received within 21 days from the date the citation was issued. Note, drivers are able to submit a request online as well.</p>\n<p>The second level is an Administrative Hearing. This occurs when an individual''s appeal was denied. During this time, all fees due on the citation must be deposited.</p>\n<p>The third level is a Superior Court Appeal, at this time the Superior Court will require a Civil Court Filing. Once a decision has been given, no further appeal is allowed.</p>\n', 'How to Fight Your San Diego Parking Ticket', 13, 'parking, appeal', 'how-to-fight-your-san-diego-parking-ticket', '', 0, 0, 'San Diego', 46),
(249, 'secondary', 'http://www.sandiego.gov/parking/citations/adminreviewform.shtml', 3, '<p>San Diego drivers can file a request online to contest a parking violation. Click "view source" to be directed to the San Diego online application for Administrative Review.</p>', 'Fight Your San Diego Ticket Online', 12, 'parking, appeal', 'fight-your-san-diego-ticket-online', '', 0, 0, 'San Diego', 40),
(250, 'secondary', 'http://www.sandiego.gov/parking/citations/appeal/adminreview.shtml', 3, '<p>A common way to fight a ticket is to request an Administrative Review. During this review, drivers often will submit photos or other evidence to show that they either 1. were not parking in the wrong area; 2. the parking sign was unreadable or 3. they had the applicable permit, but the parking officer did not notice it.</p>', 'Common Ways to Fight a Ticket', 6, 'parking, appeal', 'common-ways-to-fight-a-ticket', '', 0, 0, 'San Diego', 46),
(251, 'secondary', '', 3, '<p>When fighting a parking ticket, be sure to include the citation number, date and time of the citation, and location. Be sure to include photographs or other forms of evidence to strengthen your claim. Below is a sample letter that can be tailored to fight your parking ticket; just fill in the parentheses with your information.</p>\n<p><b>SAMPLE LETTER</b></p>\nTo whom it may concern,<br/><br/>\n\nI am contesting Citation [Number] I received on [Date] at [Time], which states my car was parked at or near Location. I am writing to formally challenge this ticket for the following reasons.<br/><br/>\n\nAccording to [Law you allegedly violated, Copy paste law here]. However, in my situation [explain the technicality or extenuating circumstance]<br/><br/>\n\nTo provide evidence in my favor I have attached [evidence: photograph; witness statement; etc.] to this statement.<br/><br/>\n\nFor the aforementioned reasons, I am requesting my ticket be dismissed.<br/><br/>\n\nRegards,<br/><br/>\n\n[Name]', 'Sample Letter Template to Fight Your Parking Ticket', 11, 'parking, appeal, letter', 'sample-letter-template-to-fight-your-parking-ticket', '', 0, 0, '', 157),
(252, 'secondary', 'http://www.sanjoseca.gov/transportation/onstreet_regulations.htm', 3, '<p>Common parking violations in San Jose include meter violations (letting the meter time expire) and parking in a street cleaning/construction area. Drivers can also be cited for disregarding signs and parking during restricted times, in a residential permit only area, or parking on the street for more than 72 continuous hours.</p>', 'List of Common Parking Violations in San Jose', 11, 'parking', 'list-of-common-parking-violations-in-san-jose', '', 0, 0, 'San Jose', 38),
(253, 'secondary', 'http://sanjose.amlegal.com/nxt/gateway.dll/California/sanjose_ca/sanjosemunicipalcode?f=templates$fn=default.htm$3.0$vid=amlegal:sanjose_ca', 3, '<p>San Jose''s parking regulations are similar to most municipalities. Drivers are required to follow all road and pedestrian signs and cannot arbitrarily park their cars. Click "view source" to see all the relevant statutes drivers must follow while in San Jose.</p>', 'San Jose Parking Code', 7, 'parking', 'san-jose-parking-code', '', 0, 0, 'San Jose', 39),
(254, 'secondary', 'http://www.sfmta.com/cms/penf/indxpkenf.htm#tips', 41, 'The following tips are for parking legally within San Francisco. While driving in San Francisco, drivers should never leave their vehicle parked for more than 72 hours. Furthermore, they should be conscious of parking signs and permit required signs. Never block driveways and crosswalks. For more tips, click "view source" and click on the colored links for elaborations.', 'Tips for Parking', 8, 'parking, tips', 'tips-for-parking', '', 0, 0, 'San Francisco', 41),
(255, 'secondary', 'http://www.amlegal.com/nxt/gateway.dll/California/transportation/transportationcode?f=templates$fn=default.htm$3.0$vid=amlegal:sanfrancisco_ca$sync=1', 3, '<p>San Francisco has specific traffic codes that all drivers must follow. Similar to most municipalities, drivers in San Francisco are required to obey all posted signs and regulations. For detailed rules and regulations click source and click on the "transportation" link.</p>', 'San Francisco Traffic Code', 8, 'parking, traffic', 'san-francisco-traffic-code', '', 0, 0, 'San Francisco', 40),
(256, 'secondary', 'http://www.amlegal.com/nxt/gateway.dll/California/transportation/divisionii/article300finesandfees?f=templates$fn=altmain-nf.htm$3.0#JD_302', 3, '<p>San Francisco has listings on the amount of fine each type of parking violation is given. Common citations, such as parking during street cleaning ($63 fine) or parking in a red zone ($97 fine) range between $55 to $110. Standard DMV penalties, such as an expired license registration, are used and apply in San Francisco.</p>', 'List of San Francisco Traffic Penalties and Fines', 9, 'parking, traffic, fines', 'list-of-san-francisco-traffic-penalties-and-fines', '', 0, 0, 'San Francisco', 45),
(257, 'secondary', 'https://www.pticket.com/scripts/Autobahn.exe/Execute?Application=pTicket&Program=REPORT-query_citation&parmAGENCY_STATE=CA&parmAGENCY_LOC=SANJOSE&DSI=0', 3, '<p>San Jose drivers are able to pay for their parking tickets online. Be sure to have your citation number, driver''s license, and credit or debit card number available. Click to be directed to the online pay form.</p>', 'Pay your San Jose Parking Ticket Here', 8, 'parking, fines, pay ticket', 'pay-your-san-jose-parking-ticket-here', '', 0, 0, 'San Jose', 18),
(258, 'secondary', 'https://wmq.etimspayments.com/pbw/include/sanfrancisco/main.jsp', 3, '<p>San Francisco parking citations can be paid online. Individuals will need either a debit or credit card. There is a $2.50 service charge to use this system. Vehicles that have been towed or booted are ineligible for this system and must directly pay at the SFMTA Customer Service Center.</p>', 'Pay your San Francisco Parking Ticket Here', 13, 'parking, fines, pay ticket', 'pay-your-san-francisco-parking-ticket-here', '', 0, 0, 'San Francisco', 18),
(259, 'secondary', 'http://www.sanjoseca.gov/transportation/forms/parkingappeal.pdf', 3, '<p>For San Jose drivers, mail in this form in order to contest a traffic or parking violation. Be sure to have information such as ticket number, driver''s license and payment information ready. Click to be redirected to the form.</p>', 'Use this Form to Fight your San Jose Ticket', 6, 'parking, appeal', 'use-this-form-to-fight-your-san-jose-ticket', '', 0, 0, 'San Jose', 38),
(260, 'secondary', 'http://www.sanjoseca.gov/transportation/compliance_citations.htm', 3, '<p>San Jose drivers are able to pay for a citation online or through the mail. To contest a citation, the request must be made by writing, telephone, or in person at the Office of Parking Violations. Be prepared to explain why the citation is either invalid or should be dismissed. Also, be sure to bring all documentation to support your request.</p>', 'How to Fight Your San Jose Parking Ticket', 16, 'parking, appeal', 'how-to-fight-your-san-jose-parking-ticket', '', 0, 0, 'San Jose', 73),
(261, 'secondary', 'http://www.sfmta.com/cms/penf/13441.html#protest', 3, '<p>To fight a parking ticket in San Francisco, drivers should first seek an Administrative Review. If the driver receives a denial of the review, they should then seek an Administrative Hearing. Click for information on deadlines and where to request a hearing date.</p>', 'How to Fight Your San Francisco Parking Ticket', 15, 'parking, appeal', 'how-to-fight-your-san-francisco-parking-ticket', '', 0, 0, 'San Francisco', 49),
(263, 'secondary', 'http://www.nolo.com/legal-encyclopedia/free-books/beat-ticket-book/chapter2-1.html', 3, 'Determine what you have been charged with, find the law online, review the law, and determine if you can fight your ticket. ', 'How to Research Traffic Laws', 16, 'parking, traffic, speeding', 'how-to-research-traffic-laws', '', 0, 0, '', 62),
(264, 'secondary', '', 3, '<p>A presumed speed limit means that you''re allowed to go over the posted speed limit as long as you were driving safely. For example, if it was a clear day with very few cars on the road, you could probably safely over the speed limit. Therefore, you should not get a speeding ticket and you can argue this in court. Most states have a presumed speed limit.</p>', 'Presumed Speed Limit Can Help You Fight Your Speeding Ticket', 9, 'speeding', 'presumed-speed-limit-can-help-you-fight-your-speeding-ticket', '', 0, 0, '', 57),
(286, 'secondary', 'http://startuplawyer.com/convertible-notes/the-basics-of-convertible-debt-financing', 2, '<p>Convertible debt financing is a loan to a startup that can later be converted to equity or shares of ownership. Convertible notes are typically converted during the startup''s next funding round. For example, convertible debt may convert at Series A if the debt is being raised for a seed/angel/friends and family round.</p>\n<p>The note holder usually gets a discount for the shares, compared to those investing in the next funding round. This discount is typically measured as a percentage. Convertible debt often also bears a cap, which defines the maximum valuation for which the conversion can be calculated. For example, a 5m dollar cap on a company with an 8m dollar valuation will still be treated as a 5m dollar company for the purposes of calculating conversion of convertible notes.</p>\n<p>The terms attached to convertible debt is often complex and may come with covenants, warrants, or options. There are also ways to frame convertible debt terms in a manner that is more favorable to startup founders. A lawyer with experience in venture funding and emerging growth companies can help you negotiate and draft terms as well as help you find investors to fill your rounds.</p>', 'What is a Convertible Note?', 14, 'convertible note, financing', 'what-is-a-convertible-note', '', 5, 0, '', 84),
(267, 'secondary', 'http://www.nytrafficticket.com/blog/index.php/2011/04/08/how-much-does-a-new-york-speeding-ticket-cost/', 3, '<p>Drivers found speeding in New York can be cited anywhere between $45 to $600 per ticket. These amounts depend on how many miles per hour over the speed limit the driver was found driving in. Every fine includes a $70 additional New York State surcharge. In rare circumstances, a judge may impose a jail term for speeding tickets.</p>', 'Speeding Ticket Fines New York City', 11, 'speeding, fines', 'speeding-ticket-fines-new-york-city', '', 0, 0, 'New York City', 44),
(268, 'secondary', 'http://a841-dotvweb01.nyc.gov/ParkingRegs/ViewController/LocationValidation.aspx', 3, '<p>Different streets in New York have different regulations for parking. The Department of Transportation in New York has a working map of parking regulations. Click "view source" to find out the parking rules of any street in New York City.</p>', 'Parking Rules by Street in New York City', 11, 'parking', 'parking-rules-by-street-in-new-york-city', '', 0, 0, 'New York City', 39),
(269, 'secondary', 'http://nycdot.info/dotmap/', 3, '<p>An interactive map with parking rules of any street in New York City. This map has listings for street conditions, parking signs, and resurfacing projects. Click to interact and find out what driving conditions are like for your destination.</p>', 'Parking Rules Map for New York City', 11, 'parking', 'parking-rules-map-for-new-york-city', '', 0, 0, 'New York City', 41),
(270, 'secondary', 'http://www.nyc.gov/html/dof/html/parking/park_tickets_violations.shtml', 3, '<p>In New York traffic or parking fines range from $50 to $115 per violation. Common New York violations include, driving through a red light, idling your vehicle in a restricted area, or blocking an intersection. Click for a detailed list of violations and associated fines.</p>', 'Parking Violation Rules and Fines New York City', 15, 'parking, fines', 'parking-violation-rules-and-fines-new-york-city', '', 0, 0, 'New York City', 39),
(271, 'secondary', 'http://www.nyc.gov/html/dot/html/motorist/prkintro.shtml#regs', 3, '<p>If a T-intersection does not have any traffic signals, all-way stop signs or crosswalk markings, then it''s alright to park on the edges of the intersection. A curb cut is the part of a sidewalk that has been lowered or cut so that pedestrians have an easier time walking across the street.</p>', 'General Parking Information New York City', 17, 'parking', 'general-parking-information-new-york-city', '', 0, 0, 'New York City', 42),
(272, 'secondary', 'http://parkitnyc.com/parking-nyc/nyc-parking-tickets/no-standing-ticket-nyc/', 3, 'No Parking - you can drop off and pick up people and personal property. <br/><br/>\nNo Standing - you can drop off and pick up people only. <Br/><br/>\nNo Stopping - you can''t stop at all.', 'The Difference Between No Parking, No Standing, and No Stopping Signs', 7, 'parking, signs', 'the-difference-between-no-parking-no-standing-and-no-stopping-signs', '', 0, 0, 'New York City', 44),
(273, 'news', 'http://newyork.cbslocal.com/2012/07/13/drivers-in-west-new-york-frustrated-by-tickets-for-improper-parking/', 3, 'CBS 2''s Christine Sloan went to the West New York Parking Authority to get its side. The director wasn''t in, but on the phone said a ticket for barely going over the white line is little over the top. News, Sports, Weather, Traffic and the Best of NY', 'Drivers In West New York Frustrated By Tickets For ''Improper Parking''', 14, 'parking, ', 'drivers-in-west-new-york-frustrated-by-tickets-for-improper-parking', '', 0, 0, 'New York City', 36),
(274, 'news', 'http://www.thenewspaper.com/news/38/3825.asp', 3, 'A new legislation was passed for New York city drivers involving electronic parking meters. In the past, a parking officer could issue a citation even if the driver was in the process of walking to the meter to pay the meter. This new law allows drivers in New York to automatically beat a parking ticket, without an appeals process, by attending a hearing and submitting evidence of the citation being within 5 minutes of parking the car. ', 'New York Protects Drivers from Electronic Parking Meters', 13, 'parking, meters', 'new-york-protects-drivers-from-electronic-parking-meters', '', 0, 0, 'New York City', 40),
(275, 'news', 'http://www.ibtimes.com/articles/361569/20120710/new-york-city-parking-street-gps-lots.htm', 3, 'It''s common knowledge that parking in City is a miserable experience. Finding spots can be frustrating, parking is expensive, street-side parking notices are inscrutable, and more often than not, when you do find a space, you have to move your car again the next day because of street cleaning, the Independence Day parade or because the NYPD claims you''re in front of a fire hydrant.', 'Tiger Traps And Weird Signs: The Pain Of Parking In New York', 14, 'parking, signs', 'tiger-traps-and-weird-signs-the-pain-of-parking-in-new-york', '', 0, 0, 'New York City', 34),
(276, 'news', 'http://newyork.cbslocal.com/2012/06/25/nyc-booting-pilot-program-begins-targeting-ticket-scofflaws-in-brooklyn/', 3, 'The city is testing out the boot program for the next three to six months with the hope that it will be more convenient for everyone. But some already want to give the boot to the boot, calling it unfair for drivers.', 'NYC Booting Pilot Program Begins Targeting Ticket Scofflaws In Brooklyn', 7, 'parking, booting', 'nyc-booting-pilot-program-begins-targeting-ticket-scofflaws-in-brooklyn', '', 0, 0, 'New York City', 36),
(277, 'secondary', 'http://www.nyc.gov/html/dof/html/parking/park_red_light.shtml', 3, '<b>Camera violations include running through a red light or driving/parking/standing in a bus lane. Vehicles filmed will receive their ticket in the mail approximately 30 days after the violation. Violators can pay the fines or appeal the citation online. It is difficult to fight a camera violation because the evidence (picture) is hard to dispute. Click and scroll to the bottom for more information on options violators have. ', 'New York City Camera Violations', 7, 'red light, traffic', 'new-york-city-camera-violations', '', 0, 0, 'New York City', 44),
(278, 'secondary', 'http://parkitnyc.com/driving-nyc/nyc-traffic-ticket/nyc-traffic-violations/', 3, '<p>Traffic violations in New York City can range from $50 to $100 per ticket. These tickets have different points that can directly affect the cost of insurance. For example: going through a red light ($50, 2 points), cell phone ticket ($130, 2 points), blocking intersection ($115, 2 points), idling in a restricted area ($115, 2 points), etc. Click "view source" for a list of common traffic tickets and their fines.</p>', 'Common Traffic Tickets & Fines in New York City', 11, 'traffic, fines', 'common-traffic-tickets-fines-in-new-york-city', '', 0, 0, 'New York City', 44),
(279, 'secondary', 'http://nycserv.nyc.gov/NYCServWeb/NYCSERVMain', 3, '<p>New York drivers are able to pay for their parking tickets online. Be sure to have your ticket number and other relevant information ready. Drivers are also able to request a hearing to appeal certain tickets. Click source and navigate the site using Search -or- Pay For: Parking, red light, bus lane camera violation online payment system.</p>', 'Pay Your New York Parking Ticket Here', 12, 'parking, fines, pay ticket', 'pay-your-new-york-parking-ticket-here', '', 0, 0, 'New York City', 21),
(280, 'secondary', 'https://transact.dmv.ny.gov/pleadnpay/', 3, 'You may be eligible to pay your traffic ticket online if you see the words "Traffic Violations Bureau" at the bottom. ', 'Pay Your New York City Traffic Ticket Here', 13, 'traffic, fines, pay ticket', 'pay-your-new-york-city-traffic-ticket-here', '', 0, 0, 'New York City', 39),
(281, 'secondary', 'http://www.nyc.gov/html/dof/html/parking/park_tickets_dispute.shtml', 3, '<p>Persons who wish to fight a ticket should request a hearing within 30 days of receiving the ticket. These individuals are also eligible for paying the tickets online. Click "view source" to be redirected to the New York City parking website.</p>', 'How to Fight Your New York City Parking Ticket', 9, 'parking, appeal', 'how-to-fight-your-new-york-city-parking-ticket', '', 0, 0, 'New York City', 52),
(282, 'secondary', 'http://nycserv.nyc.gov/NYCServWeb/NYCSERVMain', 3, '<p>New York drivers can request a hearing for parking ticket violations online. Be sure to have your ticket number ready. Click on Request Hearing For: Parking/Red Light/Bus Lane Camera Violations.</p> ', 'Fight Your New York Parking Ticket Online', 9, 'parking, appeal', 'fight-your-new-york-parking-ticket-online', '', 0, 0, 'New York City', 40),
(283, 'secondary', 'http://www.nyc.gov/html/dof/html/parking/park_tickets_appeal.shtml', 3, '<p>To request an appeal for a New York City parking ticket, file an Appeal Application within 30 days of the Administrative Law Judge''s hearing decision. Both these applications are available online (check source).</p>', 'Appeal a Hearing Decision for New York City Ticket ', 17, 'parking, appeal', 'appeal-a-hearing-decision-for-new-york-city-ticket', '', 0, 0, 'New York City', 49);
INSERT INTO `links` (`id`, `type`, `url`, `category`, `summary`, `title`, `votes`, `tags`, `slug`, `source`, `poster`, `date_created`, `location`, `views`) VALUES
(284, 'news', 'http://www.nydailynews.com/new-york/late-fees-city-drivers-appealing-tickets-article-1.1111059', 3, 'City drivers are no longer on the hook to pay parking fines and late fees while they''re appealing their tickets. The city used to charge late fees 30 days after a ticket was issued, even if the driver was still appealing a guilty finding - but a law passed by the City Council earlier this year banned that practice.', 'Nix late fees in tix appeal', 12, 'parking, traffic, fines', 'nix-late-fees-in-tix-appeal', '', 0, 0, 'New York City', 37),
(285, 'secondary', 'http://www.plagiarismtoday.com/stopping-internet-plagiarism/your-copyrights-online/1-what-is-a-copyright/', 41, 'Copyright law gives exclusive right to reproduce, publish, sell, prepare derivatives of, or distribute things you create. This may include literary, musical, and artistic works. It gives you ownership rights, and generally no one else is allowed to use your creative work without permission. However, there are exceptions to copyright such as fair use and public domain.', 'What is a Copyright?', 9, 'ip, copyright, fair use, public domain', 'what-is-a-copyright', '', 0, 0, '', 150),
(287, 'secondary', 'http://techcrunch.com/2012/04/21/convertible-note-seed-financings-econ-101/', 2, 'A convertible note is short-term debt that converts into equity. The debt typically converts into shares of preferred stock upon closing of the next round of financing. An advantage of convertible notes is that it avoids the valuation discussion until the round of financing. It is also easier and cheaper to execute than a stock transfer agreement. ', 'Everything You Ever Wanted To Know About Convertible Note Seed Financings', 6, 'convertible note, financing', 'everything-you-ever-wanted-to-know-about-convertible-note-seed-financings', '', 0, 0, '', 37),
(288, 'secondary', 'http://startuplawyer.com/convertible-notes/how-convertible-debt-works', 2, 'Most convertible promissory notes contain an Automatic Conversion clause that automatically converts the debt into equity upon a "Qualified Financing." Qualified Financing is equity financing by the startup (e.g. Series A round), of an amount determined previously, that triggers the conversion of the debt to equity. The amount of shares converted is dependent on the conversion discount rate outlined in the promissory note. Typically there is a 20% discount. ', 'How Convertible Notes Work', 3, 'convertible note, financing', 'how-convertible-notes-work', '', 0, 0, '', 45),
(289, 'secondary', 'http://startuplawyer.com/convertible-notes/the-convertible-note-discount-price-cap', 2, '<p>Convertible notes are loans that later convert into equity. They typically convert at a 20% discount compared to other investors in the round. However, one problem is that investors with convertible notes get greater equity the lower a startup''s pre-money valuation is. Therefore, the investor may have little incentive to help increase your pre-money valuation. To avoid this situation, investors can put a price cap on the convertible note discount. The price cap is an artificial pre-money valuation that acts as a price ceiling. Thus, if the pre-money valuation is greater than the price cap, then the price cap is used to determine the number of shares to distribute. If the pre-money values is less than the price cap, the original discount rate is used.</p>', 'Convertible Note Discount Price Caps', 8, 'convertible note, financing, price cap', 'convertible-note-discount-price-caps', '', 0, 0, '', 48),
(290, 'secondary', 'http://startuplawyer.com/convertible-notes/how-to-set-conversion-discounts-in-convertible-notes', 2, '<p>A Convertible Note is a loan that converts to equity upon a qualified financing round. The number of shares converted is usually discounted to benefit the note holder. Discounts are typically determined by a number of factors including:</p>\n1) the approximate amount of risk the note investor is taking<br/>\n2) general risk of an early stage startup and<br/>\n3) time and likelihood of the startup''s valuation increasing. \n<p>The majority of convertible notes contain a discount between 10% and 40%.</p>', 'Conversion Discounts in Convertible Notes', 13, 'convertible note, financing', 'conversion-discounts-in-convertible-notes', '', 3, 0, '', 70),
(291, 'secondary', 'http://copyright.cornell.edu/resources/publicdomain.cfm', 41, 'A public domain work may be used freely by everyone because it is not protected by copyright. Copyrighted works may become public domain when the work''s term has expired or if the author fails to perform certain statutory formalities. Furthermore, works of the U.S. Government are public domain. ', 'Copyright Term and the Public Domain', 10, 'ip, copyright, public domain', 'copyright-term-and-the-public-domain', '', 0, 0, '', 44),
(293, 'secondary', 'http://en.wikipedia.org/wiki/Stop_Online_Piracy_Act', 37, 'The Stop Online Piracy Act (SOPA) is a United States bill designed to expand the ability of US law enforcement to fight online trafficking in copyrighted intellectual property and counterfeit goods. It encourages advertisers and payment processors to end service with offending sites and orders Internet service providers to block access to websites that feature infringing material. SOPA has been severely criticized for circumventing the DMCA''s "safe harbor" provision and for First Amendment violations.', 'What Is SOPA?', 7, 'sopa, copyright', 'what-is-sopa', '', 0, 0, '', 66),
(294, 'news', 'http://www.stanfordlawreview.org/online/dont-break-internet', 37, 'Two bills now pending in Congress-the PROTECT IP Act of 2011 (Protect IP) in the Senate and the Stop Online Piracy Act (SOPA) in the House-represent the latest legislative attempts to address a serious global problem: large-scale online copyright and trademark infringement.', 'Don''t Break the Internet - Stanford Law Review', 12, 'sopa, copyright, trademark, ip, online security', 'dont-break-the-internet-stanford-law-review', '', 0, 0, '', 43),
(295, 'secondary', 'http://www.hrc.org/marriage-center#.UBhJD7S0wfV', 34, 'Learn about the fight for marriage equality in your state. ', 'Human Rights Campaign - Marriage Center', 10, 'same-sex marriage, states, legal status ', 'human-rights-campaign-marriage-center', '', 0, 0, '', 38),
(296, 'secondary', 'http://www.net-coalition.com/wp-content/uploads/2011/08/tribe-legis-memo-on-SOPA-12-6-11-1.pdf', 37, 'Anti-SOPA advocates argue that SOPA infringes on free speech and would threaten the existence of many websites. Currently, the "safe harbor" provision of the DMCA permits service providers to create copyright policies that will protect them from copyright infringement claims. However, under SOPA, anyone who has been affected by copyright or trademark infringement may send a letter to online advertisers and payment processors notifying them of infringement. The advertisers and processors must then cease providing services to the allegedly infringing site within 5 days even if no court has actually found infringement. ', 'SOPA Violates the First Amendment', 8, 'sopa, constitution', 'sopa-violates-the-first-amendment', '', 0, 0, '', 44),
(297, 'news', 'http://www.forbes.com/sites/andygreenberg/2011/12/21/sopa-haters-are-already-finding-easy-ways-to-circumvent-its-censorship/', 37, '"The Internet interprets censorship as damage and routes around it," goes the saying coined by Sun Microsystems coder and EFF founder John Gilmore. Now the Internet''s communities of coders and free speech advocates have interpreted the Stop Online Piracy Act (SOPA) as intolerable digital damage before it has even come [...]', 'SOPA Haters Are Already Finding Easy Ways To Circumvent Its Censorship - Forbes', 9, 'sopa, censorship, piracy, DNS', 'sopa-haters-are-already-finding-easy-ways-to-circumvent-its-censorship-forbes', '', 0, 0, '', 43),
(298, 'news', 'http://ammori.files.wordpress.com/2011/12/ammori-first-amd-sopa-protectip.pdf', 37, 'Generally, material that infringes on copyrighted material is subject to a standard of scrutiny that is excused rom First Amendment scrutiny. This means that someone who infringes on another''s copyrighted material would not be able to raise a First Amendment, or free speech, defense. However, anti-SOPA advocates argue that SOPA does not only target infringing material; it does not require that the court find evidence of infringement before copyright holders can demand action. Therefore, anti-SOPA advocates argue that SOPA would fail under the First Amendment because it restricts non-infringing speech.', 'Anti-SOPA Letter to Congress', 13, 'sopa, pipa, constitution, copyright, free speech', 'anti-sopa-letter-to-congress', '', 0, 0, '', 40),
(299, 'news', 'http://www.techdirt.com/articles/20111118/03163416812/sandia-national-labs-dns-filtering-sopapipa-wont-stop-piracy-will-hurt-online-security.shtml', 37, 'from the more-experts-weigh-in dept We''ve covered at great length the problems with DNS filtering in SOPA and PROTECT IP (PIPA) and how it will harm internet security. These concerns were first highlighted by a group of folks who are considered to be some of the foremost experts (and original architects) on DNS.', 'Sandia National Labs: DNS Filtering In SOPA/PIPA Won''t Stop Piracy, But Will Hurt Online Security | Techdirt', 16, 'sopa, pipa, DNS, online security', 'sandia-national-labs-dns-filtering-in-sopapipa-wont-stop-piracy-but-will-hurt-online-security-techdirt', '', 0, 0, '', 42),
(300, 'secondary', 'http://en.wikipedia.org/wiki/Viacom_International_Inc._v._YouTube,_Inc.', 41, 'In Viacom v. YouTube, Viacom sued Google for featuring clips of videos owned by Viacom without permission. Viacom argued that Google not only knew of the infringement, but also encouraged it to drive traffic to the site. The court held that some of YouTube''s use was protected under the "safe harbor" provision of the DMCA. Viacom had not proved that Google had the right and ability to control some of the material used for syndication, so the case was remanded. ', 'Viacom International Inc. v. YouTube, Inc.', 13, 'Viacom, YouTube, copyright, DMCA, safeharbor', 'viacom-international-inc-v-youtube-inc', '', 0, 0, '', 43),
(301, 'secondary', 'https://www.eff.org/deeplinks/2012/04/viacom-v-google-decision', 1, 'Although YouTube didn''t gain complete victory over Viacom (due to the remand on syndication), the Electronic Frontier Foundation ("EFF") explains that the outcome of Viacom v. YouTube is mostly in favor of the "safe harbor" provision of the DMCA. While YouTube, and other service providers, may not be "willfully blind" towards infringement or encourage it, they do not have an obligation to continuously monitor material to determine whether it is infringing. The outcome of this case establishes that the "safe harbor" provision is still intact, which is a good confirmation for innovators and service providers.', 'Viacom v. Google', 10, 'Viacom, Google, YouTube, DMCA', 'viacom-v-google', '', 0, 0, '', 2),
(302, 'secondary', 'http://www.copyright.gov/legislation/dmca.pdf', 41, 'Digital Milennium Copyright Act of 1998, DMCA.', 'The Digital Millennium Copyright Act of 1998', 8, 'DMCA, copyright, safe harbor, WIPO', 'the-digital-millennium-copyright-act-of-1998', '', 0, 0, '', 50),
(303, 'secondary', 'https://www.eff.org/issues/dmca/', 41, 'The Digital Millennium Copyright Act (DMCA) has two controversial sections, the "anti-circumvention" and "safe harbor" provisions. The "anti-circumvention" provisions were intended to stop copyright pirates from defeating Digital Rights Management (DRM). This is controversial because it may affect non-infringing fair use. The "safe harbor" provisions protect service providers from monetary liability based on the allegedly infringing activities of third parties. Although copyright holders may not like the "safe harbor" provision, it is important for innovators and free expression online.', 'What is DMCA?', 13, 'dmca, copyright, safe harbor', 'what-is-dmca', '', 0, 0, '', 36),
(304, 'secondary', 'http://www.cnn.com/2012/03/22/tech/web/isps-sopa-piracy/index.html?iref=allsearch', 37, '(CNN) -- SOPA appears to be dead. But the battle over Internet piracy is not. In the wake of the debate over theStop Online Piracy Act, supporters of that now-abandoned bill are looking to Internet service providers for help; they''re also taking other tacks that Web-freedom advocates say could have much the same effect as SOPA would have had.', 'With SOPA shelved, anti-piracy advocates take new approaches - CNN.com', 9, 'sopa, piracy, censorship, acta', 'with-sopa-shelved-anti-piracy-advocates-take-new-approaches-cnncom', '', 0, 0, '', 41),
(305, 'news', 'http://blogs.wsj.com/digits/2012/05/31/top-agent-presses-silicon-valley-to-help-stop-piracy/?KEYWORDS=sopa', 37, 'Hollywood and Silicon Valley need to work together to tackle many of the challenges facing both industries, argued William Morris Endeavor Co-Chief Executive Ari Emanuel at the D: All Things Digital conference. Emanuel-whose clients include Martin Scorsese, Charlize Theron and earlier D speaker Aaron Sorkin-said he realized studios were at odds with technology companies earlier this year over the proposed Stop Online Piracy Act.', 'Top Agent Presses Silicon Valley to Help Stop Piracy', 10, 'Silicon Valley, piracy, sopa, television, ip', 'top-agent-presses-silicon-valley-to-help-stop-piracy', '', 0, 0, '', 36),
(306, 'news', 'http://www.whitehouse.gov/blog/2012/06/25/help-us-shape-our-strategy-intellectual-property-enforcement', 37, 'Today my office is starting the process of gathering input for the Administration''s new strategy for intellectual property enforcement. The overarching objective of the Strategy is to improve the effectiveness of the U.S. Government''s efforts to protect our intellectual property here and overseas.', 'Help Us Shape Our Strategy for Intellectual Property Enforcement | The White House', 11, 'sopa, white house, ip, federal register notice', 'help-us-shape-our-strategy-for-intellectual-property-enforcement-the-white-house', '', 0, 0, '', 39),
(307, 'news', 'http://www.nytimes.com/2012/07/10/business/media/tech-and-media-elite-are-likely-to-debate-piracy.html?hpw', 37, 'But lately some of the highest-paid executives at the world''s largest media companies have talked a lot about the lessons they learned from a failed industrywide attempt to pass antipiracy legislation six months ago. In January, the technology industry led by Google, Facebook and Wikipedia revolted against two bills called SOPA and PIPA - short for Stop Online Piracy Act and Protect Intellectual Property Act.', 'Tech and Media Executives Are Likely to Debate Piracy', 5, 'sopa, pipa, piracy', 'tech-and-media-executives-are-likely-to-debate-piracy', '', 0, 0, '', 42),
(308, 'news', 'http://techcrunch.com/2012/07/10/sopa-intellectual-property-attache-act/', 37, 'It''s alive! Hollywood darling U.S. Representative Lamar Smith is attempting to reanimate portions of the Stop Online Privacy Act (SOPA) bit by bit. The Intellectual Property Attaché Act, slipped in for consideration over the weekend, revives one of the sneaker portions of SOPA to create a global intellectual property task force, charged with aggressively promoting anti-piracy law around the world.', 'Zombie SOPA? Congressman Introduces Pieces Of Defeated Bill, With Support From Former Opponent Issa', 8, 'sopa, ip, copyright, hollywood', 'zombie-sopa-congressman-introduces-pieces-of-defeated-bill-with-support-from-former-opponent-issa', '', 0, 0, '', 45),
(309, 'secondary', 'http://www.law.cornell.edu/uscode/text/17/512', 37, 'Online Copyright Infringement Liability limitation Act, DMCA, § 512 of Title 17 of USC.', 'Limitations on Liability Relating to Material Online', 13, 'sopa, online liability, online material', 'limitations-on-liability-relating-to-material-online', '', 0, 0, '', 40),
(310, 'news', 'http://en.wikipedia.org/wiki/Online_Copyright_Infringement_Liability_Limitation_Act', 41, 'OCILLA is also known as the "safe harbor" provision of the Digital Millennium Copyright Act. It allows service providers the opportunity to create policies that may shield them from copyright infringement claims as long as they adhere to specified guidelines.', 'Overview of the Online Copyright Infringement Liability Limitation Act', 10, 'copyright, ocilla, isp, dmca, safe harbor', 'overview-of-the-online-copyright-infringement-liability-limitation-act', '', 0, 0, '', 38),
(311, 'news', 'http://www.cnn.com/2012/07/31/us/scotus-same-sex-marriage/index.html', 34, 'Washington (CNN) -- Supporters of California''s voter-approved ballot measure banning same-sex marriage in the state asked the U.S. Supreme Court Tuesday to allow it go back into effect. At issue is whether the Constitution''s 14th Amendment guarantee of "equal protection" prevents states from defining marriage as only between one man and one woman.', 'High court asked to accept appeal over California same-sex marriage ban - CNN.com', 17, 'same-sex marriage, supreme court, constitution', 'high-court-asked-to-accept-appeal-over-california-same-sex-marriage-ban-cnncom', '', 0, 0, '', 57),
(312, 'news', 'http://www.businessweek.com/ap/2012-07-27/amazon-ceo-gives-2-dot-5m-for-wash-dot-gay-marriage-law', 34, 'OLYMPIA, Wash. (AP) - Amazon.com founder and CEO Jeff Bezos and his wife, MacKenzie, announced Friday they are donating $2.5 million to the campaign to defend Washington''s same-sex marriage law. With the gift, Washington United for Marriage has raised more than $5 million for its referendum campaign.', 'Amazon CEO gives $2.5M for Wash. gay marriage law', 10, 'same-sex marriage, washington, human rights, amazon', 'amazon-ceo-gives-25m-for-wash-gay-marriage-law', '', 0, 0, '', 39),
(313, 'news', 'http://www.cbs8.com/story/9518991/san-diegos-parking-ticket-hot-spots', 3, 'Parking citations are a multi-million dollar source of income for the City of San Diego. If you''re tired of making contributions, it pays to know where the parking cops write the most tickets. We can tell you the number one spot is not where you''d expect. When you park downtown, if you do the crime, be prepared to pay the fine.', 'San Diego''s Parking Ticket Hot Spots', 8, 'parking, fines', 'san-diegos-parking-ticket-hot-spots', '', 0, 0, 'San Diego', 40),
(314, 'news', 'http://www.utsandiego.com/news/2012/jul/13/does-your-boss-need-pay-your-parking-tickets/', 3, 'Picture this: Your boss sends you out of the office to attend an afternoon meeting with a client at a coffee shop. You get back to your car to drive back to work, and find a parking ticket on your windshield. That''s a good $50 down the drain.', 'Should your boss pay for your parking tickets?', 10, 'parking, employment, fines', 'should-your-boss-pay-for-your-parking-tickets', '', 0, 0, 'San Diego', 36),
(315, 'news', 'http://www.10news.com/news/24174726/detail.html', 3, 'POSTED: 3:05 pm PDT July 7, 2010 SAN DIEGO -- In a typical year in San Diego, the city''s Parking Enforcement division issues nearly 500,000 parking tickets, and those tickets generate a healthy sum for the city -- about $20 million each year in fines and penalties.', '10News Exposes City''s Worst Parking Ticket Offenders', 14, 'parking', '10news-exposes-citys-worst-parking-ticket-offenders', '', 0, 0, 'San Diego', 34),
(316, 'news', 'http://www.metroactive.com/papers/cruz/03.12.98/parking-9810.html', 3, 'Metro Santa Cruz | MetroActive Central | Archives ]Park Avenue Breakdown Robert Scheer A Boot Point: Once the dreaded Denver boot is clamped on a car''s front wheel, the descent into the lower circles of parking hell begins in earnest for ''scofflaws.''', 'MetroActive News & Issues | Parking Tickets', 7, 'parking, booting', 'metroactive-news-issues-parking-tickets', '', 0, 0, 'San Jose', 38),
(317, 'news', 'http://www.sfexaminer.com/local/transportation/2011/01/tow-away-zones-drivers-stuck-intersections-be-focus-parking-crackdown-s', 3, 'San Francisco motorists who park their cars in tow-away zones or stop in the middle of intersections will be targeted by new efforts to earn more money from parking scofflaws. To eliminate a projected $21.2 million budget deficit by June 30, the San Francisco Municipal Transportation Agency plans to reduce employee overtime and write more tickets.', 'Parking ticket crackdown coming for San Francisco drivers', 5, 'parking, budget deficit', 'parking-ticket-crackdown-coming-for-san-francisco-drivers', '', 0, 0, 'San Francisco', 37),
(318, 'news', 'http://www.nbcbayarea.com/news/local/Parking-Tickets-Dont-Count-on-Certain-SF-Hills-125684488.html', 3, 'Dear David, I hope you can answer this question for me. I have lived in North Beach for about 3 years, and have benefited greatly from your book and site. My question is about fighting a ticket based on how it was delivered.', 'Parking Tickets Don''t Count on Certain SF Hills', 15, 'parking, hills', 'parking-tickets-dont-count-on-certain-sf-hills', '', 0, 0, 'San Francisco', 35),
(319, 'news', 'http://www.7x7.com/arts-culture/top-5-parking-citations-issued-sf-2011', 3, 'The numbers have been crunched, and the results are in. The top 5 parking tickets in SF are: 1. Street Cleaning (527,563), 2. Parking Meters (397,449), 3. Residential (169,203), 4. Block Wheels (54,217), and 5. Vehicle Registration (43,439).', 'The Top 5 Parking Citations Issued in SF in 2011', 9, 'parking, fines', 'the-top-5-parking-citations-issued-in-sf-in-2011', '', 0, 0, 'San Francisco', 37),
(320, 'news', 'http://www.nbcbayarea.com/news/local/The-Most-Expensive-Parking-Ticket-in-San-Francisco-134940458.html', 3, 'The most expensive SF parking citations is misuse of a disabled placard, which can cost you $935. There were close to 700 illegal disabled placards confiscated in the first 3 months of the implementation of a program controlling its use. ', 'What is the Most Expensive SF Parking Citation?', 5, 'parking, fines', 'what-is-the-most-expensive-sf-parking-citation', '', 0, 0, 'San Francisco', 40),
(321, 'news', 'http://www.boston.com/whitecoatnotes/2012/07/31/digesting-the-health-care-compromise-bill/JAvFtcwKYPyZCj1g6CWQUI/story.html', 35, 'Lawmakers are expected to vote Tuesday on a 350-page bill that would make Massachusetts the first state to impose limits on how much health care providers can spend on medical costs. It''s a complicated, far-reaching bill. Leaders in the House and Senate prepared summaries of key provisions in the bill.', 'Digesting the Health Care Compromise Bill', 8, 'healthcare reform, massachusetts, health costs', 'digesting-the-health-care-compromise-bill', '', 0, 0, '', 39),
(322, 'news', 'http://money.cnn.com/2012/07/30/news/economy/medicaid-texas-health-care/index.htm?fb_action_ids=3058178273204&fb_action_types=og.recommends&fb_source=other_multiline&action_object_map=%7B%223058178273204%22%3A10151089950418217%7D&action_type_map=%7B%223058178273204%22%3A%22og.recommends%22%7D&action_ref_map=%5B%5D', 35, 'Texas resident Gerard McMahan can''t afford his health care, but also doesn''t qualify for Medicaid. NEW YORK (CNNMoney) -- Texas Governor Rick Perry says he won''t expand Medicaid eligibility under the health reform law because he wants to spare taxpayers billions of dollars.', 'Who covers health care for Texas'' uninsured? Taxpayers', 17, 'healthcare reform, texas, perry, obamacare', 'who-covers-health-care-for-texas-uninsured-taxpayers', '', 0, 0, '', 45),
(323, 'news', 'http://www.huffingtonpost.com/2012/07/24/supreme-court-health-care_n_1698873.html?utm_hp_ref=health-care-law', 35, 'Health care reform will extend health insurance benefits to 3 million fewer people by 2022 as a result of the Supreme Court''s decision in June that states could choose not to expand Medicaid for the poor, according to an analysis published by the Congressional Budget Office Tuesday.', 'Supreme Disappointment: Court Ruling On Health Care Reform Could Deny 3 Million People Insurance', 9, 'healthcare reform, health insurance, medicaid', 'supreme-disappointment-court-ruling-on-health-care-reform-could-deny-3-million-people-insurance', '', 0, 0, '', 41),
(324, 'news', 'http://www.examiner.com/article/obama-s-dream-act-by-fiat-condemned-by-lawmakers-enforcement-agents-1', 36, 'Senator David Vitter (R-LA), a ranking member of the Senate Armed Services Committee, slammed President Barack Obama''s immigration policy changes Sunday during', 'Obama''s Dream Act by fiat condemned by lawmakers, enforcement agents', 9, 'immigration, dream act', 'obamas-dream-act-by-fiat-condemned-by-lawmakers-enforcement-agents', '', 0, 0, '', 40),
(325, 'news', 'http://www.foxnews.com/us/2012/07/17/ariz-immigration-law-opponents-file-new-offensive/', 36, 'Opponents of Arizona''s hardline immigration enforcement law launched a new effort Tuesday aimed at thwarting a U.S. Supreme Court ruling that will allow police to enforce the so-called "show me your papers" provision.', 'Ariz. immigration law opponents file new offensive', 12, 'immigration, arizona, supreme court, unconstitutional', 'ariz-immigration-law-opponents-file-new-offensive', '', 0, 0, '', 38),
(326, 'news', 'http://www.businessweek.com/news/2012-07-29/scalia-rejects-criticism-of-dissent-in-arizona-case', 36, 'U.S. Supreme Court Justice Antonin Scalia rejected criticism that he improperly went outside the court record in his dissent to last term''s decision on Arizona''s immigration law, saying his consideration of presidential remarks was appropriate.', 'Scalia Rebuffs Criticism of Dissent in Immigration Case', 16, 'immigration, arizona, supreme court', 'scalia-rebuffs-criticism-of-dissent-in-immigration-case', '', 0, 0, '', 43),
(328, 'document', 'http://www.seriesseed.com/files/SeriesSeedTermSheet.doc', 40, 'This is an example of a Series Seed Term Sheet.', 'Series Seed Term Sheet', 11, 'term sheet, document', 'series-seed-term-sheet', '', 0, 0, '', 45),
(327, 'secondary', 'http://www.gabrielweinberg.com/blog/2010/06/how-to-learn-about-angelvc-term-sheets.html', 2, 'Every startup entrepreneur should have a good understanding or financing term sheets. First, familiarize yourself with some actual term sheets. Next, go through each term and actually read them. Read this blog post for more information.   ', 'How to Learn About Term Sheets?', 9, 'term sheet', 'how-to-learn-about-term-sheets', '', 0, 0, '', 67),
(329, 'document', 'http://www.ycombinator.com/seriesaa/aa-termsheet.doc', 40, 'This is YC''s Series AA Term sheet. ', 'YC Series AA Termsheet', 9, 'term sheet, document', 'yc-series-aa-termsheet', '', 0, 0, '', 45),
(330, 'secondary', 'http://www.investopedia.com/terms/t/termsheet.asp#axzz22FajO8dO', 2, 'A term sheet is not a legally binding contract. It is a good faith contract that sets forth the basic terms and condition under which an investment will be made. ', 'A Term Sheet is Not a Binding Contract', 9, 'term sheet', 'a-term-sheet-is-not-a-binding-contract', '', 0, 0, '', 50),
(332, 'photo', 'http://blog.intuit.com/wp-content/blogs.dir/1/uploads/1.3.12_LLC-590x2303.png', 38, 'Neat infographic on the benefits of an LLCs.', 'What is a LLC?', 13, 'llc, entity, limited liability, tax, management', 'what-is-a-llc', '', 0, 0, '', 12),
(333, 'photo', 'http://assets.gcflearnfree.org/topics/204/infographic_copyright.png', 41, 'All original work is protected under copyright. On the other hand, works in public domain are not protected by copyright and may be used freely. Creative commons is in between. It can be used without permission, but only under certain circumstances. ', 'Difference Between Copyright, Creative Commons, and Public Domain', 15, 'ip, copyright, public domain, creative commons', 'difference-between-copyright-creative-commons-and-public-domain', '', 0, 0, '', 2),
(334, 'document', 'http://www.docracy.com/263/founder-advisor-standard-template', 40, 'Example of an Advisor Agreement that can be tailored to fit your needs.', 'Advisor Agreement', 16, 'advisor, document', 'advisor-agreement', '', 0, 0, '', 51),
(335, 'secondary', 'http://smallbusiness.findlaw.com/incorporation-and-legal-structures/incorporating-in-delaware-is-it-worth-it-for-my-small.html', 38, '<p>If you plan on doing business outside of Delaware, incorporating in Delaware might not make sense if you plan on keeping your business small because you will have to pay taxes within both your home state and Delaware. Additionally, your business might still have to qualify to do business in your home state, which is an extra administrative cost. In some instances, your small business may be more protected in your home state. Lastly, you might have to go to court in Delaware for any related legal issues, which can be costly and time consuming.</p>', 'Is Delaware Really Right for my Business?', 13, 'corporation, delaware, entity', 'is-delaware-really-right-for-my-business', '', 0, 0, '', 67),
(336, 'secondary', 'http://bizadvisor.com/LimitedLiabilityCompanyforRealEstate.htm', 38, '<p>If your business holds real property, you might want to form an LLC instead of a corporation because of its tax benefits. During the sale of company property, a LLC is only exposed to one level of tax, whereas a corporation generates two level of taxes. Further, creditors of members of an LLC cannot get the assets of the LLC and cannot step into the shoes of the member without complying with the LLC Operating Agreement, which usually includes obstacles.</p>', 'LLC is Better for Holding Real Property', 11, 'llc, corporation, real property, entity', 'llc-is-better-for-holding-real-property', '', 0, 0, '', 52),
(337, 'news', 'http://techcrunch.com/2011/09/22/free-startup-docs-how-much-equity-should-advisors-get/', 2, 'Advisors typically receive between 0.10% and 1.00%. The amount is dependent on how much traction your startup has and how much work you expect the advisor to put in. Check out this source for a chart on equity amounts. ', ' How Much Equity Should Advisors Get?', 12, 'advisor', 'how-much-equity-should-advisors-get', '', 0, 0, '', 76),
(338, 'primary', 'http://www.docracy.com/61/restated-articles-of-incorporation', 38, '<p>A certificate of incorporation (COI) is a legal document relating to the formation of a company and needs to be filed with the state you are incorporating in. It usually must include the name of the corporation, the business purpose, address of the corporation''s registered agent, number of shares of stock authorized to be issued, and address of the incorporator(s). It might also include provisions that regulate the powers of the corporation, the directors, and stockholders. It usually contains a corporation''s articles of incorporation, which are the primary rules governing the management. If the COI is amended, it must be refiled with the state. See source for an example of a COI.</p>', 'What is a Certificate of Incorporation?', 6, 'entity, certificate of incorporation, corporation', 'what-is-a-certificate-of-incorporation', '', 0, 0, '', 43),
(339, 'secondary', 'http://biztaxlaw.about.com/od/copyrightsandtrademarks/f/whyregistercopyrite.htm', 41, 'Although your work is protected from the moment you create it, you may still want to register a copyright for the following reasons: 1) it creates a public record so others know it''s copyrighted; 2) if you want to sue somebody for violating your copyright, you must register it first; 3) if you take the copyright case to court, you can get greater damages; 4) it allows you to protect your copyright abroad.', 'Why You Should Register a Copyright', 13, 'ip, copyright, register ', 'why-you-should-register-a-copyright', '', 0, 0, '', 71),
(342, 'secondary', 'http://www.investopedia.com/terms/d/double_taxation.asp#axzz22oT7AOCK', 38, '<p>Corporations typically suffer from "double taxation."  Money the corporation makes is taxed because a corporation is treated as a separate entity. Then money paid out from the corporation to individuals is taxed as well. This means that the same money is being taxed twice.</p>\n<p><b>For example</b>, your corporation makes $10 income. That $10 is taxed at your corporate rate of %30. Now you have $7. The $7 is paid out to you as salary, and is taxed under federal income tax laws at a rate of %30. Therefore, you are left with $4.90. Double taxation brought your $10 down to $4.90.</p>\n<p>On the other hand, money that comes into a LLC is only taxed once because LLCs have pass-through taxation.</> ', 'What is Double Taxation?', 15, 'corporation, entity, tax', 'what-is-double-taxation', '', 0, 0, '', 62),
(343, 'secondary', 'http://en.wikipedia.org/wiki/Creative_Commons_license', 41, 'A Creative Commons license grants distribution of copyrighted works under some conditions. It is designated by two lower-case "c"s within a circle.  Some licenses include: attribution (must give credit to author), noncommercial (can''t use to make money),  and no derivative works (can''t edit/revise work).', 'What is Creative Commons?', 15, 'creative commons, copyright', 'what-is-creative-commons', '', 0, 0, '', 45),
(347, 'secondary', 'http://www.dca.ca.gov/publications/landlordbook/checklist.pdf', 23, '<p>Use a move-in checklist to record the current condition of the rental unit, so you don''t end up paying for things you didn''t mess up. You should record the condition of items when you first moved in and when you move out. Note if there is any damage beyond reasonable wear and tear.</p><p>It''s also a good idea to have your landlord with you when you perform the inspection. That way it will be harder for the landlord to unfairly deduct money from your security deposit.</p>', 'Move-in Checklist', 16, 'checklist', 'move-in-checklist', '', 0, 0, '', 55),
(345, 'secondary', 'http://www.dca.ca.gov/publications/landlordbook/sec-deposit.shtml', 23, 'The most common disagreement between landlords and tenants is over the refund of the tenant''s security deposit after the tenant has moved out of the rental unit. California law therefore specifies procedures that the landlord must follow for refunding, using, and accounting for tenants'' security deposits.', 'Everything you Need to Know about Security Deposits', 13, 'security deposit', 'everything-you-need-to-know-about-security-deposits', '', 0, 0, 'California', 83),
(346, 'secondary', 'http://law.onecle.com/california/civil/1950.5.html', 23, 'California Civil Code Section 1950.5 is the law that  applies to security deposits for residential units. ', 'California Civil Code Section 1950.5', 11, 'security deposit', 'california-civil-code-section-19505', '', 0, 0, '', 51),
(349, 'secondary', 'http://www.courts.ca.gov/1260.htm', 7, 'There are four types of restraining orders: Domestic Violence; Elder or Dependent Adult Abuse; Civil Harassment; Workplace Violence.', 'Types of Restraining Orders', 9, '', 'types-of-restraining-orders', '', 0, 0, '', 38),
(348, 'secondary', 'http://www.nolo.com/legal-encyclopedia/protect-security-deposit-move-in-30231.html', 23, 'Some ways you can protect your security deposit when you move in include: using a move-in checklist, checking beyond superficial details, and taking picture or video. This way you will have recorded the condition of items before moving in and after moving out. Consequently, it will be harder for your landlord to dispute the condition of items and unfairly deduct money from your security deposit.', 'Protect Your Security Deposit', 17, 'checklist, protect security deposit', 'protect-your-security-deposit', '', 0, 0, '', 48),
(350, 'secondary', 'http://www.courts.ca.gov/selfhelp-domesticviolence.htm', 7, 'Domestic violence is abuse or threats of abuse when the person being abused and the abuser are or have been in an intimate relationship (married or domestic partners, are dating or used to date, live or lived together, or have a child together). It is also when the abused person and the abusive person are closely related by blood or by marriage.', 'What is Domestic Violence?', 10, '', 'what-is-domestic-violence', '', 0, 0, '', 41),
(351, 'secondary', 'http://law.onecle.com/california/civil-procedure/527.6.html', 7, '"Harassment" is unlawful violence, a credible threat of violence, or a knowing and willful course of conduct directed at a specific person that seriously alarms, annoys, or harasses the person, and that serves no legitimate purpose. The course of conduct must be such as would cause a reasonable person to suffer substantial emotional distress, and must actually cause substantial emotional distress to the petitioner.', 'Definition of Harassment and Types', 13, '', 'definition-of-harassment-and-types', '', 0, 0, '', 39),
(352, 'secondary', 'http://law.onecle.com/california/family/6211.html', 7, 'Cal. Fam. Code § 6211.', 'Legal Definition of Domestic Violence', 17, '', 'legal-definition-of-domestic-violence', '', 0, 0, '', 40),
(353, 'secondary', 'http://law.onecle.com/california/family/6203.html', 7, 'Abuse: (a)Intentionally or recklessly to cause or attempt to cause bodily injury. (b) Sexual assault. (c) To place a person in reasonable apprehension of imminent serious bodily injury to that person or to another. (d) To engage in any behavior that has been or could be enjoined pursuant to Section 6320.', 'Definition of Abuse', 9, '', 'definition-of-abuse', '', 0, 0, '', 38),
(354, 'secondary', 'http://law.onecle.com/california/penal/653m.html', 7, 'Types of harassment that warrant a Civil Harassment restraining order.', 'Types of Harassment', 15, '', 'types-of-harassment', '', 0, 0, '', 41),
(355, 'secondary', 'http://www.nolo.com/dictionary/temporary-restraining-order-(tro)-term.html', 7, 'A Temporary Restraining Order tells one person to stop harassing or harming another. A few days or weeks after it is issued, the court holds a second hearing to determine whether to make the restraining order last longer.', 'What is a Temporary Restraining Order', 7, '', 'what-is-a-temporary-restraining-order', '', 0, 0, '', 38),
(356, 'secondary', 'http://family.findlaw.com/domestic-violence/domestic-violence-orders-of-protection-and-restraining-orders.html', 7, 'There are several available civil options that can provide for the safety of victims of domestic assaults and their families, such as an order of protection, or a judicial ex parte order (also called a restraining order).', 'General Information on Restraining Orders', 12, '', 'general-information-on-restraining-orders', '', 0, 0, '', 39),
(357, 'secondary', 'http://www.womenslaw.org/laws_state_type.php?id=10920&state_code=CA', 7, 'A Domestic Violence Restraining Order (DVRO) is a protective order that is signed by a judge and tells the abuser to stop causing harm to person filing, or face serious legal consequences.  ', 'What is Domestic Violence Restraining Order?', 15, '', 'what-is-domestic-violence-restraining-order', '', 0, 0, '', 45),
(358, 'secondary', 'http://www.womenslaw.org/laws_state_type.php?id=487&state_code=CA', 7, 'A Civil Harassment Restraining Order is a protective order that prevents a person from harassing the person filing. It is used for persons you do not have a relationship with.', 'What is a Civil Harassment Restraining Order?', 11, '', 'what-is-a-civil-harassment-restraining-order', '', 0, 0, '', 40),
(548, 'primary', 'http://www.fcc.gov/encyclopedia/understanding-workplace-harassment-fcc-staff', 46, '<p>Certain types of sexual harassment may be classified as workplace discrimination, which violates Title VII of the Civil Rights Act of 1964. Harassment is defined as conduct that creates a hostile or intimidating work environment. Examples of sexual harassment may include:</p>\nStaring in a sexually way, looking up and down\n<br/><br/>\nMaking offensive comments about looks, clothing, or body parts\n<br/><br/>\nInappropriate touching, such as patting, pinching or purposely brushing\n<br/><br/>\nTelling lewd jokes, hanging sexual posters, or making sexual gestures\n<br/><br/>\nSending inappropriate letters, notes, emails, or images', 'What is Sexual Harassment?', 15, '', 'what-is-sexual-harassment', '', 0, 1349656587, '', 25),
(545, 'secondary', '', 2, '<p>Most entrepreneurs think about entering legal contracts around money–especially with banks. When a startup is strapped for finance, making legal commitments to repay, may hobble you even more. <a href="http://startupowl.com/resources/startup-boosters/bootstrap-finance/">Bootstrap finance</a> is a great way to go. Selling to produce revenue is by far the best, but there are many other ways to keep the cash flowing. If you''re a B2B, get part payments up-front; offer discounts for early settlement; look at raising finance direct, via crowdfunding or P2P borrowing; go Bedouin, by running the business from your laptop in coffee shops, or becoming a co-worker, use a virtual office or hire virtual assistants instead of staff.</p>\n<p>On the other hand, if you do formalize any loans outside the bank, for example through P2P loans or those from family and friends, make sure you use a promissory note to formalize the arrangement. Relationships are too important to jeopardize.</p>', 'Bootstrap Finance is Legal', 9, '', 'bootstrap-finance-is-legal', '', 1, 0, '', 888),
(360, 'secondary', 'http://www.courts.ca.gov/1049.htm', 23, 'The security deposit serves to protect the landlord if the tenant breaks or violates the terms of the lease or rental agreement. It may be used to cover damage to the property, cleaning, key replacement, or back rent. For an unfurnished apartment, it can only be two times the monthly rent. For a furnished apartment, it can be three times the monthly rent. ', 'Rules on Security Deposits', 10, '', 'rules-on-security-deposits', '', 0, 0, '', 56),
(361, 'secondary', 'http://www.justice.gov/usao/ut/psn/documents/guncard.pdf', 15, '', 'Quick Reference to Federal Firearm Laws', 10, '', 'quick-reference-to-federal-firearm-laws', '', 0, 0, '', 38),
(362, 'secondary', 'http://en.wikipedia.org/wiki/Assault_Weapons_Ban_and_Law_Enforcement_Protection_Act_of_2007', 15, '', 'Federal Assault Weapons Ban', 9, 'assault weapons, assault rifles', 'federal-assault-weapons-ban', '', 0, 0, '', 36),
(363, 'secondary', 'http://en.wikipedia.org/wiki/Roberti-Roos_Assault_Weapons_Control_Act_of_1989', 15, '', 'Roberti-Roos Assault Weapons Control Act of 1989', 10, 'assault weapons, assault rifles', 'roberti-roos-assault-weapons-control-act-of-1989', '', 0, 0, 'California', 32),
(364, 'news', 'http://www.washingtonpost.com/blogs/the-fix/post/why-the-aurora-shooting-wont-likely-change-the-gun-control-debate/2012/07/20/gJQA6qWpxW_blog.html', 15, '', 'Why the Aurora shootings won''t likely change the gun control debate', 15, 'aurora', 'why-the-aurora-shootings-wont-likely-change-the-gun-control-debate', '', 0, 0, '', 34),
(365, 'news', 'http://www.huffingtonpost.com/2012/08/10/gun-control-laws-democrats-conservative-states_n_1765513.html', 15, '', 'No New Gun Control Laws Needed, Say Democrats From Conservative States', 7, '', 'no-new-gun-control-laws-needed-say-democrats-from-conservative-states', '', 0, 0, '', 34),
(366, 'secondary', 'http://www.law.cornell.edu/uscode/text/18/922', 15, '', '18 USC § 922 - Unlawful acts', 10, '', '18-usc-922-unlawful-acts', '', 0, 0, '', 36),
(367, 'secondary', 'http://cga.ct.gov/2012/rpt/2012-R-0362.htm', 15, '', 'Assault Weapons Legislation', 13, '', 'assault-weapons-legislation', '', 0, 0, '', 33),
(369, 'secondary', '', 10, '<p><b>Negligence</b> is causing harm by acting in a way that most people would not. The act is done by accident and is not intentional. Most car accidents are the result of a driver''s negligence. Therefore, when people sue a driver in court for damages caused by a car accident, they are really suing because the driver was negligent. There are four conditions that must be proved to show that someone was "negligent."</p>\n<b>1. Duty</b>. In certain situations, people have a duty of care. For example, a restaurant has a duty not to serve rotting food; a security guard has a duty to keep watch; and a driver has a duty to drive safely. Although we rarely think of these examples as a person''s "duty," this is how the law defines it for negligence.\n<br/><br/>\n<b>2. Breach</b>. The person must "breach" or break their duty. The standard for deciding whether the person breached their duty is the reasonable person standard. All this really means is, did the person act in a way that most other people would have in the situation? If the answer is no, the person has breached their duty. For example, texting while driving is a breach of the duty to drive safely, and most drivers would not text while driving.\n<br/><br/>\n<b>3. Cause</b>. The breach of duty must have caused harm or damage. You can''t sue someone if it really wasn''t their fault. For example, a restaurant might breach its duty by serving you bad food. You could probably sue the restaurant for getting sick. But you couldn''t sue it for breaking your arm while skiing a week later. This is because your broken arm was not caused by the restaurant''s breach of duty.\n<br/><br/>\n<b>4. Harm</b>. Lastly, the harm must be actual damages that can be compensated. Usually physical or property damage count because your medical and repair bills can be compensated. You may also be able to recover for pain and suffering caused by the physical harm. It is more difficult, though not impossible, to recover damages for emotional damages. You might need to sue under a separate claim called Negligent Infliction of Emotional Distress.', 'What is Negligence?', 4, '', 'what-is-negligence', '', 0, 0, '', 48),
(370, 'secondary', '', 10, '<p>A car accident claim is almost always a lawsuit for negligence. Negligence is when a person acts in a way that most people wouldn''t have. In the case for car accidents, it''s when a person drives in a way he or she isn''t suppose to and causes a car accident. You can sue for car accidents caused by negligence. In rare instances, the person drove perfectly normal, but an accident happened anyways. These are no-fault accidents and no one is to blame.</p> ', 'Car Accidents Caused by Negligence', 6, '', 'car-accidents-caused-by-negligence', '', 0, 0, '', 82),
(513, 'secondary', 'http://law.onecle.com/california/family/3011.html', 9, 'Present substance abuse might hurt your chances for getting custody of your child. The court is required to consider the habitual or continual illegal use of controlled substances or alcohol when making a determination of child custody. Controlled substances is not limited to illegal drugs and may include perception drugs. The presence of drug or alcohol may weaken a person''s right to child custody. Further, the court may order physical testing if there is evidence of substance abuse.', 'Substance Abuse Affecting Custody', 15, '', 'substance-abuse-affecting-custody', '', 0, 0, '', 28),
(372, 'secondary', 'http://www.the-injury-lawyer-directory.com/negligence.html', 10, '<p>In order to sue the other driver for a car accident, the driver must be at fault. Sometimes, an accident is both your fault and the other person''s fault. In a states that follow a pure <b>comparative negligence</b> rule, even if you''re 99% at fault and the other person is only 1% at fault, you can still recover some money. However, you get less money as your fault increases. States that follow this rule include Kentucky, Louisiana, Alaska, Arizona, California, Mississippi, New Mexico, New York, Rhode Island, South Dakota, Washington, Florida, and Missouri.</p>\n<p><b>For example</b>, you hit the driver in front of you causing a rear-end collision. In this type of accident, the driver behind is almost entirely at fault. But in your case the front driver has a tail light out. Therefore, that driver may be 1% at fault, because the burnt out tail light made it harder for you to see the car and stop in time. Although, the other driver is only 1% at fault, in  a pure comparative rule state you can still file a lawsuit and recover some money. However, since the amount of money you can is reduced by your fault, it will probably be very little.</p>', 'What is Comparative Negligence?', 10, '', 'what-is-comparative-negligence', '', 0, 0, '', 48),
(373, 'secondary', '', 10, '<p>Personal injury lawyers usually accept cases based on a <b>contingent fee</b>. In other words, if the lawyer wins the case, he or she will receive a percentage of the award as the contingent fee. If the attorney loses the case, he or she does not get paid. Therefore, you only really pay if you win the case.</p>\n<p>The amount of the contingent fee varies depending on factors including the skill of the lawyer, value of the case, state you live in, and type of case. Usually, a lawyer will take between 30% and 40% of the award as the contingency fee. This is a large amount and you should decide whether it is really worth it to hire an attorney for your case. In some situations, you might keep money negotiating a settlement with the insurance company yourself. Other times, a lawyer will be able to get you more.</p>\n<p>Please note that the contingency fee is different than costs; you may still be responsible for costs related to your case, such as filing fees. If you do hire a lawyer, make sure to ask about any costs that might be involved.</p> ', 'Cost of a Personal Injury Lawyer', 14, '', 'cost-of-a-personal-injury-lawyer', '', 0, 0, '', 55);
INSERT INTO `links` (`id`, `type`, `url`, `category`, `summary`, `title`, `votes`, `tags`, `slug`, `source`, `poster`, `date_created`, `location`, `views`) VALUES
(377, 'secondary', '', 10, '<p><b>Contributory negligence</b> is used in a few states and is where you cannot recover for your injuries if you also contributed to the car accident. Even if you were 1% at fault, you will not be able to recover.</p>\n<p>Some other states have <b>modified contributory negligence</b> where you must not have contributed to the car accident by 50% or more. An example of modified contributory negligence is failing to signal and getting into an accident where the other driver was speeding. You are contributing slightly to the accident because you failed to signal. However, the other driver was probably more at fault (50% or more) for speeding. A jury typically determines who was more at fault. Some states use the modified contributory negligence rule, but car recovery at 51%, instead of 50%. </p>\n<p>Other states observe <b>comparative negligence</b>, where the amount owed to each party is proportional to their fault. For example, if you sued another driver who was 60% at fault and you were 40% at fault, you may only be able to recover for 60% of the amount you suffered in damages. In comparative negligence states, you may be able to recover even if you were 99% at fault. However, If you were 100% at fault, you cannot.</p>\n<p>Because fault is a very subjective issue, it is often wise to consult a lawyer about your case and gather as much evidence as you can before filing a lawsuit.</p>', 'Difference Between Contributory and Comparative Negligence ', 11, '', 'difference-between-contributory-and-comparative-negligence', '', 0, 0, '', 59),
(378, 'secondary', 'http://www.enjuris.com/knowledge-center/car-accident-negligence-claim.php', 10, '<p>You generally have to prove three things in a car accident tort case. You must show that:</p>\n1) <b>Fault</b> - The car accident is the other driver''s fault. The other driver can be at fault for speeding, texting while driving, tailgating, making an illegal turn, changing lanes without looking, or for any other traffic violation. In most states you can recover money as long as the other person was mostly at fault.\n<br/><br/>\n2) <b>Harm</b> - You suffered an injury or harm. If you were not hurt from the accident, then you can''t really get money from a negligence case. Harm can include physical injuries, damages to your car, or days you missed at work and you can recover money for medical bills, auto repairs, and lost wages.\n<br/><br/>\n3) <b>Cause</b> - The car accident caused your injury or harm. You can''t sue for an injury that was not caused by the accident. For example, if you hurt your back playing golf the previous week, you can''t recover money for that injury. However, you might be able to recover some money if the existing injury was made worse by the accident.', 'What You Have to Prove in any Car Accident Tort Case', 11, '', 'what-you-have-to-prove-in-any-car-accident-tort-case', '', 0, 0, '', 71),
(379, 'secondary', '', 10, '<p>There are a few ways to help you prove that the other driver was fault in a car accident.</p>\n1) <b>Police Report</b> - The police report will tell if if the other driver was cited with any violations, which can help your case. It may also contain the officer''s own opinions as to who is at fault.\n<br/><br/>\n2) <b>Type of accident</b> -  Obvious traffic violations such as swerving through 4 lanes help. A rear-end collision of left-turn accident are almost always the other person''s fault.\n<br/><br/>\n3) <b>Witnesses</b> - Witnesses can be helpful in proving the facts of the case. These can be bystanders, passengers in your car, or passengers in the other car. Biased witnesses are not as valuable though. <br/><br/>\n4) <b>Pictures</b> - Pictures are a great piece of evidence to prove your side of the story. Some experts can tell how an accident happened by looking at pictures.', 'How to Prove Fault in a Car Accident', 12, '', 'how-to-prove-fault-in-a-car-accident', '', 0, 0, '', 63),
(381, 'secondary', 'http://www.leginfo.ca.gov/.html/prob_table_of_contents.html', 18, '', 'California Probate Code', 11, '', 'california-probate-code', '', 0, 0, '', 49),
(382, 'secondary', 'http://www.morganlewis.com/index.cfm/publicationID/cbe4528b-487c-433b-87d6-0fea5e90b66e/fuseaction/publication.detail', 17, '', 'Independent Contractor Versus Employee FAQ', 13, '', 'independent-contractor-versus-employee-faq', '', 0, 0, '', 40),
(383, 'secondary', 'http://www.ca-employment-lawyers.com/California-Law-Independent-Contractors.htm', 17, '', 'Independent Contractors: Tax, Workers'' Compensation, and FEHA', 8, '', 'independent-contractors-tax-workers-compensation-and-feha', '', 0, 0, '', 32),
(384, 'secondary', 'http://www.edd.ca.gov/pdf_pub_ctr/de38.pdf', 17, '', 'Questionnaire on Employment Status', 12, '', 'questionnaire-on-employment-status', '', 0, 0, '', 37),
(385, 'primary', 'http://www.taxes.ca.gov/iCorE.bus.shtml', 17, '<p>Here are some factors that are taken into account to determine whether a worker is an employee or independent contractor. Control is given the most weight. However, none of the factors by itself determine a worker''s status and there is no formula. Instead the factors must be taken together.</p>\n1) whether an employer has the right to control the manner and means of obtaining the result desired.\n<br/>\n2) the right to discharge at will.\n<br/>\n3) whether the worker is engaged in a distinct occupation.\n<br/>\n4) whether the kind of occupation is done under supervision\n<br/> \n5) the skill required.\n<br/>\n6) who supplies the necessary equipment and place of work. \n<br/>\n7) investment by the worker.\n<br/> \n8) who decides the price.\n<br/> \n9) whether the work is part of the regular business of the employer.\n<br/> \n10) the degree of permanence of the working relationship.\n<br/>\n11) whether or not the parties believe they are creating an employer-employee relationship.\n', 'List of Factors for Determining Employment Status', 9, '', 'list-of-factors-for-determining-employment-status', '', 0, 0, '', 37),
(386, 'primary', 'http://www.leginfo.ca.gov/pub/11-12/bill/sen/sb_0451-0500/sb_459_bill_20111009_chaptered.pdf', 17, '<p>Employers prefer to hire independent contractors for a number of economic reasons. When paying an independent contractor, there are no wage withholding, workers'' compensation insurance, unemployment insurance, employment taxes, or liability for pensions and fringe benefits. Further, some non-discrimination rules are unenforceable with independent contractors. Overall, there are less taxes to pay and rules to follow. It is for these reasons that employers sometimes misclassify employees as independent contractors. A new law now imposes stiff penalties for willful misclassification.</p>\n<p><b>New Penalties</b></p> \n<b>Fines</b> - For each violation you might be fined $5000 to $15,000. \n<br/><br/>\n<b>Frequency</b> - The penalty goes up to $25,000 per violation if you misclassify employees frequently or if there is a "pattern" of misclasification. \n<br/><br/>\n<b>Liability</b> -  Consultants, such as HR outsourcing groups, may also be laible for misclassification.\n<p>In addition to these new penalties, there are existing penalties, including interest and back taxes owed to the government.</p>', 'Penalties for Willful Misclassification of Employees as Independent Contractors', 8, '', 'penalties-for-willful-misclassification-of-employees-as-independent-contractors', '', 0, 0, '', 44),
(388, 'secondary', 'http://www.leginfo.ca.gov/pub/11-12/bill/sen/sb_0451-0500/sb_459_bill_20111009_chaptered.pdf', 17, '', 'California Senate Bill: Penalty for Misclassification', 8, '', 'california-senate-bill-penalty-for-misclassification', '', 0, 0, '', 33),
(389, 'news', 'http://www.forbes.com/sites/robertwood/2011/12/07/californias-tough-new-independent-contractor-law/', 17, '', 'California''s Tough New Independent Contractor Law', 6, '', 'californias-tough-new-independent-contractor-law', '', 0, 0, '', 38),
(390, 'secondary', 'http://www.nolo.com/legal-encyclopedia/wills-faq-29041.html', 20, '', 'Wills FAQsdf', 7, '', 'wills-faqsdf', '', 0, 0, '', 1),
(391, 'secondary', 'http://www.leginfo.ca.gov/.html/prob_table_of_contents.html', 20, '', 'Califorina Probate Code', 12, '', 'califorina-probate-code', '', 0, 0, '', 2),
(392, 'secondary', 'http://www.uscis.gov/portal/site/uscis/menuitem.eb1d4c2a3e5b9ac89243c6a7543f6d1a/?vgnextoid=f2ef2f19470f7310VgnVCM100000082ca60aRCRD&vgnextchannel=f2ef2f19470f7310VgnVCM100000082ca60aRCRD', 19, 'The U.S. government can choose to deport illegal aliens or not. On June 15, 2012, the U.S. Department of Homeland Security announced that it would no longer deport certain undocumented youth for at least 2 years. This is called deferred action and was outlined in a memo from Janel Napolitano, the Secretary of Homeland Security. To be eligible, individuals must satisfy several conditions. If all conditions are satisfied, the individuals may apply for deferred action. Deferred action only last for 2 years, at which point the individual may apply for renewal. Individuals that receive deferred action may apply for employment authorization.   ', 'What is Deferred Action?', 14, '', 'what-is-deferred-action', '', 0, 0, '', 38),
(393, 'secondary', 'http://www.dhs.gov/xlibrary/assets/s1-exercising-prosecutorial-discretion-individuals-who-came-to-us-as-children.pdf', 19, '', 'Memo Outlining Deferred Action', 13, '', 'memo-outlining-deferred-action', '', 0, 0, '', 36),
(394, 'secondary', 'http://www.nilc.org/FAQdeferredactionyouth.html', 19, '', 'Deferred Action FAQ', 6, '', 'deferred-action-faq', '', 0, 0, '', 34),
(395, 'secondary', 'http://www.immigrationpolicy.org/just-facts/deferred-action-childhood-arrivals-qa-guide-updated', 19, '', 'Deferred Action Q&A Guide', 9, '', 'deferred-action-qa-guide', '', 0, 0, '', 37),
(396, 'secondary', 'http://www.statutes.legis.state.tx.us/Docs/PE/htm/PE.12.htm ', 24, '<p>Penalties for a Texas DWI are determined by a number of factors including prior convictions, minor passengers, BAC level, and injury. Prior convictions are determined by how many DUIs you had in the past 10 years. Here are some possible penalties.</p>\n<b>First offense</b>: 3 days to 6 months in jail, a fine up to $2000, and a license suspension between 90 days and 1 year.\n<br/><br/> \n<b>Second offense</b>: 30 days to 1 year in jail, a fine up to $4000, and a license suspension between 180 days and 2 years.\n<br/><br/> \n<b>Third or more offense</b>: This will probably be charged as felony DUI and a person may face 2 years of jail time, fines up to $10000, and a license suspension between 180 days and 2 years', 'Texas DUI Penalties ', 13, 'penalties, priors, refusal, bac, license ', 'texas-dui-penalties', '', 0, 0, 'Texas', 50),
(397, 'secondary', 'http://blog.austindefense.com/2006/09/articles/other-texas-statutes/driving-while-license-suspended-invalid-texas-transportation-code-section-521457/ ', 24, '<p>Driving without a valid driver''s license is a misdemeanor in Texas. You may face a fine between $100 to $500 and a jail sentence between 72 hours and 6 months.</p> ', 'Driving Without a License in Texas', 9, 'license, misdemeanor ', 'driving-without-a-license-in-texas', '', 0, 0, 'Texas', 19),
(399, 'secondary', 'http://law.onecle.com/texas/penal/49.045.00.html', 24, '<p>A DWI with a passenger under the age of 15 is a state jail felony in Texas. A state jail felony carries a sentence between 180 days and 2 years and a fine up to $10,000. Further, child endangerment may be charged as a separate offense from DWI. Child endangerment involves placing a child in a hazardous or inappropriate situation.</p>', 'Texas DUI with a Child Under 15 in the Car', 14, 'penalties, child passenger, felony ', 'texas-dui-with-a-child-under-15-in-the-car', '', 0, 0, 'Texas', 51),
(401, 'secondary', 'http://law.onecle.com/texas/penal/49.07.00.html ', 24, '<p>A DUI with injury may be charged as <b>Intoxication Assault</b>,  which is a third degree felony for the first conviction. The injury must be serious, meaning that it creates a substantial risk of death, or causes serious permanent disfigurement or loss of the function of a body part or organ.</p>\n<p>For the first offense, you may receive 2 to 10 years of jail time and a fine up to $10,000.</p>\n<p>A DWI where someone was killed may be charged as <b>Intoxication Manslaughter</b>, which is a second degree felony. A person convicted of a second degree felony may face 2 to 20 years in jail and a fine up to $10,000.</p>', 'Texas DUI Accidents and Injury ', 11, 'injury, felony, penalties ', 'texas-dui-accidents-and-injury', '', 0, 0, 'Texas', 17),
(538, 'primary', 'http://law.onecle.com/california/labor/3208.3.html', 42, '<p>In general, psychiatric injuries, such as emotional distress, are eligible for workers’ compensation.</p>\n<p><b>Threshold</b> - The injury must be a mental disorder that causes disability or the need for medical treatment. If you can function normally with your emotional distress or psychiatric injury, then you probably can’t recover. The disorder must also be diagnosed in accordance to psychiatric manuals (DSM-IV is the latest one), such as depression, anxiety, ADHD, or bipolar disorder. Although prior events may have contributed to your disorder, you have to show that your job is the main cause of the disorder (more than 50%). However, if the injury was a result of a violent act, such as a bank robbery, then you only need to show that it contributed by 35% to your injury. This is because violent acts are expected to cause emotional distress and trauma.</p>\n<p><b>Time Restrictions</b> – You must have been employed for at least 6 months in order to get workers’ compensation for emotional distress. The 6 months do not have to be continuous. However, the 6-month rule does not apply if the injury was caused by a sudden and extraordinary employment condition, such as sudden surgery.</p>\n<p><b>Claim</b> – If you no longer work for you employer and you want to make a claim, you need to show one of the following: the injury was caused by sudden and extraordinary events of your employment, you gave notice of the injury to your employer before leaving, or you were sexually or racially harassed. If you satisfy none of these, there are still some exceptions. It’s best to speak with a lawyer to learn more.</p>', 'Workers'' Compensation for Emotional Distress', 7, '', 'workers-compensation-for-emotional-distress', '', 0, 0, '', 23),
(405, 'secondary', 'http://www.timpowers.com/dentonCriminalDefense/2011/dwi-denton-county-refusal-of-the-portable-breath-test.html ', 24, '<p>The preliminary breath test (PBT) is a handheld breathalyzer administered in the field to help an officer decided whether or not you are intoxicated. It is not approved by Texas Department of Public Safety for use and its results cannot be used in court. Moreover, the vast majority of the scientific community has recognized PBTs as being inaccurate or unreliable devices. You are not obligated to take a PBT and refusing will not result in a penalty.</p>\n<p>The PBT is similar to field sobriety tests and is used to gather evidence and help the officer decided whether or not to arrest you. A high BAC reading can be used as evidence against you, but a low reading doesn''t really help you. Since you''re not required to take the test anyways, it''s probably a good idea to refuse.</p>', 'Do you Have to Take the Handheld Breathalyzer in Texas?', 13, 'evidence, breath test, refusal ]', 'do-you-have-to-take-the-handheld-breathalyzer-in-texas', '', 0, 0, 'Texas', 87),
(407, 'secondary', 'http://law.onecle.com/texas/transportation/724.035.00.html', 24, '<p>Texas implied consent laws require that you take a chemical test, either blood or breath, if you are arrested for drunk driving. If you refuse, your license will be suspended. Generally you cannot be forced to take a chemical test, but there are certain exceptions. The length of a license suspension for refusing depends on the number of prior DUI convictions you have.</p>\n<b>First offense</b> – 180 day license suspension<br/><b>Second offense</b> – 2 year license suspension<br/><b>Third offense</b> – 2 year license suspension', 'What Happens if You Refuse the Breathalyzer in Texas ', 10, 'penalties, refusal, breath test, blood test, implied consent ', 'what-happens-if-you-refuse-the-breathalyzer-in-texas', '', 4, 0, 'Texas', 62),
(408, 'secondary', 'http://law.onecle.com/texas/transportation/724.011.00.html ', 24, '<p>If you are arrested for a drunk driving offense, you are required by law to take a blood or breath test. Just by driving you have given your consent to these chemical tests. This is under Texas implied consent laws.</p>', 'Texas Implied Consent Laws', 6, 'breath test, blood test, implied consent ', 'texas-implied-consent-laws', '', 0, 0, 'Texas', 19),
(410, 'secondary', 'http://www.statutes.legis.state.tx.us/Docs/PE/htm/PE.49.htm', 24, '<p>A first DWI  may be charged as a Class A Misdemeanor (up to 1 year in jail and $4000 fine) if the person driving had a blood alcohol concentration (BAC) of 0.15% or higher at the time the chemical test is performed. This new DWI law was added by House Bill 1199, which amended Penal Code Section 49.04 by adding a section. Essentially this means that on a person’s very first offense (with no other criminal history) he or she can be looking at a year in jail.</p>', 'Was your BAC 0.15% or Higher in Texas?', 5, 'penalties, bac, misdemeanor', 'was-your-bac-015-or-higher-in-texas', '', 0, 0, 'Texas', 29),
(411, 'secondary', 'http://dwi.austindefense.com/2006/10/articles/texas-dwi-laws/alr-hearing-request-texas-transportation-code-section-524031/ ', 24, '<p>You have 15 days from the date of your arrest to send a request for a hearing to the Texas Department of Public Safety. At this hearing you can challenge your license suspension. Your criminal DUI case is be handled separately by the local court system. It''s important to be aware that these are two separate proceedings.</p>', '15 Day Deadline to Request a DMV Hearing in Texas', 11, 'dmv, license ', '15-day-deadline-to-request-a-dmv-hearing-in-texas', '', 0, 0, 'Texas', 51),
(413, 'secondary', 'http://law.onecle.com/texas/alcoholic/106.041.00.html', 24, '<p>Drivers under the age of 21 may be convicted of DUI even though they do not meet the legal standard for DWI. Any detectable amount of alcohol may be sufficient to charge DUI, since it is illegal for someone under 21 to be drinking in the first place. This means if you are under 21, even one beer can land you a DUI. Furthermore, you cannot refuse to submit to a chemical test. Here are some possible penalties.</p>\n<b>First DUI offense</b> -  a fine up to $500, community service for 20 to 40 hours, a 60 day license suspension, and mandatory attendance in alcohol-awareness classes. \n<p>If the person''s BAC is .08%, then a regular DWI may be charged.</p>', 'Under 21 Texas DUI/DWI', 5, 'under 21, penalties ', 'under-21-texas-duidwi', '', 4, 0, 'Texas', 41),
(414, 'secondary', 'http://www.texascriminalattorneyblog.com/intoxication_offenses/dui/dwi_vs_duiwhat_is_the_differen/ ', 24, '<p>The main difference between a DUI and DWI in Texas is that a DUI is only available to someone under the age of 21. A person under 21 will be charged with a DUI if he or she has a BAC under 0.08%. Otherwise that person will be charged with a DWI and face the same consequences as an adult. A DWI imposes a harsher sentence than a DUI. However, it is easier to be convicted of a DUI because all that is necessary is that the officer detected some amount of alcohol.</p>', 'What''s the Difference Between a Texas DUI and DWI', 8, 'under 21, penalties', 'whats-the-difference-between-a-texas-dui-and-dwi', '', 0, 0, 'Texas', 40),
(415, 'secondary', 'http://www.statutes.legis.state.tx.us/Docs/PE/htm/PE.49.htm ', 24, '<p>In Texas, a DUI may be charged as a class B misdemeanor if an open container of alcohol was found in the car. You may face 6 to 180 days in jail and a fine up to $2000 for a first conviction.</p>', 'Did you Have an Open Container in the Car?', 15, 'penalties, open container, misdemeanor', 'did-you-have-an-open-container-in-the-car', '', 0, 0, 'Texas', 31),
(416, 'secondary', 'http://leg.state.fl.us/Statutes/index.cfm?App_mode=Display_Statute&Search_String=&URL=0300-0399/0316/Sections/0316.193.html', 25, '<p>In Florida, a DUI with a passenger under 18 or a BAC of .15% or higher will result in enhanced penalties. Here are some possible penalties depending on the number of past convictions you have.</p>\n<b>First offense</b> - up to 9 months in jail, a fine between $1000 and $2000, and a license suspension between 180 days to 1 year.\n<br/><br/> \n<b>Second offense</b> -  up to 12 months in jail, a fine between $2000 and $4000, and a license suspension of at least 5 years (if last DUi was within 5 years).\n<br/><br/>\n<b>Third offense</b> -  between 30 days and 1 year of jail, a fine of at least $4000, and a license suspension of at least 10 years.\n<br/><br/>\n<b>Fourth offense or more</b> -  up to 5 years of jail, a fine of at least $2000, and permanent license revocation.', 'Florida DUI Penalties for Passenger Under 18 or BAC of .15% or Higher', 8, 'penalties, priors, refusal, bac, license', 'florida-dui-penalties-for-passenger-under-18-or-bac-of-15-or-higher', '', 0, 0, 'Florida', 43),
(417, 'secondary', 'http://www.flhsmv.gov/ddl/duilaws.html ', 25, '<p>In Florida, DUI penalties are primarily dependent on the number of prior DUI convictions, if there was a passenger under 18, and BAC level. A prior conviction is one that occurred in the last 10 years. Here are some possible penalties if you didn''t have a passenger under 18 and your BAC was below .15%.</p>\n<b>First offense</b> - up to 6 months in jail, a fine between $500 and $1000, and a license suspension between 180 days to 1 year.\n<br/><br/> \n<b>Second offense</b> -  up to 9 months in jail, a fine between $1000 and $2000, and a license suspension of at least 5 years (if last DUi was within 5 years).\n<br/><br/>\n<b>Third offense</b> -  between 30 days and 1 year of jail, a fine between $2000 and $5000, and a license suspension of at least 10 years.\n<br/><br/>\n<b>Fourth offense or more</b> -  up to 5 years of jail, a fine of at least $2000, and permanent license revocation.\n\n<p>A DUI charge is usually a misdemeanor, but may become a felony if someone was seriously injured or if it is the person''s third DUI in the past 10 years.</p>', 'Typical Florida DUI Penalties', 12, 'penalties, priors, refusal, license, bac ', 'typical-florida-dui-penalties', '', 0, 0, 'Florida', 44),
(421, 'secondary', 'http://clearwaterattorneyduilawer.com/guy-state-florida-993-so2d-77-2008 ', 25, 'The Second Court of Appeals for Florida found that police must follow strict guidelines when they set up a DUI checkpoint. They must also follow those guidelines closely.', 'Florida Police Must Follow Rules at Checkpoints ', 8, 'checkpoints, constitution', 'florida-police-must-follow-rules-at-checkpoints', '', 0, 0, 'Florida', 33),
(422, 'secondary', 'http://law.onecle.com/florida/crimes/775.082.html', 25, 'Jail time for felonies and misdemeanors.\n<br/><br/>\nFELONY\n<br/><br/>\n(b)  For a felony of the first degree, by a term of imprisonment not exceeding 30 years or, when specifically provided by statute, by imprisonment for a term of years not exceeding life imprisonment.\n<br/>\n(c)  For a felony of the second degree, by a term of imprisonment not exceeding 15 years.\n<br/>\n(d)  For a felony of the third degree, by a term of imprisonment not exceeding 5 years.\n<br/><br/>\nMISDEMEANOR\n<br/><br/>\n(a)  For a misdemeanor of the first degree, by a definite term of imprisonment not exceeding 1 year;\n<br/>\n(b)  For a misdemeanor of the second degree, by a definite term of imprisonment not exceeding 60 days.', 'Florida Schedule of Jail Time', 14, 'penalties, felony, misdemeanor ', 'florida-schedule-of-jail-time', '', 0, 0, 'Florida', 33),
(423, 'secondary', 'http://law.onecle.com/florida/crimes/775.083.html ', 25, 'Fines for felonies and misdemeanors.\n<br/><br/>\n(a)  $15,000, when the conviction is of a life felony.\n<br/>\n(b)  $10,000, when the conviction is of a felony of the first or second degree.\n<br/>\n(c)  $5,000, when the conviction is of a felony of the third degree.\n<br/>\n(d)  $1,000, when the conviction is of a misdemeanor of the first degree.\n<br/>\n(e)  $500, when the conviction is of a misdemeanor of the second degree or a noncriminal violation.\n', 'Florida Schedule of Fines', 10, 'penalties, felony, misdemeanor  ', 'florida-schedule-of-fines', '', 0, 0, 'Florida', 32),
(540, 'primary', 'http://law.justia.com/cases/california/calapp2d/124/608.html', 42, '<p>Generally, if you are traveling to or from work and are injured, you cannot get workers’ compensation. However, there are some exceptions to the rule. For example, if you got into a car accident while driving to work, you probably cannot get workers’ compensation because the injury was not in “the course of your employment.”</p>\n<p><b>Paid</b> – If you are paid for the time you take while traveling to and from work, you can most likely recover compensation.</p>\n<p><b>Errand</b> – If you are on your way completing an errand for your employer, you can probably recover, as long as you were injured while primarily doing the errand. If you were hurt while doing something personal while running the errand, it will depend on how much you were distracted. </p>\n<p><b>Employer’s premises</b> – If you were injured while on premises controlled by your employer, such your employer’s parking lot, you may be able to recover. Also, if you were injured outside of your employer’s office while waiting for it to open, you might be able to get workers’ compensation.</p>', 'Workers’ Compensation Hurt While Traveling to and from Work', 12, '', 'workers-compensation-hurt-while-traveling-to-and-from-work', '', 0, 0, '', 21),
(425, 'secondary', 'http://www.flsenate.gov/laws/statutes/2011/316.1933', 25, '<p>A DUI with injury is a misdemeanor of the first degree, which carries a possible jail sentence up to 1 year and a fine up to $1000.</p>\n<p>A DUI with serious bodily injury is a felony of the third degree, which carries a possible jail sentence up to 5 years and a fine up to $5000. Serious bodily injury include substantial risk of death, serious personal disfigurement, or loss or impairment of bodily functions.</p> ', 'Florida DUI Accident Causing Injury', 12, 'injury, felony, penalties, misdemeanor ', 'florida-dui-accident-causing-injury', '', 0, 0, 'Florida', 67),
(426, 'secondary', 'http://www.duiattorneystampabay.com/DUI/DUI_Testing/Roadside_Breath_Testing.aspx ', 25, '<p>In Florida, you most likely have the right to refuse a handheld breath test, provided you are over the age of 21 and are not currently on probation for a previous DUI conviction.</p>', 'Do you Have to Take the Handheld Breathalyzer? ', 5, 'evidence, breath test, refusal ', 'do-you-have-to-take-the-handheld-breathalyzer', '', 0, 0, 'Florida', 19),
(428, 'secondary', 'http://law.onecle.com/florida/motor-vehicles/316.1932.html', 25, '<p>You are required by law to take a chemical test (blood or breath) if you are arrested for drunk driving. This is because implied consent laws demand that you submit to testing or face the consequences. Just by driving you have given your consent.</p>\n<p>If you refuse a second time, you can be charged with a separate misdemeanor of the first degree. A misdemeanor of the first degree carries up to 1 year of jail time and a fine up to $1000. Furthermore your license will be suspended.</p>\n<b>First refusal</b> - 1 year license suspension.\n<br/>\n<b>Second or more refusal </b> - 18 month license suspension.', 'What Happens if You Refuse the Breathalyzer in Florida', 15, 'penalties, refusal, breath test, misdemeanor, implied consent ', 'what-happens-if-you-refuse-the-breathalyzer-in-florida', '', 0, 0, 'Florida', 32),
(539, 'primary', 'http://scocal.stanford.edu/opinion/state-comp-ins-fund-v-industrial-acc-com-29523', 42, '<p>If you were injured during a fight at work, you may be able to recover workers’ compensation in certain situations.</p>\n<p><b>You weren’t fighting</b> – If some of your co-workers were fighting and you were injured as a bystander, you can probably get compensation if the fight was about work. However, if the fight was about something personal between the co-workers, you cannot recover. For example, if you were injured trying to break up a fight that was about someone’s obnoxious typing, you can probably get workers’ compensation for those injuries.</p>\n<p><b>You were fighting</b> – If you were fighting, you might be able to recover as long as you are not the person that starts the fight. Usually the person that starts the fights is the one who throws the first blows of makes a physical move.</p>\n<p><b>Squabble with employer</b> – If you were hurt by your employer, you will most likely be able to recover compensation for any injuries you received. The only exceptions are when you started the fight or the fight was not work related (started because of something personal).</p>', 'Workers’ Compensation Hurt from Fight at Work', 5, '', 'workers-compensation-hurt-from-fight-at-work', '', 0, 0, '', 20),
(431, 'secondary', 'http://law.onecle.com/florida/motor-vehicles/322.2615.html', 25, '<p>You have 10 days from the date of your arrest to send a request for a DMV Administrative Review hearing to can challenge a possible license suspension. You must make the request in writing.</p>', '10 Days from Arrest to Request a DMV Hearing in Florida', 8, 'dmv, license', '10-days-from-arrest-to-request-a-dmv-hearing-in-florida', '', 0, 0, 'Florida', 19),
(541, 'secondary', '', 9, 'There are three general categories of child custody arrangements: sole custody, joint custody, and nonparent custody.\n<p><b>Sole custody</b> - There are three different variations of sole custody orders.</p> \n<b>exclusive custody</b> - gives one parent primary physical control of the child, with the right to make decisions regarding the child’s residence, health, education, and welfare.  The non-custodial parent has secondary visitation rights as decided by the court.  \n<br/><b>Sole physical custody</b> - the child lives with and is supervised by the custodial parent; however, the distinction here is that the custodial parent does not have sole decision-making power regarding other matters affecting the child.  \n<br/><b>sole legal custody</b> - a parent may be granted the exclusive right to make decisions relating to the child’s health, education, and welfare, but not the right of sole control over the child’s residence and supervision.<br/>\n<p><b>Joint custody</b> - there are also different types of joint custody orders.</p> \n<b>pure joint custody</b> - neither parent has sole physical or legal custody; both have the right to control and supervise the child. \n<br/><b>joint legal custody</b> - both parents share the responsibility of making decisions regarding the child’s health, education, and welfare.  \n<br/><b>joint physical custody</b> - assures that the child has frequent and continued contact with both parents, awarding each parent significant periods of physical custody.<br/>\n<p>In <b>nonparent custody</b>, custody may be granted to a nonparent (who will have exclusive responsibility for the child’s care)</p>\n', 'Different Types of Child Custody', 13, '', 'different-types-of-child-custody', '', 0, 0, '', 33),
(434, 'secondary', 'http://law.onecle.com/florida/motor-vehicles/322.2616.html', 25, '<p>Florida has a "zero tolerance" policy when it comes to underage drinking and driving. A person under the age of 21 driving with a BAC level at or above 0.02% (basically any amount of alcohol) will face an administrative suspension for 180 days for the first conviction. If the person''s BAC is 0.08% of higher he or she may be charged with a regular DUI and face criminal penalties similar to what an adult would face.</p>', 'Under 21 Florida DUI', 7, 'under 21, penalties ', 'under-21-florida-dui', '', 4, 0, 'Florida', 35),
(435, 'secondary', 'http://www.thedensonfirm.com/when-is-a-dui-a-felony.html ', 25, '<p>A DUI may be charged as a felony when:</p>\n-there is serious bodily injury caused by an accident\n<br/>\n-it is your third DUI in the past 10 years or\n<br/>\n-it is your fourth DUI ever.', 'When Your Florida DUI Becomes a Felony', 5, 'penalties, felony, priors, injury ', 'when-your-florida-dui-becomes-a-felony', '', 0, 0, 'Florida', 34),
(437, 'secondary', 'http://www.dmv.state.pa.us/legislation/dui.shtml ', 26, 'A DUI is typically a misdemeanor offense, unless someone was seriously injured or killed, at which point it may be charged as a felony. Penalties are heavily dependent on BAC level and number of priors conviction within the last 10 years. Here are some possible penalties.\n\n<p><b>First Offense</b></p>\nBAC 0.08 to 0.099<br/>\nup to 6 months probation<br/>\n$300 fine<br/><br/>\nBAC .10 to .159%<br/>\n12 month license suspension<br/>\n48 hours to 6 months prison<br/>\n$500 to $5,000 fine<br/><br/>\nBAC .16% and higher<br/>\n12 month license suspension<br/>\n72 hours to 6 months prison<br/>\n$1,000 to $5,000 fine\n\n<p><b>Second Offense</b></p>\nBAC 0.08 to 0.099<br/>\n12 month license suspension<br/>\n5 days to 6 months jail time<br/>\n$300 to $2,500 fine<br/>\n1 year ignition interlock<br/><br/>\nBAC .10 to .159%<br/>\n12 month suspension<br/>\n30 days to 6 months prison<br/>\n$750 to $5,000 fine<br/>\n1 year ignition interlock<br/><br/>\nBAC .16% and higher<br/>\n18 month license suspension<br/>\n90 days to 5 years prison<br/>\n$1,500 to $10,00 fine<br/>\n1 year ignition interlock\n\n<p><b>Third Offense</b></p>\nBAC 0.08 to 0.099<br/>\n12 month license suspension<br/>\n10 days to 2 years prison<br/>\n$500 to $5,000 fine<br/>\n1 year ignition interlock<br/><br/>\nBAC .10 to .159%<br/>\n18 month license suspension<br/>\n90 days to 5 years prison<br/>\n$1,500 to $10,000 fine<br/>\n1 year ignition interlock<br/><br/>\nBAC .16% and higher<br/>\n18 month license suspension<br/>\n1 to 5 years prison<br/>\n$2,500 to $10,000<br/>\n1 year ignition interlock', 'Pennsylvania DUI Penalties', 11, 'penalties, bac, license, priors ', 'pennsylvania-dui-penalties', '', 0, 0, 'Pennsylvania', 42),
(439, 'secondary', 'http://law.onecle.com/pennsylvania/vehicles/00.015.043.000.html ', 26, 'If you were driving with a suspended or revoked license due to a prior DUI, you may face a jail sentence of 90 days or more and a fine of $1000 for the first violation.', 'Were you Driving with a Suspended License? ', 5, 'penalties, license ', 'were-you-driving-with-a-suspended-license', '', 0, 0, 'Pennsylvania', 31),
(440, 'secondary', 'http://mvwlaw.com/blog/category/dui/dui-with-a-child-in-the-vehicle/ ', 26, '<p>You may face an additional misdemeanor charge for a DUI with a passenger under the age of 18. This is a new law that was recently passed in Pennsylvania. You will probably have to pay a fine, receive community service, and possibly have to serve jail time.</p>', 'Pennsylvania DUI With Child Under 18', 7, 'penalties, child passenger ', 'pennsylvania-dui-with-child-under-18', '', 0, 0, 'Pennsylvania', 35),
(442, 'secondary', 'http://law.onecle.com/pennsylvania/vehicles/00.038.004.000.html', 26, 'A Pennsylvania DUI accident with injury, serious bodily injury or death of any person or damage to a vehicle or other property can result in harsher penalties than a normal DUI. Here are the potential penalties.\n<p><b>First Offense</b></p>\n12 month license suspension<br/>\n48 hours to 6 months prison<br/>\n$500 to $5,000 fine<br/><br/>\n<p><b>Second Offense</b></p>\n12 month suspension<br/>\n30 days to 6 months prison<br/>\n$750 to $5,000 fine<br/>\n1 year ignition interlock<br/><br/>\n<p><b>Third Offense</b></p>\n18 month license suspension<br/>\n90 days to 5 years prison<br/>\n$1,500 to $10,000 fine<br/>\n1 year ignition interlock\n', 'Pennsylvania DUI With Accident and Injury', 5, 'penalties, injury ', 'pennsylvania-dui-with-accident-and-injury', '', 4, 0, 'Pennsylvania', 22),
(444, 'secondary', 'http://www.pennduidefense.com/lawyer-attorney-1633471.html ', 26, '<p>In Pennsylvania, you most likely not obligated to take a preliminary breath test (PBT) and will not lose your license if you refuse. PBT results are not allowed to be used in trial and are only used to help an officer determine whether or not there is probable cause to make a DUI arrest. It is similar to a field sobriety test and helps the officer gather evidence. For these reasons, it may be in your best interest to refusal the PBT.</p>', 'Do You Have to Take the Handheld Breathalyzer in Pennsylvania? ', 13, 'evidence, breath test, refusal ', 'do-you-have-to-take-the-handheld-breathalyzer-in-pennsylvania', '', 0, 0, 'Pennsylvania', 17),
(445, 'secondary', 'http://caselaw.findlaw.com/pa-superior-court/1426314.html ', 26, 'The result of the preliminary breath test (PBT) cannot be used in court. This was the holding in COMMONWEALTH v. MARSHALL.', 'Case Finding That Handheld Breathalyzer Result Can''t be Used in Court', 11, 'evidence, breath test, refusal', 'case-finding-that-handheld-breathalyzer-result-cant-be-used-in-court', '', 0, 0, 'Pennsylvania', 34),
(446, 'secondary', 'http://www.dmv.state.pa.us/legislation/dui.shtml', 26, '<p>If you refuse to take the breathalyzer, you will automatically  be charged face penalties as if your BAC was .16% or higher. This is the harshest tier of penalties you can receive. Here are the possibilities.</p>\n\n<p><b>First Offense</b></p>\n12 month license suspension<br/>\n72 hours to 6 months prison<br/>\n$1,000 to $5,000 fine\n\n<p><b>Second Offense</b></p>\n18 month license suspension<br/>\n90 days to 5 years prison<br/>\n$1,500 to $10,00 fine<br/>\n1 year ignition interlock\n\n<p><b>Third Offense</b></p>\n18 month license suspension<br/>\n1 to 5 years prison<br/>\n$2,500 to $10,000<br/>\n1 year ignition interlock', 'Refusing the Breath Test in Pennsylvania', 14, 'penalties, refusal, breath test, license, implied consent', 'refusing-the-breath-test-in-pennsylvania', '', 0, 0, 'Pennsylvania', 54),
(447, 'secondary', 'http://law.onecle.com/pennsylvania/vehicles/00.015.047.000.html', 26, '<p>If you are arrested for a drunk driving offense in Pennsylvania, you are required by law to take a blood or breath test. Just by driving you have given your consent. This is codified in Pennsylvania''s implied consent laws. For the first refusal your license may be suspended for 1 year and you can face up to 180 days in jail.</p>', 'Why Do you Have to Take the Breath Test?', 8, 'penalties, refusal, breath test, license, implied consent ', 'why-do-you-have-to-take-the-breath-test', '', 0, 0, 'Pennsylvania', 35),
(451, 'secondary', 'http://www.statecollegelawyers.com/Criminal-Defense-Overview/DUI-and-DAI/DUI-Related-License-Suspension.shtml', 26, '<p>You may face two different license suspensions for a Pennsylvania DUI. First is the criminal suspension in your DUI case. This is also the case where you guilt, and potential fines and jail time is assessed.</p>\n<p>At the same time, you will be facing an administrative suspension by the Pennsylvania Department of Transportation or PennDot. You have 30 days from the date of arrest to request an administrative hearing in order to fight this possible license suspension. It''s important to be aware that your administrative case is different from the criminal DUI case.</p>', 'You Have 30 Days to Request a DMV Hearing in Pennslyvania', 13, 'dmv, license ', 'you-have-30-days-to-request-a-dmv-hearing-in-pennslyvania', '', 0, 0, 'Pennsylvania', 40),
(453, 'secondary', 'http://law.onecle.com/pennsylvania/vehicles/00.038.004.000.html ', 26, 'Pennsylvania has a zero tolerance policy towards underage drinking and driving. A person under the age of 21 driving with a BAC level at or above 0.02% (essentially any amount of alcohol) may face greater penalties than what an adult would face. Here are some possibilities.\n<p><b>First Offense</b></p>\n12 month license suspension<br/>\n48 hours to 6 months prison<br/>\n$500 to $5,000 fine<br/><br/>\n<p><b>Second Offense</b></p>\n12 month suspension<br/>\n30 days to 6 months prison<br/>\n$750 to $5,000 fine<br/>\n1 year ignition interlock<br/><br/>\n<p><b>Third Offense</b></p>\n18 month license suspension<br/>\n90 days to 5 years prison<br/>\n$1,500 to $10,000 fine<br/>\n1 year ignition interlock', 'Penalties for Under 21 Pennslyvania DUI', 12, 'penalties, under 21 ', 'penalties-for-under-21-pennslyvania-dui', '', 0, 0, 'Pennsylvania', 39),
(543, 'secondary', 'http://www.shouselaw.com/article-suspended-license.html', 4, 'Driving with a suspended or revoked license is a misdemeanor and jail time or fines may be imposed. Driving without a valid license in California is a misdemeanor and a fine may be imposed. In California, a person must have a valid license to drive. ', 'Driving on a Suspended or Revoked License', 5, 'penalties, license, misdemeanor', 'driving-on-a-suspended-or-revoked-license', '', 0, 0, 'California', 15),
(457, 'secondary', 'http://www.azleg.state.az.us/ars/28/01381.htm', 27, 'Arizona DUI penalties are different depending on how many prior DUI convictions you got in the past 7 years and your BAC level. If you were arrested with a BAC of 0.15% or higher, you may be charged with an Extreme DUI. An Extreme DUI carries harsher penalties than regular DUIs. Here are some possible penalties.\n\n<p><b>First Offense</b></p>\nBAC under .15%<br/>\nup to 10 days jail<br/>\n$1,460.00 in fines<br/>\nLicense suspension for up to 90 days<br/>\nProbation for 12-24 months<br/>\nInterlock device for 12 months<br/><br/>\n\nBAC of .15% or higher<br/>\nup to 30 days jail<br/>\n$2,710.00 in fines<br/>\nLicense suspension for 90 days<br/>\nProbation for 24 months<br/>\nInterlock device for 12 months\n \n<p><b>Second Offense</b></p>\nBAC under .15%<br/>\nup to 90 days jail<br/>\n$3,420.00 in fines<br/>\nProbation for at least 24 months<br/> \n1 year revocation of driver’s license<br/>\nInterlock device for 12 months after revocation<br/><br/>\n\nBAC of .15% or higher<br/>\nup to 120 days jail<br/>\n$5,250.00 in fines<br/>\nProbation for at least 24 months <br/>\n1 year revocation of driver’s license<br/>\nInterlock device for 12 months after revocation', 'Arizona DUI Penalties', 15, 'penalties, priors, bac, misdemeanor', 'arizona-dui-penalties', '', 0, 0, 'Arizona', 37),
(459, 'secondary', 'http://www.azleg.gov/FormatDocument.asp?inDoc=/ars/28/01383.htm&Title=28&DocType=ARS', 27, '<p>Driving with a passenger under the age of 15 is considered a Class 6 Felony in Arizona. If convicted with no other prior DUI convictions, jail time can span from 1 day to 2 years. Fines start at $4,600. Prosecutors may also choose to file child endangerment charges. The presence of prior DUI convictions will increase your penalties.</p>', 'DUI with Child Under 15 in Arizona', 12, 'penalties, child passenger, felony ', 'dui-with-child-under-15-in-arizona', '', 0, 0, 'Arizona', 19),
(461, 'secondary', 'http://www.russlawaz.com/arizona-aggravated-dui-suspended-license.htm ', 27, '<p>Driving with a suspended or revoked license due to a past Arizona DUI is a class 4 felony. If there are prior felonies, a class 4 felony carries a jail sentence between 4 months and 3 years 9 months, a fine up to $4600, and a license suspension of 3 years.</p> ', 'Driving Without a License Due to Past DUI ', 11, 'penalties, license, felony ', 'driving-without-a-license-due-to-past-dui', '', 0, 0, 'Arizona', 33),
(463, 'secondary', 'http://www.azleg.state.az.us/ars/28/01321.htm', 27, 'Arizona implied consent laws require that you take a chemical test, either blood or breath, if you are arrested for drunk driving. If you refuse you may face an automatic license suspension. Here are some possible penalties. \n<p><b>First offense</b> - 1 year license suspension</p>\n<p><b>Second offense</b> - 2 year license suspension</p>\n<p><b>Third offense</b> - 2 year license suspension</p>', 'What Happens if You Refuse the Breath Test in Arizona', 5, 'penalties, license, refusal, breath test, implied consent ', 'what-happens-if-you-refuse-the-breath-test-in-arizona', '', 0, 0, 'Arizona', 21),
(464, 'secondary', 'http://www.phoenixduilawyerblog.com/arizona-dui-topics/arizona-dui-testing ', 27, '<p>In Arizona, you can refuse the handheld breathalyzer (PBT - Portable Breathalyzer Test) if you are pulled over and suspected of a DUI. You will not be penalized because it is not mandatory. The PBT can only be used as evidence to make an arrest for DUI and is similar to a field sobriety test. Further,the reading cannot be used in court to show that you are guilty of a DUI.</p>', 'Do You Have to Take the Roadside Breathalyzer in Arizona? ', 15, 'refusal, breath test, evidence ', 'do-you-have-to-take-the-roadside-breathalyzer-in-arizona', '', 0, 0, 'Arizona', 18),
(465, 'secondary', 'http://www.phillipslaw.com/arizona-dui-checkpoints-and-your-rights ', 27, 'Checkpoints are constitutional in Arizona. However to set them up, police must follow detailed guidelines and procedures. For example, some rules are about the selection of vehicles, detention techniques, duty assignments, and the disposition of vehicles. If police do not follow these guidelines, it is a violation of the Fourth Amendment''s protection against unreasonable seizures and searches and your stop may be illegal. This means that the evidence in your case may be inadmissible. ', 'Checkpoints in Arizona are Constitutional', 11, 'checkpoints, constitution ', 'checkpoints-in-arizona-are-constitutional', '', 0, 0, 'Arizona', 37),
(466, 'secondary', 'http://www.azleg.gov/FormatDocument.asp?inDoc=/ars/28/01383.htm&Title=28&DocType=ARS ', 27, '<p>If someone was injured in a accident caused by DUI, the offense is considered an "Aggravated DUI." This is a Class 4 Felony and can result in 1.5 to 3 years in prison and fines of up to $150,000. The number of past DUI offenses and severity of injury are factors used in determining the penalties.</p>\n<p>If someone was killed due to the accident, you may be convicted of vehicular manslaughter (DUI with death) and could face 7 to 21 years in prison.</p>', 'Arizona DUI with Accident Causing Injury ', 8, 'penalties, injury, felony ', 'arizona-dui-with-accident-causing-injury', '', 0, 0, 'Arizona', 20),
(468, 'secondary', 'http://www.azleg.state.az.us/FormatDocument.asp?inDoc=/ars/28/01385.htm&Title=28&DocType=ARS', 27, '<p>You have 15 days from the date of arrest of your Arizona DUI to request a DMV hearing in order to fight a possible license suspension. If you don''t request a hearing, you will be unable to challenge your license suspension, regardless of whether you are found innocent or guilty for the DUI. The license suspension case is different from the criminal DUI case.</p>', '15 Days to Request a DMV Hearing in Arizona', 12, 'dmv, license ', '15-days-to-request-a-dmv-hearing-in-arizona', '', 0, 0, 'Arizona', 21),
(471, 'secondary', 'http://www.azleg.state.az.us/FormatDocument.asp?inDoc=/ars/28/03322.htm&Title=28&DocType=ARS ', 27, '<p>It is illegal for a person under the age of 21 to drink and drive. Individuals convicted of a DUI while under 21 face an additional 2 year license suspension.</p>', '2 Year License Suspension for Underage DUI in Arizona ', 15, 'penalties, license, under 21 ', '2-year-license-suspension-for-underage-dui-in-arizona', '', 0, 0, 'Arizona', 36),
(474, 'secondary', 'http://www.nolo.com/legal-encyclopedia/executor-faq-29126.html', 18, '<p>An executor is a person who makes sure your property gets split up the way you want it to. This person also has a “fiduciary duty”—the duty to act with scrupulous good faith and honesty on behalf of someone else. Some of the specific duties of an executor include finding the deceased person’s assets and managing them until they are distributed to the rightful heirs, filing the will in the local probate court, setting up an estate bank account, and using estate funds to pay continuing expenses (e.g. mortgage payments). You can choose an executor in your will. If you have no will and suffer a fatal accident, then the court system will decide who takes over your property and charge you for it.</p>', 'What is an Executor?', 11, '', 'what-is-an-executor', '', 0, 0, '', 57),
(475, 'secondary', 'http://ezinearticles.com/?What-is-a-Will-and-Why-Do-We-Need-One?&id=54691', 18, '<p>A will is a legal document that contains instructions on how your property should be split up after you die. You can also name guardians in your will for any dependent children you have under the age of 18. The court doesn''t have to necessarily follow the instructions in your will, but they usually do. You can also name an executor in your will to make sure everything goes as planned. If you die without a will, the government will decide how your property gets split and name guardians for any dependent children.</p> ', 'What is a Will?', 10, '', 'what-is-a-will', '', 0, 0, '', 54);
INSERT INTO `links` (`id`, `type`, `url`, `category`, `summary`, `title`, `votes`, `tags`, `slug`, `source`, `poster`, `date_created`, `location`, `views`) VALUES
(476, 'secondary', 'http://rhol.org/rental/WEAR.HTM', 23, '<p>Landlords can use security deposits to repair damages caused by tenants; however, they cannot use the security deposit to repair normal wear and tear. Normal wear and tear includes deterioration of the premises that occurs during normal living conditions. These are things that happen even if the tenant takes reasonable care of the premises.  Normal wear and tear can include instances such as faded paint, worn-down carpets, or loose door locks.</p><p>Damages, on the other hand, result form accidents or unreasonable care of the premises. Unreasonable care means treating the property in a way most people wouldn''t, like throwing a bowling ball around. Damages can include instances like the extreme build-up of mold, stained carpets, or ripped wallpaper.</p><p>It is also important to note that if a tenant wishes to make changes to the premises that will remain after the lease expires, the tenant should do so only with the landlord’s written approval. When doing a final inspection of the premises, the tenant should discuss any damages with the landlord. It may also help to refer to the initial inspection checklist to verify that the damages are indeed the tenant’s responsibility.</p>', 'What is normal wear and tear?', 9, '', 'what-is-normal-wear-and-tear', '', 0, 0, '', 69),
(477, 'secondary', 'http://www.dca.ca.gov/publications/landlordbook/sec-deposit.shtml', 23, '<p>Before moving out, a tenant may be responsible for repainting the walls of his or her unit.  Generally, minor marks or nicks in walls are the landlord''s responsibility as normal wear and tear (for example, worn paint caused by a sofa against the wall). When repainting is necessary and not the result of normal wear and tear, the landlord can deduct the cost from the tenant’s security deposit.</p><p>One way to estimate the amount that the landlord can deduct for repainting is based on the length of the tenant’s stay in the unit.  For a tenant who has occupied a unit for more than two years, a landlord will generally not deduct any amount for repainting the walls.  If the length of stay is one to two years, a landlord will generally deduct one-third of the cost. If the length of stay is less than a year but more than six months, a landlord will roughly deduct two-thirds of the cost amount.  A landlord will usually deduct the full cost amount when a tenant has occupied the unit for less than six months.</p>', 'Deduction for Wall Damage and Repainting', 14, '', 'deduction-for-wall-damage-and-repainting', '', 2, 0, '', 54),
(478, 'secondary', 'http://www.dca.ca.gov/publications/landlordbook/sec-deposit.shtml', 23, '<p>Normal wear and tear to carpets, drapes, and other furnishings cannot be charged against a tenant’s security deposit. Normal wear and tear includes the simple wearing down of carpets and drapes, generally resulting from normal use or aging.  In contrast, a landlord can deduct from the tenant’s security deposit the cost amount of replacing or repairing unreasonable damages. Large rips or permanent stains in the carpets or drapes usually justify deduction for replacement.</p><p>A common method of calculating the deduction for replacement allocates the total cost of replacement so that the tenant pays only for the remaining useful life of the item that the tenant has damaged (referred to as the “useful life” rule). For instance, suppose a tenant damages an eight-year-old carpet that had a life expectancy of ten years. If the replacement costs $1,000, the landlord can properly charge $200 for the two years worth of use (life) that would have remained had the tenant not damaged the carpet.</p>', 'Damage to Carpets and Drapes', 6, '', 'damage-to-carpets-and-drapes', '', 2, 0, '', 48),
(479, 'secondary', 'http://blog.upcounsel.com/hiring-interns/', 32, '', 'What is an Intern', 9, '', 'what-is-an-intern', '', 0, 0, '', 49),
(480, 'secondary', 'http://www.dol.gov/whd/regs/compliance/whdfs71.htm', 32, '', 'Federal Definition of Intern', 15, '', 'federal-definition-of-intern', '', 0, 0, '', 43),
(482, 'secondary', 'http://www.dol.gov/whd/regs/compliance/whdfs71.htm', 33, 'An intern cannot displace regular employees. If the worker is doing the same work a paid employee would be doing within your company, then the worker is probably not an intern. The fact that a company would pay for someone to do the work is evidence that the work is important. Workers should get paid for work that is important to a company''s operations.', 'Intern Cannot Replace Regular Employees', 10, '', 'intern-cannot-replace-regular-employees', '', 5, 0, '', 43),
(483, 'secondary', 'http://www.legalcreation.com/how-often-should-i-update-my-will.html', 18, 'It is advisable to review your will every year or so. Make sure the will remains consistent with your current wishes. Also, you should review it after major life changes, such as the death of an heir, the birth of a potential new heir, or a significant change in your financial situation.  ', 'How Often Should I Update My Will?', 14, '', 'how-often-should-i-update-my-will', '', 0, 0, '', 48),
(525, 'secondary', 'http://blog.upcounsel.com/hiring-interns/', 33, '<p>In addition to federal regulations, California has it''s own requirements that must be satisfied in order to classify a worker an an intern.</p>\n1. The internship is part of an educational curriculum (should be getting credit).\n<br/><br/>\n2. The student should not be treated as employees.\n<br/><br/>\n3. The internship should be general, so the student gains skills that are valuable in different types of jobs.\n<br/><br/>\n4. The screening process for the internship should be different than the screening process for employees.\n<br/><br/>\n5. Advertisements for the program should be framed as educational. ', 'California Requirements for Interns', 5, '', 'california-requirements-for-interns', '', 0, 0, '', 24),
(484, 'secondary', 'http://www.nolo.com/legal-encyclopedia/executor-faq-29126-2.html', 18, '<p>If you have been named in another’s will to serve as an executor, you may choose to accept or decline the responsibility.  Even if you do initially decide to serve, you may resign at any time.</p>\n<p>A will sometimes defines another person as an alternate executor, and that person will take over if you do resign. If an alternate has not been selected, then the court will decide who is to take your place.</p>', 'Do I Have to Serve as Executor?', 12, '', 'do-i-have-to-serve-as-executor', '', 0, 0, '', 60),
(489, 'secondary', 'http://en.wikipedia.org/wiki/Asylum_in_the_United_States', 8, 'The United States can recognize the right of asylum and admit some refugees into the country. Those seeking asylum must show that he or she (1) fears persecution (2) for being from a particular race, religion, nationality, political opinion, and social group, and (3) that the government of their home country is responsible.', 'Asylum in the United States', 15, '', 'asylum-in-the-united-states', '', 0, 0, '', 32),
(39, 'secondary', 'http://www.law.cornell.edu/uscode/text/26/5000A', 35, 'The Affordable Care Act (26 USC § 5000A) requires individuals to maintain minimum essential coverage for health insurance. Factors such as yearly income, family household, or employer size will determine an individual''s yearly contribution and whether or not government assisted funding will be provided. Penalties can be imposed to individuals that do not maintain health coverage.', 'Individual Mandate: 26 USC § 5000A', 8, 'healthcare reform, individual mandate, affordable care act, penalty, tax', 'individual-mandate-26-usc-5000a', '', 0, 0, '', 41),
(45, 'secondary', 'http://en.wikipedia.org/wiki/National_Federation_of_Independent_Business_v._Sebelius', 35, 'In National Federation of Independent Business v. Sebelius, the Supreme Court of the U.S. determined that Congress had the right to require Americans to have healthcare insurance. This power or "right" to require healthcare stems from Congress'' taxing power. ', 'Summary of Case That Validated the Individual Mandate', 12, 'healthcare reform, supreme court, individual mandate, taxing power', 'summary-of-case-that-validated-the-individual-mandate', '', 0, 0, '', 36),
(491, 'secondary', 'http://www.dol.gov/whd/fmla/', 43, 'The Family and Medical Leave Act (FMLA) offers employees twelve weeks of leave if they are eligible. Examples of eligible persons are women who have given birth to a child, adoption or foster care of a child, people who care for a seriously ill relative, a seriously ill person, or certain circumstances caused by a relative in active military duty. Twenty-six weeks of leave can be offered if a person is caring for a covered servicemember with a serious injury or illness.', 'Family and Medical Leave Act Overview', 11, '', 'family-and-medical-leave-act-overview', '', 0, 0, '', 33),
(492, 'secondary', '', 18, '<p>An executor does not always have to hire a lawyer.  Doing a good job simply requires persistence and an attention to detail, but not necessarily a law degree. If the assets must go through probate court, the process consists of mainly paperwork.  Most cases do not involve disputes that require a judge’s decision; an executor may never see the inside of a courtroom. An executor can usually handle the paperwork without a lawyer if the will is straightforward. In more complex situations (e.g. disputes among inheritors), an executor may want to seek legal assistance.</p>', 'Does an executor have to hire a lawyer?', 12, '', 'does-an-executor-have-to-hire-a-lawyer', '', 2, 0, '', 40),
(493, 'secondary', 'http://www.lawfirms.com/resources/personal-injury/auto-accident/accident-statute-limitations.htm', 10, '<p>For auto accidents, the statute of limitations refers to the time limit placed on the right to bring civil legal action against the party responsible for the accident.  A victim of a car accident has to abide by the accident statute of limitations that apply in the state where the car accident took place. Here is a list of accident statutes of limitations, state by state, for personal injury and personal property damages:</p>\n(Personal injury / Personal property damages)<br/>\n<p>KY - 1 year / 2 year</p>\n<p>TN – 1 year/ 3 years</p>\n<p>AZ, DE, HI, IN, KS, OH, OK, PA, TX, WV – 2 years for both</p>\n<p>CA, CT, ID, NV – 2 years / 3 years</p>\n<p>GA – 2 years / 4 years</p>\n<p>IL, IA, VA – 2 years / 5 years</p>\n<p>AL, AK, NJ, ND, OR – 2 years / 6 years</p>\n<p>MT – 3 years / 2 years</p>\n<p>AR, CO, MD, MA, MI, NH, NY, NC, SC, WA, DC – 3 <p>years for both</p>\n<p>NM, VT- 3 years / 4 years</p>\n<p>SD, WI- 3 years / 6 years</p>\n<p>UT- 4 years / 3 years</p>\n<p>FL, NE, WY- 4 years for both</p>\n<p>MO- 5 years for both</p>\n<p>ME, MN- 6 years for both</p>\n<p>MS, RI- 3 years</p>\n ', 'Statute of Limitations for Car Accidents', 7, '', 'statute-of-limitations-for-car-accidents', '', 2, 0, '', 34),
(494, 'secondary', 'http://startupowl.com/resources/business-startup-essentials/startup-organizing/', 2, 'It''s important to organize and structure your business to get the maximum benefits afforded by the law. There are many different types of entities you can choose from including a Sole Proprietorship, General Partnership, Limited Liability Company, and Corporation. Each has it''s own advantages and disadvantages. ', 'Organizing Your Business', 16, '', 'organizing-your-business', '', 1, 0, '', 73),
(495, 'secondary', '', 10, '<p>A rear-end collision is when a car crashes into the car in front of it. It is usually caused by tailgating, inattentive drivers, or tired drivers.<p>  \n\n<p><b>Fault</b> - It is almost always the other driver''s fault if you were hit from behind. This is because the car behind you must maintain a safe distance at all times. However, if you were braking and one or more of your brake or tail lights were broken, you may be partially at fault because the other driver might have had a harder time stopping. In this situation the amount of money you can recover will be reduced, however, you will probably still be able to get something.\n\n<p><b>Injuries</b> - Insurance companies will often classify a rear-end collision as a low impact accident and will argue that there is minimum damage. However, a typically injury from a rear-end collision is whiplash, which may cause serious soft tissue damage. Soft tissue damage includes damage of muscles, ligaments and tendons, and usually results in pain, swelling, bruising, and loss of function. These injuries are not immediately apparent. As a result, you may be offered a low settlement amount.</p>', 'Rear-end Collision', 7, '', 'rear-end-collision', '', 0, 0, '', 24),
(496, 'secondary', '', 10, '<p>A <b>left turn accident</b> is when a car turning left at an intersection hits a car on the opposite side of the road that is going straight through the intersection. The driver that is turning left is almost always at fault for the accident. This is because a left turning car must wait until it is safe to turn.</p>\n<p>The driver going straight through the intersection may be partially at fault if he or she was speeding or ran a red light. This will reduce recovery, but not completely. Speeding makes it difficult for the left turning car to judge when it is safe to turn. Furthermore, when the light turns red, most drivers will assume it is safe to make a left turn. This is not the case if the other driver runs a red light. However, even in these instances, the driver mostly as fault is the one turning left.</p> ', 'Left-turn Accident', 3, '', 'left-turn-accident', '', 0, 0, '', 31),
(497, 'secondary', '', 10, '<p>You need to show that the car accident caused you some harm or injury in order to recover damages in a car accident claim. If you weren''t harmed by the accident, you cannot recover any money. Harm includes: medical bills, auto–repair costs, missing days of work, and other damages you have suffered. The most common harm is physical injury, such as broken bones, bruising, or anything else that requires medical attention. You might be able to recover money for these costs.</p>\n<p>Furthermore, the injury you suffered must be attached to a monetary value. For example, you''ll be able to recover the cost of medical bills for a broken bone. However, it will be harder to recover money for a chipped nail.</p>', 'Injury is Necessary to Sue', 10, '', 'injury-is-necessary-to-sue', '', 0, 0, '', 37),
(498, 'secondary', '', 10, '<p>If the other driver was drunk at the time of the accident, it is most likely his or her fault. This is because there is a presumption that someone intoxicated cannot adequately control a vehicle. You will probably be able to recover money for any harm caused. However, if the drunk driver was driving normally, and you caused the accident, you may be mostly at fault and your recovery will be reduced.</p>', 'Hit By a Drunk Driver', 8, '', 'hit-by-a-drunk-driver', '', 0, 0, '', 30),
(499, 'secondary', '', 10, '<p>We have a duty to follow the rules of the road. Breaking a traffic law is a breach of that duty. In a car accident, it is sometimes difficult to prove whose fault the accident was. One factor that may be considered is if a driver broke any traffic laws. For example, a driver that is speeding or makes an illegal turn may be partially at fault for a car accident.</p>', 'Traffic Violations and Fault', 5, '', 'traffic-violations-and-fault', '', 0, 0, '', 29),
(500, 'secondary', '', 10, '<p>You can recover for a number of different harms caused by a car accident. Here are some common ones:</p>\n1) <b>Physical injury</b> - The most obvious type of harm is a physical injury, such as a broken bone. You may also have less obvious physical injuries such as soft tissue damages, which includes bruising, swelling, and pain to muscles, tendons, and other parts of the body. You can get money for medical bills.\n<br/><br/>\n2) <b>Car damage</b> - You can recover the cost of repairs to your car for any damage caused by the accident. Be sure to save any bills or receipts. \n<br/><br/>\n3) <b>Alternative transportation</b> - If you had to rent a car or use public transportation, such as a bus, to get to work because your car was in the shop from the accident, you can get compensated for those expenses. Be sure to save any bills, receipts, or tickets. \n<br/><br/>\n4) <b>Work harms</b> - Financial loss commonly includes missing days at work. It may also include having your hours reduced, losing a promotion, or being unable to take a job or start an educational program. You may be able to get compensated for these loses. For example, if you missed a week of work because of the accident, you might be able to get a week''s worth of pay. ', 'Types of Harm From a Car Accident', 6, '', 'types-of-harm-from-a-car-accident', '', 0, 0, '', 38),
(501, 'secondary', '', 18, 'If you are married and pass on without a will, your spouse will probably get all your property. <p>If you have never had a spouse or child, and you pass on without a will, all of your property typically goes your parents, siblings, or other relatives. The government will decide how your property will be divided, and your property can also lose up to 5% of its value in court due to administrative costs. If you get a will, you are in control and you can save a lot of money because the court won''t have to waste time figuring out how things should get split.</p>', 'Effect of Marital Status', 14, '', 'effect-of-marital-status', '', 0, 0, '', 37),
(502, 'secondary', '', 18, '<p>Your children will typically receive some of your property even if you don''t draft a will. If you are married and pass on without a will, your spouse will probably get one–third to one–half of your property. The rest of your property will probably be split between your children. If you have no spouse, the property will go to your children first and be evenly split between them. If you have grand-children, the formula gets a bit more complicated. In a will you can decide exactly how you want things split.</p><p>It''s also important to have a will if you have children under the age of 18. In a will, you can decide who will be the guardian of your children if you were to pass unexpectedly. If you pass on without a will and you have children under 18, the wrong person could end up taking custody of your children because the government decides who their guardian will be. If you have someone in mind who you would want to take care of your children, you should make a will where you specify that person.</p>', 'Children and Wills', 8, '', 'children-and-wills', '', 0, 0, '', 46),
(511, 'secondary', 'http://law.onecle.com/california/civil/1950.5.html', 23, 'An itemized statement should list the work done, time spent, and the hourly rate for any repairs or cleaning costs. This way you know exactly how any deductions from your security deposit was spent. Your landlord must send you an itemized statement with 21 days of moving out if deductions were made for cleaning costs and repairs. ', 'What is an Itemized Statement?', 6, '', 'what-is-an-itemized-statement', '', 0, 0, '', 24),
(512, 'secondary', 'http://www.dca.ca.gov/publications/landlordbook/sec-deposit.shtml#footnote219', 23, 'If you feel that the wrong amount has been deducted from your security deposit or you did not get an itemized statement after 21 days from move out, you have a right to get your security deposit back. There are three steps you can take.<p>\n1) You should first ask your landlord for a refund before resorting to legal action. It''s a lot less effort and you might just get what you want. Be sure to state the amount of money wanted and reasons why you deserve that amount. Always include a letter when you make your request to use as future reference and hard evidence. It''s a good idea to send the letter by certified mail or have the landlord sign it upon receipt, acknowledging that he or she received it.</p><p>2) If that doesn''t work, try to work out a compromise with third–party mediation. In mediation, a neutral person will try to work out a deal that''s okay with you and your landlord. Check out the following link to find out who to contact in your region: http://ow.ly/d6B7Z. If mediation does not work, you may want to take legal action.</p><p>3) If the amount of money you want to recover is less than $7500, you can try to recover your money in Small Claims Court. Here, the landlord must convince the judge that the damage occurred, and that the amount deducted from you security deposit is appropriate. You can argue that the amount is inappropriate, or that the damage wasn''t caused by you or is just normal wear and tear.</p>If the amount you want to recover is above $7500, you have a choice to take your case superior court or small claims court. If you decide to take your case to small claims court, you can only recover up to $7500 and will lose the rest. In superior court, you may be able to recover the full amount. It''s a good idea to speak with a lawyer if you plan on going to superior court. ', 'How to Get Your Security Deposit Back', 12, '', 'how-to-get-your-security-deposit-back', '', 0, 0, '', 42),
(507, 'secondary', 'http://law.onecle.com/california/civil/1950.5.html', 23, '<p>Your landlord can only charge you to make the unit as clean as it was when you first moved in. If there was a giant stain on the carpet when you first moved in, you are not required to clean it, and your security deposit can''t be used to clean it. However, the condition did not exist when you first moved in, your security deposit may be deducted.</p><p>Common cleaning costs would include eliminating flea infestations left by your pet, cleaning the oven, removing decals or fixtures from walls, removing mildew in bathrooms, defrosting the refrigerator, or washing the kitchen floor. Your landlord must send you all receipts or invoices, or an itemized statement for the cleaning costs. The only time the landlord does not have to give you these documents is if the total cleaning cost is less than $126 or you waived your right to get them.</p>', 'Deduction for Cleaning Costs', 9, '', 'deduction-for-cleaning-costs', '', 0, 0, '', 33),
(508, 'secondary', 'http://law.onecle.com/california/civil/1950.5.html', 23, '<p>Your security deposit can be used to fix things that you or your guests damaged. But it can''t be used for normal wear and tear, such as wearing down with time and moderate dirt. All costs must be reasonable. This means that the landlord can''t charge you $1000 for a $500 job.</p><p>The landlord must send you copies of receipts or invoices, or an itemized statement for these repairs, so you can see how your deduction was spent. The only time the landlord does not have to send you these documents is when the total cost is less than $126 or you waived your right to receive them.</p>', 'Deduction for Repairs', 13, '', 'deduction-for-repairs', '', 0, 0, '', 31),
(509, 'secondary', 'http://scocal.stanford.edu/opinion/granberry-v-islay-investments-31631', 23, 'Your landlord has 21 days from the day you move out to send you either your full security deposit or an itemized statement that lists the amount of any deductions from your security deposit and reasons for those deductions, and a refund of any amounts not deducted. If you do not get either within 21 days of moving out, the landlord loses the right to keep any of the security deposit and you are entitled to get all of it back. ', 'When Do You Get Back Your Security Deposit', 9, '', 'when-do-you-get-back-your-security-deposit', '', 0, 0, '', 26),
(510, 'secondary', '', 23, 'You are usually obligated to pay rent. If you broke your lease and found a suitable replacement without delay, your landlord typically cannot touch your security deposit. Or if your rental unit was "uninhabitable," your security deposit cannot be touched and you do not have to pay rent. An uninhabitable rental unit is unfit to live in. It might have major plumping issues, little light and ventilation, structural hazards, or vermin problems. A lawyer can help you figure out whether your rental complies with the local municipal housing code.', 'Deduction for Unpaid Rent', 12, '', 'deduction-for-unpaid-rent', '', 0, 0, '', 23),
(514, 'secondary', 'http://law.onecle.com/california/family/3011.html', 9, '<p>The court must consider any history of abuse committed by a person seeking custody of a child. This factor is used to help determine the best interest of the child whose health, safety, and welfare is of most importance. Abuse against certain person will hurt your more than others.</p>\n1) <b>the child, the child''s sibling, or the other person seeking custody</b> - This will probably hurt your case to child custody. If the abuse took place in the past 5 years, the court will automatically assume that you should not have custody of the child. However, you can fight this by showing evidence that having custody will not hurt the child. The court will consider, among other things and when appropriate, completion of a battery treatment program, alcohol and drug abuse counseling, or parenting class, or complying with the terms and condition of probation, parole, a restraining or protective order. A lawyer can help you overcome this presumption.\n<br/><br/>\n2) <b>parent, significant other or cohabitant of other person seeking custody</b> - A history of abuse against any of these persons may weaken your right to child custody. This is because the court''s goal is to decide in the best interests of the child. A lawyer may be able to help you show that your domestic violence is a thing of the past.\n<br/><br/>\n3) <b>other persons</b> - This will be taken into account on a case by case basis.', 'History of Abuse Against Others', 14, '', 'history-of-abuse-against-others', '', 0, 0, '', 36),
(515, 'secondary', 'http://law.onecle.com/california/family/3030.html', 9, 'The court is allowed to consider your past criminal convictions in order to help determine the best interest of the child. Criminal convictions of certain crimes may make it harder to obtain child custody. Some prior criminal convictions make it harder to get child custody than others. A lawyer can help you argue that you have been rehabilitated and deserve the right to child <p>\n1) Murder - A prior murder conviction will make is especially difficult to get custody of your child. If the murder victim was a parent of the child, the count cannot award custody unless there is a good reason to grant custody. The court is allowed to look at the following factors in making their determination: the child''s preference, evidence that the person seeking custody was abused by the deceased parent, and evidence that the person seeking custody suffers from batter women''s syndrome. A showing that the person has been rehabilitated may be helpful as well.</p><p>\n2) Rape - A prior rape conviction will make is especially difficult to get custody of your child. If the child you are seeking custody over was conceived from that rape, you will probably not receive child custody.</p><p>\n3) Cruelty or injury to a child or a sex crime against a child - Past crimes against a child will make it especially difficult to obtain child custody. The court wants to protect children a history of abuse against them will not help. custody.</p><p>\n5) Other - Other crimes will be weighted on a case by case basis.</p>\n', 'Prior Criminal Convicions', 15, '', 'prior-criminal-convicions', '', 0, 0, '', 34),
(516, 'secondary', 'http://law.onecle.com/california/family/3046.html', 9, 'The court is allowed to consider you absence from the home as one factor in determining child custody.  However, a person''s absence cannot be considered in the following situations:<p>\nNot allowed to because of a protective order - If you are not allowed to visit the home because there is a restraining order on you, then the court will not consider your absence. Of course the restraining order may harm your case.</p><p>\nOther person prevents me from maintaining contact - If the other person purposely prevents you from visiting your child, then your absence cannot be considered. This can include not being at the home when you visit or physically locking the door and not letting you in.</p><p>\nTo avoid domestic violence - If your reason from being absent is because you are afraid that someone will harm you, then the factor will not be considered.</p><p>\nInterest - As long as you maintain an interest in seeing your child, then the court will probably not consider any absence.</p>', 'Not Living With Children', 10, '', 'not-living-with-children', '', 0, 0, '', 32),
(517, 'secondary', 'http://law.onecle.com/california/family/3042.html', 9, 'The court is required to consider who the child wants to have custody. However, this isn''t too important if the child is young or less mature. For example, the preference of a child that is 5 years old doesn''t matter that much because that child doesn''t have the mental capacity to decide what might be best. However, an older, more mature child''s decision is worth more more. The court must take into account the child''s age, maturity, and intelligence. ', 'Child''s Preference', 5, '', 'childs-preference', '', 0, 0, '', 26),
(518, 'secondary', 'http://law.justia.com/cases/california/calapp3d/134/530.html', 9, '<p>A mental or physical disability does not automatically weaken your case for child custody. However, it must be considered by the court. If the disability is bad for the child, then it will hurt your case. But if it has no impact on the child''s well being, then it will not play a role in making a determination for custody. The most important consideration in child custody cases is the child’s safety and health.</p>', 'Disability Affecting Child Custody', 11, '', 'disability-affecting-child-custody', '', 0, 0, '', 29),
(519, 'secondary', '', 9, 'Some negative factors in child custody cases may include:<br/><br/>\nSmoking<br/>\nHaving an affair <br/>\nAbusing drugs<br/>\nMoving the child far from home<br/>\nHaving a disability <br/>\nPast criminal convictions<br/>\nA history of domestic violence <br/><br/>\nThese facts are not always negative depending on the situation. The courts mission is to protect children and keep them in a stable environment. \n', 'Negative Facts in Child Custody Cases', 9, '', 'negative-facts-in-child-custody-cases', '', 0, 0, '', 32),
(520, 'secondary', 'http://www.all-about-car-accidents.com/resources/fault-in-car-accidents/comparative-contributory-negligence.htm', 10, '<p>Contributory negligence means that if you contributed to a car accident in anyway, you cannot recover money in a lawsuit. This is true even if you were only 1% at fault for causing the accident. On the other hand, if you were sued for a car accident, you can avoid liability by proving that the other person contributed to a car accident. Currently there are five states that follow this rule: Alabama, Maryland, North Carolina, Virginia, and Washington, DC.</p>', 'What is Contributory Negligence?', 10, '', 'what-is-contributory-negligence', '', 2, 0, '', 27),
(521, 'secondary', '', 10, '<p>Some states have maintained a system referred to as “modified” contributory negligence for car accident claims. In this system, accident victims may file suit against another only if the other driver was mostly (50% or more) at fault for the accident. The states that follow this rule include Tennessee, Colorado, Georgia, Kansas, Oklahoma, West Virginia, Arkansas, Nebraska, Utah, Maine, and North Dakota. </p>\n<p><b>For example</b>, you were speeding 40 mph over the speed limit and hit a car who was changing lanes but forgot to signal. Both of you are at fault: you for speeding and the other driver for failing to signal when changing lanes. However, in this case you are probably more at fault (50% or more). Therefore, in a state that follows the modified contributory negligence 50% rule, you will not be able to recover anything. However, if you were 49% at fault, you''ll be able to recover some money for damages.</p>\n<p>Usually a jury will assign fault percentages to each driver. If you are unsure whether you were mostly at fault, it might be a close call. On the other hand, if you were clearly (and mostly) at fault for the car accident, it will be harder to show a jury that you were not. It''s always a good idea to speak with an attorney about what your chances might be.</p>', '50% Rule: Modified Contributory Negligence', 14, '', '50-rule-modified-contributory-negligence', '', 0, 0, '', 37),
(522, 'primary', 'http://scocal.stanford.edu/opinion/liberty-mut-ins-co-v-industrial-acc-com-29559', 42, '<p>There are a few situations where you can recover money for injuries caused by a heart attack, seizure, or stroke. The most obvious situation is when your work caused the injury.</p>\n<p><b>Preexisting disease</b> - A preexisting disease or condition, such as heart disease or thrombophlebitis, can cause a sudden heart attack, stroke, or seizure, which can lead to injury or death. You can recover compensation for these injuries if you can show that your work made your preexisting disease worse. If you work did not contribute to worsening the disease, then it will be harder to get workers’ compensation.</p>\n<p><b>Strain</b> - You will probably be able to recover money for a heart attack caused by strain or exertion. The strain doesn’t have to be extraordinary. There just has to be a connection between the strain and heart attack.</p>\n<p><b>Hitting object</b> - If you heart attack or seizure was not caused by you job, it is probably not a work related condition. However, you may still be able to get workers’ compensation if as a result of the heart attack or seizure you hit an object or hard floor and suffer an injury. For example, if you had a heart attack, which caused you to fall and hit your head on the floor, you can probably get compensation for your head injury. </p>', 'Workers’ Compensation for Heart Attack, Seizure, or Storke', 9, '', 'workers-compensation-for-heart-attack-seizure-or-storke', '', 0, 0, '', 33),
(523, 'primary', 'http://law.justia.com/cases/california/calapp2d/157/838.html', 42, '<p>You cannot recover for a disease that is not unique to your job. For example, if you got a common cold at work, you probably can’t get workers’ compensation. However, diseases that result from the hazards of a particular type of occupation are probably eligible.</p>\n<p>You can get workers’ compensation for a disease resulting from special exposure from your job. Special exposure is a unique condition of a job. For example, if you got a disease from special health care provided by an employer, any injury resulting from the disease is probably compensable.</p>\n<p>Special exposure may also include climatic conditions that are unique to the job and different than what is experienced by other people in the community, such as extreme heat or cold. You may be able to recover money for sunstroke, heat exhaustion, freezing, or other injuries resulting from these climatic conditions. </p>', 'Workers'' Compensation for a Disease', 15, '', 'workers-compensation-for-a-disease', '', 0, 0, '', 21),
(524, 'secondary', '', 42, '<p>California law requires employers to carry workers'' compensation insurance even if they have only one employee. In order to be eligible to receive workers'' compensation you have to satisfy several conditions.</p>\n<p>First, you must be an employee, not an independent contractor. Employees generally have less control over their work than independent contractors. Just because your employer says you are an independent contractor does not make it true. California uses a number of different factors to determine a person''s employment status. To find out your true status, check out our guide “Am I an Independent Contractor?”</p>\n<p>Second, your injury or condition must be work related. Generally, if you were hurt while doing your job or were at work, you can get workers'' compensation. For example, if you tripped while moving boxes at work, you can probably recover money for any injuries related to the fall. However, determining whether your injury is work related can get complicated.</p>\n<p>Even if these conditions are met, you will not be able to recover if you were injured while drunk or if you purposely hurt yourself. There are also special rules and exceptions that may disqualify you.</p>\n', 'Workers'' Compensation Eligibility', 20, '', 'workers-compensation-eligibility', '', 0, 0, '', 48),
(526, 'secondary', 'http://www.dol.gov/whd/regs/compliance/whdfs71.htm', 33, 'Your company cannot receive an immediate benefit from the worker in order to classify that person as an intern. In fact, sometimes your operations may be impeded by having the worker around. This is because an internship is for the benefit of the worker and not the company.', 'Intern Cannot Provide Immediate Benefit', 11, '', 'intern-cannot-provide-immediate-benefit', '', 0, 0, '', 20),
(527, 'secondary', 'http://www.dol.gov/whd/regs/compliance/whdfs71.htm', 33, 'The duration of the internship period must be fixed in the beginning. At the end of the internship period, an intern is not guaranteed a job. It may be a possibility, but not a guarantee. You can''t use the period as a trial and give the expectation that the worker will be hired at the end.', 'Intern Cannot be Guaranteed Job', 12, '', 'intern-cannot-be-guaranteed-job', '', 0, 0, '', 20),
(528, 'secondary', 'http://www.dol.gov/whd/regs/compliance/whdfs71.htm', 33, 'The type of training an intern receives should be similar to training that would be given in an educational environment. This is because an internship should be an extension of a worker''s educational experience.', 'Internship Must be Educational ', 13, '', 'internship-must-be-educational', '', 0, 0, '', 19),
(529, 'secondary', '', 39, 'If you have more than 1 founder, it''s a good idea to incorporate to solidify any promises and understanding on paper. During incorporation, the obligations and rights of each founder will be outlined. More importantly, the percentage of shares each person owns will be decided. It is easier to formalize these agreements in writing earlier than trying to clean up misunderstandings later. The longer you wait to incorporate, the chance of an argument about how equity is split increases. ', 'More Than One Founder', 10, '', 'more-than-one-founder', '', 0, 0, '', 23),
(530, 'secondary', '', 39, 'If you business is planning to grant stock options or other equity compensation, you may want to think about incorporating soon. It will be easier to grant these forms of compensation via a corporation. Although it is possible to grant equity with pre-incorporation documents, this can get messy when incorporation actually happens. It is easier to first incorporate, than grant options. ', 'Granting Stock Options', 15, '', 'granting-stock-options', '', 0, 0, '', 20),
(531, 'secondary', '', 39, 'If you business is at a high risk of getting sued, it''s a good idea to incorporate soon. By forming a corporation you will be protected from personal liability. This means if you business gets sued, you are not personally liable and none of your assets will be touched. For example, myRight is at a high risk of getting sued because there is a thin line between what is legal advice and legal information. Therefore, the founders decided to incorporate earlier to protect themselves.', 'High Risk of Getting Sued', 11, '', 'high-risk-of-getting-sued', '', 0, 0, '', 23),
(532, 'secondary', '', 39, 'If you are seeking venture or seed capital, it''s a good idea to incorporate because you will need an entity to accept the investments. In fact, most VCs will not fund you unless you are incorporated. Further, the earlier you incorporate you will be able to justify a lower price for common stock when you distribute it to yourself.  ', 'Seeking Venture Capital', 12, '', 'seeking-venture-capital', '', 0, 0, '', 31),
(533, 'secondary', '', 39, 'If you plan on hiring employees or contractors, it''s a good idea to incorporate so the corporation is liable to these workers and not you. Furthermore, you want to make sure that any work produced by them is transferred to the company, thereby avoiding intellectual property disputes. This is especially important if you plan on hiring designers or developers because you want to make sure the company owns all work or code that is produced.', 'Hiring Employees', 5, '', 'hiring-employees', '', 0, 0, '', 19),
(534, 'secondary', '', 18, '<p>Beyond just a few technical requirements, any competent adult that has the appropriate mental capacity is allowed to make a will.  For a will to be valid, it must be signed in the presence of at least two witnesses (they do not need to read it).  In most states, the witnesses must be people who will not receive anything under the will.  Furthermore, a will does not have to be notarized (signing in the presence of someone authorized by the government); however, signing an affidavit (sworn statement) with your witnesses in front of a notary can help simplify the court procedure after you die and safeguard against any claims that the will is invalid.</p>\n<p>Lastly, a will does not have to be recorded or filed with any government agency.  Just keep the will in a safe, accessible place and be sure the executor—the person in charge of winding up your affairs—knows where it is.</p>  ', 'What Makes a Will Legal?', 5, '', 'what-makes-a-will-legal', '', 2, 0, '', 27),
(535, 'secondary', '', 18, '<p>A will does not have to be written by a lawyer.  In fact, most people do not need a lawyer’s help in making a basic will.  Creating a basic will rarely involves complicated legal rules.  Good online document providers, software programs, and books can guide and aid most people in creating their own will; however, if you have questions that aren''t answered by the resources you’re using, or if your situation is unusual or complex, it may be advisable to seek the assistance of a lawyer.</p> ', 'Do I Need a Lawyer to Write My Will?', 14, '', 'do-i-need-a-lawyer-to-write-my-will', '', 0, 0, '', 51),
(536, 'secondary', '', 18, '<p>Probate court is a specialized court that handles matters of probate and the administration of estates. Probate is the legal process that occurs after someone dies. In probate court, one has to prove that the deceased person’s will is valid.  Furthermore, the deceased person’s property has to be identified, inventoried, and then appraised. The process can also include paying off the deceased person’s debts and taxes, and distributing the remaining property in accordance to the will. Usually, probate involves paperwork and court appearances by lawyers. It can be an expensive and time-consuming process and it is probably a good idea to avoid probate court by creating a trust.</p>', 'What is Probate Court?', 5, '', 'what-is-probate-court', '', 2, 0, '', 25),
(546, 'secondary', '', 7, '<p>Texting does count as harassment. Abusive or physically threatening text messages are one type of harassment. Threats must be immediate and realistic. That means a joke doesn''t count, but it does if the threat is real and could happen soon. Another example of harassment is if your get texted hundreds of messages a day. If you are being harassed through text, you can file a police report to document the harassment.</p>', 'Does Text Messaging Count as Harassment?', 7, '', 'does-text-messaging-count-as-harassment', '', 6, 1349468156, '', 35),
(547, 'primary', '', 18, '<p>Unfortunately, wills do not fully prevent probate.  In probate court, the judge will use the will as a guide for distributing your property.  Fortunately, there are several ways to avoid probate court.</p>\n<p>A few ways to avoid probate include a revocable living trust, pay-on-death accounts, joint ownership of property, and gifts.  A revocable living trust is an entity that you set up to distribute property after you die.  Pay-on-death accounts are bank accounts or retirement accounts that you ask the bank to distribute to a certain person after you die.  Joint ownership of property is when you and another person own a property and after one of you dies, the other person takes full ownership of the property.  Lastly, prior to death, you can gift property to other people.</p>\n', 'How to Avoid Probate Court?', 14, '', 'how-to-avoid-probate-court', '', 6, 1349468373, '', 61),
(549, 'secondary', '', 46, '<p>Workplace harassment is conduct that would make most people feel like they are working in a hostile environment. In order to be harassment, the conduct must be constant. It must also be based on race, color, national origin, religion, sex, age (over 40), or disability. Here are some specific examples of harassment that is non-sexual.</p>\n<b>Race</b> - slurs, comments, or epithets, pictures or symbols, such as a nazi symbol or burning cross, or comments about ethnic characteristics, such as dot-head, nappy headed, \n<br/><br/>\n<b>Religion</b> - hurtful comments on a person''s religious  belief, such as, towel head, bible basher, and jesus freak. \n<br/><br/>\n<b>Age</b> - negative comments about employees over the age of 40, including hag. These are generally remarks about old people. \n<br/><br/>\n<b>Disability</b> - intimidating references to a persons mental or physical impairment, such as retard, downy, gimp, and lame.  \n\n', 'Examples of Harassment', 7, '', 'examples-of-harassment', '', 0, 1349658594, '', 19),
(550, 'secondary', '', 47, '<p>If you left your job voluntarily because of workplace discrimination, you may still have a claim for wrongful termination or discharge. In these instances, your work environment must have been so hostile or intimidating that you had no choice but to resign. The law calls this a "<b>constructive discharge</b>" because the workplace discrimination basically forced you to leave. In order to qualify for constructive discharge and thereby make a claim for wrongful termination, you must satisfy three conditions.</p>\n1) You faced workplace discrimination that was based on a violation of public policy such as race, color, national origin, sex, disability, age (over 40), veteran status, or familial status. You may also qualify if you refused to engage in unlawful conduct with your employer or faced discrimination as a result of whistle blowing. \n<br/><br/>\n2) The discrimination created such a hostile and intimidating work environment that most people in your position would have left their job too.\n<br/><br/>\n3) You employer knew about the discrimination and did nothing about it.', 'Left Because of Workplace Discrimination', 8, '', 'left-because-of-workplace-discrimination', '', 0, 1349661202, '', 44),
(551, 'secondary', '', 47, '<p>The type of claim an employee may have against an employer will depend on the type of employment. There are three types of employments for private employees.</p> \n<b>Express contract</b> - If you had an express contract between you and your employer, you were probably an independent contractor. In this case, if you were fired without good cause, you can sue for a breach of contract.\n<br/><br/>\n<b>Implied contract</b> - If you had no express contract with your employer, you are probably an employee. However, if your employer has repeatedly assured you of job security and you think that you will not be terminated, you may have an "implied contract". In such as situation, you might be entitled to a contract claim. You may also bring a claim for breach of the implied covenant of good faith and fair dealing.\n<br/><br/>\n<b>At-will</b> - Most employees are at-will employees and can be terminated at any time for almost any reason. The only reason they cannot be terminated for is discrimination. If you feel that you have been fired or laid off because of your race, sex, religion, or any other valid reason, you may have a tort claim for wrongful termination.\n<p>You may be able to sue if you were terminated (laid off or fired), constructively discharged (you resigned because of intolerable conditions) or, in some circumstances, demoted.</p>', 'Types of Employment', 9, '', 'types-of-employment', '', 0, 1349663479, '', 23),
(552, 'primary', 'http://law.justia.com/cases/california/caapp4th/95/346.html', 42, '<p>Generally, injuries that happen before or after work are excluded from workers’ compensation benefits. However, you may still be eligible if you were doing something that benefited your employer. For example, if your employer asked you to run an errand outside of your normal hours, and you were injured during that time, you can probably receive workers’ compensation. Even if your employer didn''t ask you to do something, as long as you were doing something that helped your employer, you might be able to recover.</p> \n<p>In one case, an employee came to work on her day off to drop off a card. She noticed that a book shelf was collapsing and helped her co-workers fix it. In the process, she injured her back. Although she was injured outside of her working hours, the board ruled that she was entitled to workers’ compensation. </p>\n', 'Workers’ Compensation for Injury after Working Hours', 6, '', 'workers-compensation-for-injury-after-working-hours', '', 0, 1349723964, '', 17);
INSERT INTO `links` (`id`, `type`, `url`, `category`, `summary`, `title`, `votes`, `tags`, `slug`, `source`, `poster`, `date_created`, `location`, `views`) VALUES
(553, 'primary', 'http://law.justia.com/cases/california/calapp3d/84/50.html', 42, '<p>Generally injuries during lunch and coffee breaks are not eligible for workers’ compensation because most breaks take place outside of the office or work site and are not compensated. However, there are some conditions that will make lunch or coffee breaks work related and therefore eligible for workers’ compensation.</p>\n<b>Paid</b> – If you are paid during the period of your lunch or coffee break, you can probably receive workers’ compensation for any injuries during that period. \n<br/><br/>\n<b>On Premises</b> – Even if you are not paid during your lunch or coffee break, you can recover if you were injured while on your employer’s premises. For example, if you ate lunch at your desk and were injured, you can probably receive workers’ compensation.\n<br/><br/> \n<b>Work-related</b> – If your lunch or break was work related, you can probably get workers’ compensation. For example, if the primary purpose of lunch was to talk business, it may be considered as a work-related activity. Another way your break may become work-related is if you were buying coffee for your boss. \n', 'Workers’ Compensation Lunch and Coffee Breaks', 16, '', 'workers-compensation-lunch-and-coffee-breaks', '', 0, 1349731960, '', 20),
(554, 'secondary', '', 10, '<p>Your state has either adopted contributory or comparative negligence as legal theories with which a defendant can defend against a negligence car accident claim.</p> \n<p><b>Contributory negligence</b> is the older of the two theories but is relevant in only a handful of states. This theory completely denies the plaintiff (person that is suing) damages he or she contributed to the accident at all. For example, if you cross the street when the pedestrian signal shows “Do Not Walk” and a driver who was speeding miles over the speed limit runs you over, you cannot recover any damages. Even though the driver was at fault for speeding, you were also at fault for walking before your signal changed.</p>\n<p>In contrast, comparative negligence lowers the amount of damages a plaintiff can recover in proportion to the plaintiff’s fault. There are really two kinds of comparative negligence. The first is <b>“pure” comparative negligence</b> which is as straightforward as it sounds: the plaintiff’s damages are reduced by the proportion of her fault. Let’s stay with our example above. A jury in a comparative negligence state might determine that you were 90% at fault for walking before the signal changed. As a result, your damages would be reduced by 90%.</p>\n<p>The second kind of comparative negligence is called <b>“modified” comparative negligence</b>. This version allows a plaintiff to recover damages if her fault is not greater than the defendant’s fault. So in our example above, the plaintiff would recover nothing since 90 is greater than 10. However, if a jury determined the plaintiff to be 45% at fault then she could recover 55% of her damages award.</p>', 'Theories of Defense in Car Accident Claims', 3, '', 'theories-of-defense-in-car-accident-claims', '', 7, 1349761083, '', 45),
(555, 'secondary', '', 47, '<p>Sexual orientation discrimination includes being treated differently or harassed because of one’s sexual orientation. There are no federal laws that prohibit employers (in the private sector) from discriminating against an employee (or prospective employee) on the basis of his or her sexual orientation.</p> \n<p>Although there are no federal laws protecting against this type of discrimination, many states have laws that currently prohibit sexual orientation discrimination in both public and private jobs: California, Colorado, Connecticut, Hawaii, Illinois, Iowa, Maine, Maryland, Massachusetts, Minnesota, Nevada, New Hampshire, New Jersey, New Mexico, New York, Oregon, Rhode Island, Vermont, Washington, and Wisconsin.</p> \n<p>Gays and lesbians living in states that do not have a law that protects them from workplace discrimination may still be protected by city and county ordinances—many cities and counties prohibit against sexual orientation discrimination in at least some workplaces.</p>  \n<p>Employees who are the victims of sexual orientation discrimination may be able to recover lost wages, emotional distress damages, and punitive damages in employment litigation.</p>\n', 'Is Sexual Orientation Protected? ', 7, '', 'is-sexual-orientation-protected', '', 2, 1349762032, '', 15),
(556, 'secondary', '', 47, '<p>Retaliation simply means getting back at someone (revenge).  In the workplace, retaliation refers to an employer punishing an employee in some way for reporting unlawful conduct.</p> \n<p>Retaliatory termination is defined as being fired from a job or an unlawful reason or because the employee exercised a legal right that was unfavorable to the employer. These terminations can occur because you engaged in a protected activity, such as reporting inappropriate sexual advances, safety issues, or other illegal actions by the employer.</p>  \n<p>Retaliating against an employee is illegal under the Federal Employment and Housing act (FEHA). FEHA prohibits an employer from discharging, expelling, or otherwise discriminating against any employee on the basis of retaliation (because the employee filed a complaint or testified against him or her).  \nAn employee must prove three things when establishing a valid claim of being fired from a job because of retaliation:</p>\n1. The employee opposed the employer’s discrimination or participated in a protected activity (i.e. reported illegal conduct).\n<br/><br/>\n2. The employee was fired or punished in some way\n<br/><br/>\n3. There is a relationship between the protected activity (i.e. reporting illegal conduct) and your firing\n', 'What is Retaliatory Termination?', 5, '', 'what-is-retaliatory-termination', '', 2, 1349763799, '', 15),
(562, 'secondary', '', 18, '<p>Dying without a will is called dying “intestate”. If you die “intestate”, state law will determine what happens to your property. In most states, your property will go to your wife and children. If you do not have any, the property will go to your next surviving relative, such as your siblings, grandparents, aunts or uncles, etc.</p><p>For same-sex marriages (relationships), your surviving partner will not receive anything unless you are living in a registered domestic partner state that lets same-sex couples inherit like spouses.</p>', 'What Happens if I Die Without a Will?', 7, '', 'what-happens-if-i-die-without-a-will', '', 6, 1350372408, '', 5),
(557, 'secondary', '', 14, '<p>Some states (Arizona, California, Idaho, Louisiana, Nevada, New Mexico, Texas, and Washington) generally classify any property acquired during the marriage as “community property.” This means that each spouse owns part of the property. For example, things you buy or money you make during marriage is probably community property.</p>\n<p>Typically, community property is divided equally. Most states, however, will divide the property fairly by taking into consideration factors such as each spouse’s current income and future earning potential. For example, if your wife has been a homemaker all her life and is dependent on your for income, the court may award her more community property in order to make things fair.</p>', 'What is Community Property?', 12, '', 'what-is-community-property', '', 0, 1349830527, '', 12),
(558, 'primary', 'http://www.courts.ca.gov/1070.htm', 49, '<p>Filing for an expungement is one way to clear your criminal record of a prior conviction. You may be eligible for an expungement in two situations. If you are not eligible, there are other ways you can clear your record.</p>\n<p><b>Received Probation</b> – If you received probation for a criminal conviction, you may be eligible to clear your record with an expungement. The following conditions must be satisfied.</p> \n1. You successfully completed probation or were released early.\n<br/>\n2. You have paid all fines ordered by the court as part of your sentence.\n<br/>\n3. You are not currently serving another sentence.\n<br/>\n4. You are not currently on probation for another crime.\n<br/>\n5. You are not currently charged with another crime.\n<p><b>No Probation</b> – If you never received probation for your criminal conviction, you may be eligible to clear your record with an expungment if the following conditions are met.</p> \n1. Your crime was a misdemeanor or an infraction.\n<br/>\n2. It has been at least 1 year since the date you were convicted.\n<br/>\n3. You have complied with the court’s sentence.\n<br/>\n4. You are not currently serving another sentence.\n<br/>\n5. You are not currently charged with another crime. \n<br/>\n6. You have obeyed the law and lived an honest and upright life since the conviction.\n', 'California Expungement Eligibility ', 15, '', 'california-expungement-eligibility', '', 0, 1349835304, '', 18),
(560, 'secondary', '', 38, '<p>As the owner of a business, one way to protect yourself from personal liability is to incorporate. But a judge may still hold you personally liable if you fail to follow corporate formalities. “<b>Piercing the corporate veil</b>” is a way for a court to reach your personal assets in paying off any creditors or judgments against you. Here are some situations in which a court might “pierce the corporate veil” of your company:</p>\n-Your business is a closely held corporation.\n<br/>\n-Your company harmed a person under tort laws (negligence, assault, defamation).\n<br/>\n-Company insiders fail to follow corporate formalities.\n<br/>\n-Company insiders mixed business assets and affairs with personal assets and affairs.\n<br/>\n-Company insiders did not place enough assets under the company (e.g. insurance policy, buildings, money in the bank).\n<br/>\n-Company insiders deceived creditors.\n', 'What is Piercing the Corporate Veil?', 0, '', 'what-is-piercing-the-corporate-veil', '', 7, 1350245682, '', 12),
(561, 'secondary', '', 38, '<p>Both corporations and LLCs should take care to observe corporate formalities. Not doing so could result in the owners being personally liable for the company’s debt, including any court judgements. Here are some corporate formalities that an owner should practice diligently:</p>\n\n<b>Separate Bank Account</b>.  Keep a separate business account and do not commingle assets.\n<br/>\n<b>Limit Debt Guarantees</b>.  If too many owners are guaranteeing debts regularly, these owners could be seen as “alter egos” of the company. As a result, a court could say that a corporation has lost its status as a separate entity and hold the owners directly liable.\n<br/>\n<b>Board of Directors Meetings</b>.  These are formal meetings where the corporation’s directors decide important strategic decision. Every state requires a corporation’s board of directors to meet at least once a year.\n<br/> \n<b>Meeting Minutes</b>.  Keep records and notes of all your board of directors, shareholders, and member (for LLCs) meetings.\n<br/>\n<b>Bylaws</b>.  Create a set of rules that govern how your business will operate.\n<br/>\n<b>Keep Good Records</b>.  Keep records of all transactions, file taxes appropriately, and get all necessary permits and licenses.\n\n<p>This list is not exhaustive, but it is vital to maintaining corporate protection from personal liability. Any claim against your company in which the claimant is arguing for personally liability will hinge on facts that are unique to your situation. Following the list above, using your good and honest judgment, and seeking advice from a lawyer will help you minimize the risk of personal liability.</p>', 'Observing Corporate Formalities', 1, '', 'observing-corporate-formalities', '', 7, 1350246175, '', 21),
(563, 'secondary', '', 10, '<p>There is no formula that determines how much money you can get in a car accident negligence lawsuit because the specific facts of each case are different. However, there are a few methods you can use to get a ballpark estimate of how much you could potentially recover. Depending on the amount of damage, fender benders may be worth $500-$3000 and major accident may be worth $15,000-$35,000.</p>\n<p>One method is to add up all the expenses incurred due to the accident. In most situations this will include your medical bills, auto-repair bills, lost wages, and cost of any alternate transportation. Be sure to save all bills and receipts as evidence. For example, if you had $4000 in medical bills, $2000 in car repairs, $1000 of lost wages because you missed a week of work, and $1000 in alternate transportation because you had to rent a car for a month to get to your job, you can probably recover at least $8000. What really makes a car accident claim valuable is <a href="http://www.myright.me/car-accident/what-is-pain-and-suffering">pain and suffering</a>.</p>\n<p>Since the insurance company wants to give you as little money as possible, it may try to argue that your medical bills are high because you received unnecessary treatment, or that you were healthy enough to go to work. However, if simply followed your doctor’s recommendations for treatments and missing work, then you should be able to recover money for all your medical bills and lost wages caused by the car accident.</p>\n', 'Average Car Accident Settlement ', 0, '', 'average-car-accident-settlement', '', 0, 1350617174, '', 4),
(564, 'secondary', '', 10, '<p>In car accident cases there are two types of damages you can recover: economic and non-economic. <b>Economic damages</b> include medical bills, lost wages, auto-repairs, and alternate transportation. They are easy to calculate; all you have to do is add up any bills and receipts. <b>Non-economic</b> damages are harder to calculate and include pain and suffering, loss of enjoyment, and emotional distress.</p> \n<b>Example 1</b>. You go to a hospital and find out you have fractured ribs caused by a car accident. Since there is no real treatment for fractured ribs but time, you only have a medical bill for the x-rays, which is about $600. It takes four to six weeks for fractured ribs to heal and in that time you experience a great deal of pain because every time you breathe in, pressure is put on your ribs. Clearly you deserve more than $600 in this case and you might be able to recover 4-10 times more.\n<br/><br/> \n<b>Example 2</b>. You go to a hospital because you are experience chest pain after an accident. After x-rays and MRI, you find out you only had a bruise. Your bruise heals in 2 weeks with little trouble, but your medical bills are $3000 (for all the tests). The amount you can recover for pain and suffering will probably be very little in this case.\n<p>Given the subjective nature of pain and suffering, it is difficult to predict how much a car accident case is really worth. However, there are several factors and methods used to <a href="http://www.myright.me/car-accident/how-to-calculate-pain-and-suffering">calculate pain and suffering</a>.</p>', 'Formula for Car Accident Settlements', 0, '', 'formula-for-car-accident-settlements', '', 0, 1350617530, '', 2),
(565, 'secondary', '', 10, '<p><b>Pain and suffering</b> is the physical or emotional distress resulting from an injury. This may include headaches, disfigurement, nausea, radiating pain, muscle spasms, scarring, shortening of life, anxiety, depression, embarrassment, or limitations on activities and hobbies.</p>\n<b>Example 1</b>. You receive a face injury from a car accident, which leaves a giant scar extending from your cheek to your forehead. The disfigurement is unpleasant and causes you a great deal of social anxiety. You become depressed and rarely leave your home. Although you do not have any bills or receipts for your depression, you can still recover some money because this is considered pain and suffering. \n<br/><br/>\n<b>Example 2</b>. A whiplash injury causes you great pain in your neck and back area. The pain is so bad that you have trouble sleeping for the next 2 months. Although you don’t have any “expenses” for your lack of sleep, this type of pain and suffering may be compensable. \n<p>Since pain and suffering is somewhat subjective, it is difficult to calculate damages precisely. In most cases you can recover a lot more money for pain and suffering than for physical injuries and lost wages. There are a few methods used to <a href="http://www.myright.me/car-accident/how-to-calculate-pain-and-suffering">estimate pain and suffering</a>.</p>', 'What is Pain and Suffering?', 0, '', 'what-is-pain-and-suffering', '', 0, 1350617690, '', 5),
(566, 'secondary', '', 10, '<p>The dollar value of <a href="http://www.myright.me/car-accident/what-is-pain-and-suffering">pain and suffering</a> depends on many factors including, severity of the injury and pain, type of treatment received, length of recovery, and effects of the injury including headaches, disfigurement, nausea, radiating pain, muscle spasms, and shortening of life. In additional to physical pain, there is emotional distress such as anxiety, depression, embarrassment, and interference with work and hobbies. Although pain and suffering is subjective, there are a couple methods used to calculate it.</p>\n<b>Multiplier</b>. One common method used to calculate pain and suffering is to multiply you known economic damages, such as your medical bills and lost wages, by a multiplier. Usually the multiplier will be a number between 1.5 and 4, depending on a variety of factors including the seriousness of your injuries, length of recovery, the presence of permanent injuries, and any aggravating circumstances. <b>For example</b>, if your medical bills were $2000 and your lost wages were $1000 because you missed a week of work, then your total economic damages were $3000. This number is then multiplied to determine your pain and suffering. You could potentially recover up to $12,000 (multiplied by 4) or more, if your injuries were severe. \n<br/><br/>\n<b>Per Diem</b>. Another method used is to assign a “per day” value to your pain and suffering. Multiply the per-day value by how many days it took for you to recover or complete treatment. One way to come up with a per-day value is to use your actual income. <b>For example</b>, if you are paid $120 per day for your job and were in treatment for 30 days, your pain and suffering equals $3600 according to this method. This method may be used to justify getting a higher award, but it’s probably not a good idea to use it if you don’t make much money. ', 'How to Calculate Pain and Suffering?', 0, '', 'how-to-calculate-pain-and-suffering', '', 0, 1350620461, '', 6),
(567, 'secondary', '', 10, '<p>Lost wages include the loss of present earnings and future lost income. In order to recover money for these loses, they must be caused by the car accident injury. Here are some examples of lost wages that can be compensated.</p>\n<b>Missed days</b>. Missing some days of work due to a car accident is the most common type of lost wages that can be claim. For example, if you usually get paid $1000 a week and you missed 2 weeks of work because you were recovering in the hospital, you can claim $2000 in lost wages. \n<br/><br/> \n<b>Hours reduced</b>. Reduced hours due to an injury may be claimed as future lost income. For example, you usually work 40 hours a week, but since the accident you can only work 20 hours because of your injuries. You may be able to claim the lost 20 hours per week of work as lost future earnings. \n<br/><br/> \n<b>Denied promotion</b>. A denied promotion may be claimed as future lost income. If you were expecting a promotion, but were denied because your injuries made you inadequate for the position, then you might be able to claim the different between the position’s salary and your current salary. For example, if you were denied a promotion to head chef for a salary of $62,000, and your current salary is $50,000, you might be able to claim $12,000 a year. However, it may be difficult to prove that the car accident caused your promotion denial. \n<br/><br/>\n<b>Unable to take a job</b>. The inability to take a new job may be claimed as future lost income. However, similar to a denied promotion, you must be able to show a connection between the car accident and the loss of the new job. IF the causation is too far removed, you won’t be able to claim this. \n<br/><br/>\n<b>Hindered training or education</b>. Injuries from a car accident might reduce overall your future earning potential. For example, the inability to start a training or education program may be claimed as future lost income because usually such training or education is for the purpose of obtaining a job. You might be able to claim the accident caused you to miss out on some education program, which in turn caused you to loss a good job. However, this conjecture is even more speculative than a denied promotion, and it will be difficult to establish causation. \n', 'What are Lost Wages?', 0, '', 'what-are-lost-wages', '', 0, 1350630169, '', 2),
(568, 'secondary', '', 18, '<p>A <b>revocable living trust</b> is a legal device that a lot of people use to avoid probate. It acts as an entity that gives instructions to a person (the trustee) to distribute the property as desired by the person who created the trust (executor). In other words, imagine a trust as a bubble that cannot be touched by probate court. While you are living, you put property into the bubble. You then give someone you trust (the trustee) instructions on how to distribute your property from the bubble to other people after you die. While your property is in this bubble, you can still use it however you like. That is basically how a trust works. As complicated as it sounds, setting up a living trust is relatively easy.</p> \n<b>First</b>, create a document that includes: the list of property you''d like to give, who gets what property, the person that will be distributing the property (trustee), and any other requests that you have regarding the distribution of the property.  \n<br/><br/>\n<b>Second</b>, execute the document with a notary public. A notary public is a public officer who can make sure your trust is authentic. \n<br/><br/>\n<b>Third</b>, most property listed in the document will automatically be transferred to the trust. However, for real property you must prepare and sign a new deed that changes the title and transfers the real property to the trust.\n<p>There are advantages of creating a revocable living trust versus a will.  A trust will avoid probate, saving you from legal and administrative fees, which can be as high as 5% of your property''s value.  Also, in certain circumstances, a trust will save you from more taxes and maintain more privacy than a will can.</p>\n', 'What is a Revocable Living Trust?', 0, '', 'what-is-a-revocable-living-trust', '', 0, 1350631687, '', 4),
(569, 'secondary', '', 18, '<p>A <b>“pay-on-death” account</b> or “payable-on-death bank accounts” is one way to avoid probate.  If you set up a pay-on-death account, when you die, the person who you name as your beneficiary (person benefiting) will receive your bank account or certificate of deposit. The beneficiary will literally get paid on your death.  The only disadvantage is that you cannot name multiple beneficiaries.</p>\n<p>A pay-on-death account is very easy to set up.  You simply contact your bank and follow their procedures.</p>\n', 'What is a Pay-on-death Account?', 0, '', 'what-is-a-pay-on-death-account', '', 0, 1350632283, '', 2),
(570, 'secondary', '', 18, '<p>Joint ownership of property (or joint tenancy) is a type of way of owning real property and is also a way to avoid getting real property tangled in probate court. If you and other persons choose to take a property as joint tenants, the lawyer or real estate agent will include all of your names on the title/deed. With joint tenancy, when one person on the deed dies, the property does not transfer to his or her heirs. Instead that person''s share of the property is transferred to the other people on the deed.</p>\n<p>Joint tenancy is most commonly used when married couples decide to buy property. For example, if you and your spouse buy a home, you may decide to create a joint ownership of the property. That way if you pass before your spouse, he or she will get the property. This is convenient if you would have transferred the property to your spouse anyways.</p>', 'What is Joint Ownership of Property?', 0, '', 'what-is-joint-ownership-of-property', '', 0, 1350632778, '', 2);
