(1, 1, 'MB', 'PLACEHOLDER2', '', 4, 'TEST,,', '', 0, ''),
(3, 1, 'MB', 'PLACEHOLDER2', '', 4, 'TEST,,', '', 0, ''),
(4, 1, 'MB', '', '', 5, '0', '', 0, ''),
(7, 2, 'MB', 'Are you raising money from investors in exchange for equity?', '', 1, 'Yes,Compensate,,|No,Both1,,', '', 0, ''),
(9, 2, 'MB', 'Do you plan to compensate your investors primarily with eventual sale or company profits?', 'Compensate', 2, 'Sale/IPO,Corp1,,|Profits,LLC1,,|I don&#39;t know,Corp1,,', '', 0, ''),
(10, 2, 'EX', '<b>Corporation</b><br/><br/>If you plan on raising money from a sale or IPO&#44; then you should probably form a corporation. If you&#39;re looking for VC or angel money&#44; a Delaware C-Corporation is probably best. This is because the C&ndash;corporation is usually the most predictable structure and is easier on investors. ', 'Corp1', 3, 'Continue,,,', '', 0, ''),
(11, 2, 'EX', '<b>LLC</b><br/><br/>If you plan to compensate investors primarily with cash from company profits&#44; then you might what to form an LLC. The reason for this is that LLCs are flow&ndash;through entities&#44; meaning that earnings are only taxed once before reaching owners&#39; bank accounts. However&#44; investors may not want to deal with income and filings that come with owning an LLC.', 'LLC1', 4, 'Continue,,,', '', 0, ''),
(12, 2, 'MB', 'Do you plan to pay any employee&#44; advisor&#44; or contractor with stock options or equity?', '', 6, 'Yes,Corp2,,|No,LLC2,,', '', 0, ''),
(13, 2, 'EX', '<b>Corporation</b><br/><br/>If you plan on giving people stock options&#44; then a Corporation might be better for your business. Stock option pools are standard for corporations but not for LLCs.', 'Corp2', 7, 'Continue,,,', '', 0, ''),
(14, 2, 'EX', '<b>LLC</b><br/><br/>If you plan on paying people only with cash&#44; then a LLC might be better for you business. LLCs are generally easier to manage and more flexible.', 'LLC2', 8, 'Continue,,,', '', 0, ''),
(15, 2, 'MB', 'Will your company hold real property?', '', 9, 'Yes,LLC3,,|No,Both2,,', '', 0, ''),
(16, 2, 'EX', '<b>LLC</b><br/><br/>LLCs may be better for businesses that plan to hold real estate. You can create a separate LLC solely for the purpose of holding property.', 'LLC3', 10, 'Continue,,,', '', 0, ''),
(17, 2, 'EX', '<b>Either</b><br/><br/>If you don&#39;t plan on raising money from investors in exchange for ownership of your company&#44; then an either LLC or Corporation is good.', 'Both1', 5, 'Continue,,,', '', 0, ''),
(18, 2, 'EX', '<b>Either</b><br/><br/>If your business does not plan on holding property&#44; either a LLC or Corporation is good. ', 'Both2', 11, 'Continue,,,', '', 0, ''),
(20, 3, 'MB', 'Do you plan on keeping your business small or do you want to make it big?', '', 1, 'Big,Big,|Small,Small,', '', 0, ''),
(21, 3, 'MB', 'If you plan on growing and expanding your business, the benefits of incorporating in Delaware are outweigh any initial costs. For more information on Delaware Corporations, please click "Delaware."  ', 'Big', 2, 'Delaware,,startup/delaware', '', 0, ''),
(22, 3, 'MB', 'If you plan on being a small business, it might be better to incorporate in your home state.', 'Small', 3, '0', '', 0, ''),
(23, 4, 'MC', 'In the past 10 years&#44; how many times have you been convicted of drunk driving?', '', 3, 'This is my first,First,penalties|One time before,Second,penalties|Two times before,Third,penalties|Three or more times before,More,penalties', '', 0, ''),
(24, 4, 'EX', '<b>Possible Penalty</b><br/><br/>Jail - 4 days to 6 months<br/>Fines - $390 to $1000<br/>License Suspension - 30 days to 10 months', 'First', 4, 'Continue,,,', '', 0, ''),
(25, 4, 'MB', 'Did you get arrested within the last 10 days?', '', 8, 'Yes,DMV1,dmv|No,DMV2,', '', 0, ''),
(26, 4, 'EX', '<b>DMV Suspension</b><br/><br/>You have a right to fight your license suspension. To do this you must request a DMV hearing within 10 days of your arrest. A DUI attorney will file this request for you and represent you in the process. ', 'DMV1', 9, 'Continue,,', '', 0, ''),
(27, 4, 'MC', 'After you were arrested&#44; did you take a breath&#44; blood&#44; or urine test?', '', 11, 'Yes,Chemical,|No&#44; refused,Refusal,refusal|No&#44; not given,,', '', 0, ''),
(28, 4, 'MB', 'Which one of the following tests did you take?', 'Chemical', 12, 'Breath,Breath,breath-test|Blood,,blood-test|Both,Breath,breath-test', '', 0, ''),
(29, 4, 'MB', 'Did you burp&#44; vomit&#44; smoke&#44; regurgitate&#44; drink&#44; smoke&#44; or eat 15 minutes before the breathalyzer?', 'Breath', 13, 'Yes,Inaccurate,breath-test|No,,', '', 0, ''),
(30, 4, 'EX', '<b>Inaccurate BAC</b><br/><br/>Your BAC results may be inaccurate. When you burp&#44; vomit&#44; regurgitate&#44; drink&#44; smoke&#44; or eat&#44; a tiny amount of alcohol was probably introduced to your mouth. Since the breathalyzer machine assumes that it is only measuring your breath alcohol&#44; a tiny amount of mouth alcohol may have produced an inaccurate BAC measurement. Other conditions that may increase your mouth alcohol or register an inaccurate measurement include dentures&#44; diabetes&#44; and the use of alcohol&ndash;containing products such as mouthwash&#44; breath spray&#44; and cough syrup.', 'Inaccurate', 14, 'Continue,,', '', 0, ''),
(31, 4, 'MC', 'What was your BAC?', 'Chemical', 15, 'Less than 0.15%,Rising,bac|0.15% or greater,High BAC,bac|I don&#39;t know,,', '', 0, ''),
(32, 4, 'MB', 'Did you drink shortly before getting arrested?', 'Rising', 16, 'Yes,Rising2,bac|No,,', '', 0, ''),
(33, 4, 'EX', '<b>&quot;Rising BAC&quot; Defense</b><br/><br/>You may have a &quot;Rising BAC Defense.&quot; What matters in a DUI case is your BAC at the time of driving&#44; not your BAC at the police station. To figure this out&#44; prosecutors will try to estimate your driving BAC. Most of the time they will estimate a BAC higher than the test results because they assume that your body was burning off alcohol between the time of arrest and testing. However&#44; this assumption is false if you had a drink shortly before being arrested and/or tested&#44; because your body was still absorbing that drink.', 'Rising2', 17, 'Continue,,', '', 0, ''),
(34, 4, 'EX', '<b>High BAC</b><br/><br/>A BAC of 0.15% or greater is an aggravating factor and may result in increased penalties.', 'High BAC', 18, 'Continue,,', '', 0, ''),
(35, 4, 'EX', '<b>Refusal</b><br/><br/>You may face automatic penalties for refusing a chemical test. This is because just by driving the law says you have given your &quot;implied consent&quot; to submit to testing if arrested for drunk driving.<br/><br/><b>Possible Penalties</b><br/><br/>First Offense - 1 year license suspension<br/>Second Offense - 2 year license suspension<br/>Third Offense - 3 year license suspension', 'Refusal', 19, 'Continue,,,', '', 0, ''),
(36, 4, 'MB', 'How were you pulled over?', '', 20, 'Traffic Stop,Traffic,evidence|DUI Checkpoint,Checkpoint,checkpoints|Accident,Accident,', '', 0, ''),
(37, 4, 'EX', '<b>Search and Seizure</b><br/><br/>You have a right to not be pulled over randomly for no reason. Police must have &quot;probable cause&quot; before pulling over a car. An officer has probable when there is a reasonable&#44; articulable suspicion that a law has been broken. In most instances&#44; breaking a traffic law is enough for a officer to legally pull you over. If an officer pulls you over illegally&#44; a lawyer will file a motion to suppress any evidence obtained from that stop and get your case dismissed.', 'Traffic', 21, 'Continue,,', '', 0, ''),
(38, 4, 'MC', 'Were you going over the speed limit?', 'Traffic', 22, 'No,,|1 to 19 mph over the limit,,|20 to 29 mph over the limit,Freeway,|30 mph over the limit,Speeding,speeding', '', 0, ''),
(39, 4, 'MB', 'Were you driving on a freeway?', 'Freeway', 23, 'Yes,,|No,Speeding,speeding', '', 0, ''),
(40, 4, 'EX', '<b>Speeding Enhancement</b><br/><br/>Driving recklessly over the speed limit may trigger an additional 60 day jail sentence. Reckless driving is driving that will probably injure someone and you are aware of that risk. The enhancement may apply if you were driving 30 mph over the speed limit on a freeway or 20 mph over the speed limit on any other road. Even if you were speeding&#44; a lawyer will argue that you were not driving recklessly.', 'Speeding', 24, 'Continue,,', '', 0, ''),
(41, 4, 'EX', '<b>DUI Checkpoints</b><br/><br/>DUI checkpoints are governed by strict rules and regulations. For example&#44; cars cannot be stopped randomly. A pre&ndash;determined formula must be followed&#44; such as every fifth car is stopped. If any of these rules are broken&#44; the checkpoint may be illegal and a lawyer will file a motion to suppress any evidence obtained from that stop and get your case dismissed. ', 'Checkpoint', 25, 'Continue,,', '', 0, ''),
(42, 4, 'MB', 'Was anyone injured?', 'Accident', 26, 'Yes,Wobbler,injury|No,,', '', 0, ''),
(43, 4, 'EX', '<b>DUI with Injury</b><br/><br/>A DUI with injury is a &quot;wobbler&quot;&#44; which means the prosecutor can charge it as a felony or misdemeanor. This usually depends on how many people were injured and how serious the injuries are. A misdemeanor DUI with injury carries 5 days to one years in jail and a fine between $390 and $5000. A felony DUI with injury carries 16 months to 10 years in prison.', 'Wobbler', 27, 'Continue,,', '', 0, ''),
(44, 4, 'MB', 'Was there a passenger under the age of 14 in the car?', '', 28, 'Yes,Minor,child-passenger|No,,', '', 0, ''),
(45, 4, 'EX', '<b>Minor Passenger</b><br/><br/>Driving with a passenger under the age of 14 is a serious issue and a 48 hour jail sentence may be imposed&#44; regardless of whether or not probation is granted. Prosecutors may choose to file child endangerment charges as well', 'Minor', 29, 'Continue,,', '', 0, ''),
(46, 1, 'EX', 'PLACEHOLDER2', '', 4, 'TEST,,', '', 0, ''),
(47, 5, 'MB', 'PLACEHOLDER2', '', 4, 'TEST,,', '', 0, ''),
(48, 5, 'MB', 'PLACEHOLDER2', '', 4, 'TEST,,', '', 0, ''),
(49, 5, 'EX', 'PLACEHOLDER2', '', 4, 'TEST,,', '', 0, ''),
(50, 5, 'MB', '', '', 5, '0', '', 0, ''),
(51, 4, 'MB', 'Were you under 21 when you were arrested?', '', 1, 'Yes,Under 21,under-21|No,,', '', 0, ''),
(52, 4, 'EX', '<b>Under 21</b><br/><br/>California has a zero&ndash;tolerance policy towards underage drinking and driving. If your BAC was less than 0.08%&#44; you may receive an infraction&#44; which means the maximum penalty is a fine. You may also lose your driver&#39;s license for up to a year. If your BAC was 0.08% or greater&#44; you may be charged with a normal DUI.', 'Under 21', 2, 'Continue,,', '', 0, ''),
(53, 6, 'MB', 'Were you under 21 when you were arrested?', '', 1, 'Yes,Under 21,under 21|No,,', '', 0, ''),
(54, 6, 'EX', '<b>Under 21</b><br/><br/>The main difference between a DUI and DWI in Texas is that a DUI is only available to someone under the age of 21. A person under 21 will be charged with a DUI if he or she has a BAC under 0.08%. Otherwise that person will be charged with a DWI and face the same consequences as an adult. A DWI imposes a harsher sentence than a DUI. However&#44; it is easier to be convicted of a DUI because all that is necessary is that the officer detected some amount of alcohol.', 'Under 21', 2, 'Continue,,,', '', 0, ''),
(55, 6, 'MC', 'In the past 10 years, how many times have you been convicted of drunk driving?', '', 3, 'This is my first,First,penalties|One time,Second,penalties|Two or more times,Third,penalties', '', 0, ''),
(56, 6, 'EX', '<b>Possible Penalty</b></br><br/>Jail &ndash; 3 days to 180 days<br/>Fines &ndash; up to $2000<br/>License Suspension &ndash; 90 days to 1 year', 'First', 4, 'Continue,,,', '', 0, ''),
(57, 6, 'MB', 'Did you get arrested with the last 15 days?', '', 7, 'Yes,DMV5,,|No,,,', '', 0, ''),
(58, 6, 'EX', '<b>DMV Hearing</b><br/><br/>You have a right to fight your license suspension. To do this you must send a request for a hearing to Texas Department of Public Safefy within 15 days of your arrest. A DWI/DUI attorney will file this request for you and represent you in the process.', 'DMV5', 8, 'Continue,,,', '', 0, ''),
(59, 6, 'MB', 'After you were arrested&#44; did you take a breath&#44; blood&#44; or urine test?', '', 9, 'Yes,Chemical,|No refused,Refusal,refusal|No not given,,', '', 0, ''),
(60, 6, 'MB', 'Which one of the following tests did you take?', 'Chemical', 10, 'Breath,Breath,breath test|Blood,,blood test|Both,Breath,breath test', '', 0, ''),
(61, 6, 'MB', 'Did you burp, vomit, smoke, regurgitate, drink, smoke, or eat 15 minutes before the breathalyzer?', 'Breath', 11, 'Yes,Inaccurate,inaccurate|No,,', '', 0, ''),
(62, 6, 'EX', '<b>BAC tests</b><br/><br/>Your BAC results may be inaccurate. When you burp&#44; vomit&#44; regurgitate&#44; drink&#44; smoke&#44; or eat&#44; a tiny amount of alcohol was probably introduced to your mouth. Since the breathalyzer machine assumes that it is only measuring your breath alcohol&#44; a tiny amount of mouth alcohol may have produced an inaccurate BAC measurement. Other conditions that may increase your mouth alcohol or register an inaccurate measurement include dentures&#44; diabetes&#44; and the use of alcohol&ndash;containing products such as mouthwash&#44; breath spray&#44; and cough syrup.', 'Inaccurate', 12, 'Continue,,,', '', 0, ''),
(63, 6, 'MC', 'What was your BAC?', 'Chemical', 13, 'Less than 0.15%,Rising,bac|0.15% or greater,High BAC,bac|I don&#039;t know,,', '', 0, ''),
(64, 6, 'MB', 'Did you drink shortly before getting arrested?', 'Rising', 14, 'Yes,Rising2,rising bac defense|No,,', '', 0, ''),
(65, 6, 'EX', '<b>Rising BAC Defense</b><br/><br/>You may have a &quot;Rising BAC Defense.&quot; What matters in a DUI/DWI case is your BAC at the time of driving&#44; not your BAC at the police station. To figure this out&#44; prosecutors will try to estimate your driving BAC. Most of the time they will estimate a BAC higher than the test results because they assume that your body was burning off alcohol between the time of arrest and testing. However&#44; this assumption is false if you had a drink shortly before being arrested and/or tested&#44; because your body was still absorbing that drink. This is called the &quot;Rising BAC defense&quot; and it might be used to help your case.	', 'Rising2', 15, 'Continue,,,', '', 0, ''),
(66, 6, 'EX', '<b>High BAC</b><br/><br/>If you have a BAC of 0.15% or higher&#44; a DWI may be charged as a class A misdemeanor for the first offense. A class A misdemeanor imposes a jail sentence up to 1 year and a fine up to $4000. ', 'High BAC', 16, 'Continue,,,', '', 0, ''),
(67, 6, 'EX', '<b>Refusal</b><br/><br/>You may face automatic penalties for refusing a chemical test. This is because just by driving the law says you have given your &quot;implied consent&quot; to submit to testing if arrested for drunk driving.<br/>First Offense - 180 day license suspension<br/>Second Offense - 2 year license suspension<br/>Third Offense - 2 year license suspension', 'Refusal', 17, 'Continue,,,', '', 0, ''),
(68, 6, 'MB', 'How were you pulled over?', '', 18, 'Traffic Stop,Traffic,evidence|Accident,Accident,', '', 0, ''),
(69, 6, 'EX', '<b>Traffic Stop</b><br/><br/>You have a right to not be pulled over randomly for no reason. Police must have &quot;probable cause&quot; before pulling over a car. An officer has probable when there is a reasonable&#44; articulable suspicion that a law has been broken. In most instances&#44; breaking a traffic law is enough for a officer to legally pull you over. If an officer pulls you over illegally&#44; a lawyer will file a motion to suppress any evidence obtained from that stop and get your case dismissed.', 'Traffic', 19, 'Continue,,,', '', 0, ''),
(74, 6, 'MB', 'Was anyone injured?', 'Accident', 20, 'Yes,Wobbler,injury|No,,', '', 0, ''),
(75, 6, 'EX', '<b>Accident</b><br/><br/>A DUI/DWI with injury may be charged as Intoxication Assault&#44;  which is a third degree felony for the first conviction. The injury must be serious&#44; such that it creates a substantial risk of death or that causes serious permanent disfigurement or loss of the function of a body part or organ. You may receive 2 to 10 years of jail time and a fine up to $10&#44;000. If someone died from the accident&#44; the penalties may be harsher.', 'Wobbler', 21, 'Continue,,,', '', 0, ''),
(76, 6, 'MB', 'Was there a passenger under the age of 15 in the car?', '', 22, 'Yes,Minor,child passenger|No,,', '', 0, ''),
(77, 6, 'EX', '<b>Child Passenger</b><br/><br/>A DWI with a passenger under the age of 15 is a state jail felony in Texas. A state jail felony carries a sentence between 180 days and 2 years and a fine up to $10&#44;000.', 'Minor', 23, 'Continue,,,', '', 0, ''),
(78, 6, 'MB', 'Did you have an open container in the car? ', '', 24, 'Yes,Container,|No,,', '', 0, ''),
(79, 6, 'EX', '<b>Open Container</b><br/><br/>A DWI may be charged as a class B misdemeanor if an open container of alcohol was found in the car. You may face 6 to 180 days in jail and a fine up to $2000 for a first conviction.  ', 'Container', 25, 'Continue,,,', '', 0, ''),
(80, 7, 'MB', 'Were you under 21 when you were arrested?', '', 1, 'Yes,Under 21,under 21|No,,', '', 0, ''),
(81, 7, 'EX', '<b>Under 21</b><br/><br/>Florida has a zero&ndash;tolerance policy towards underage drinking and driving. If your BAC was less than 0.08%&#44; you may receive 180 day license suspension for the first offense. If your BAC was 0.08% or greater&#44; you may be charged with a normal DUI.', 'Under 21', 2, 'Continue,,,', '', 0, ''),
(84, 7, 'MB', 'Were you arrested with in the last 10 days?', '', 3, 'Yes,DMV5,,|No,,,', '', 0, ''),
(85, 7, 'EX', '<b>DMV Hearing</b><br/><br/>You have a right to fight your license suspension. To do this you must request a DMV Administrative Review hearing within 10 days of your arrest. A DUI attorney will file this request for you and represent you in the process. ', 'DMV5', 4, 'Continue,,,', '', 0, ''),
(86, 7, 'MB', 'After you were arrested&#44; did you take a breath&#44; blood&#44; or urine test?', '', 5, 'Yes,Chemical,|No refused,Refusal,refusal|No not given,Priors,', '', 0, ''),
(87, 7, 'MB', 'Which one of the following tests did you take?', 'Chemical', 6, 'Breath,Breath,breath test|Blood,,blood test|Both,Breath,breath test', '', 0, ''),
(88, 7, 'MB', 'Did you burp, vomit, smoke, regurgitate, drink, smoke, or eat 15 minutes before the breathalyzer?', 'Breath', 7, 'Yes,Inaccurate,inaccurate|No,,', '', 0, ''),
(89, 7, 'EX', '<b>BAC Test</b><br/><br/>Your BAC results may be inaccurate. When you burp&#44; vomit&#44; regurgitate&#44; drink&#44; smoke&#44; or eat&#44; a tiny amount of alcohol was probably introduced to your mouth. Since the breathalyzer machine assumes that it is only measuring your breath alcohol&#44; a tiny amount of mouth alcohol may have produced an inaccurate BAC measurement. Other conditions that may increase your mouth alcohol or register an inaccurate measurement include dentures&#44; diabetes&#44; and the use of alcohol&ndash;containing products such as mouthwash&#44; breath spray&#44; and cough syrup.', 'Inaccurate', 8, 'Continue,,,', '', 0, ''),
(90, 7, 'MC', 'What was your BAC?', 'Chemical', 9, 'Less than 0.15%,Rising,bac|0.15% or greater,High BAC,bac|I don&#39;t know,,', '', 0, ''),
(91, 7, 'MB', 'Did you drink shortly before getting arrested?', 'Rising', 10, 'Yes,Rising2,rising bac defense|No,Minors,', '', 0, ''),
(92, 7, 'EX', '<b>Rising BAC Defense</b><br/><br/>You may have a &quot;Rising BAC Defense.&quot; What matters in a DUI case is your BAC at the time of driving&#44; not your BAC at the police station. To figure this out&#44; prosecutors will try to estimate your driving BAC. Most of the time they will estimate a BAC higher than the test results because they assume that your body was burning off alcohol between the time of arrest and testing. However&#44; this assumption is false if you had a drink shortly before being arrested and/or tested&#44; because your body was still absorbing that drink. This is called the &quot;Rising BAC defense&quot; and it might be used to help your case. ', 'Rising2', 11, 'Continue,Minors,,', '', 0, ''),
(93, 7, 'MC', 'How many times have you been convicted of drunk driving in the past?', 'High BAC', 16, 'This is my first,First1,penalties|One time,Second1,penalties|Two times,Third1,penalties|Three or more times,More,penalties', '', 0, ''),
(94, 7, 'EX', '<b>Refusal</b><br/><br/>You may face automatic penalties for refusing a chemical test. This is because just by driving the law says you have given your &quot;implied consent&quot; to submit to testing if arrested for drunk driving.<br/>First Offense - 1 year license suspension<br/>Second Offense - 18 month license suspension<br/>Third Offense - 18 month license suspension', 'Refusal', 12, 'Continue,Second Refusal,,', '', 0, ''),
(95, 7, 'MB', 'How were you pulled over?', '', 25, 'Traffic Stop,Traffic,evidence|DUI Checkpoint,Checkpoint,checkpoints|Accident,Accident,', '', 0, ''),
(96, 7, 'EX', '<b>Traffic Stop</b><br/><br/>You have a right to not be pulled over randomly for no reason. Police must have &quot;probable cause&quot; before pulling over a car. An officer has probable when there is a reasonable&#44; articulable suspicion that a law has been broken. In most instances&#44; breaking a traffic law is enough for a officer to legally pull you over. If an officer pulls you over illegally&#44; a lawyer will file a motion to suppress any evidence obtained from that stop and get your case dismissed.', 'Traffic', 26, 'Continue,,,', '', 0, ''),
(100, 7, 'EX', '<b>DUI Checkpoints</b><br/><br/>DUI checkpoints are governed by strict rules and regulations. For example&#44; cars cannot be stopped randomly. A pre&ndash;determined formula must be followed&#44; such as every fifth car is stopped. If any of these rules are broken&#44; the checkpoint may be illegal and a lawyer will file a motion to suppress any evidence obtained from that stop and get your case dismissed. ', 'Checkpoint', 27, 'Continue,,,', '', 0, ''),
(101, 7, 'MB', 'Was anyone injured?', 'Accident', 28, 'Yes,Wobbler,injury|No,,', '', 0, ''),
(102, 7, 'EX', '<b>Accident</b><br/><br/>A DUI with injury is a misdemeanor of the first degree&#44; which carries a possible jail sentence up to 1 year and a fine up to $1000. A DUI with serious bodily injury is a felony of the third degree&#44; which carries a possible jail sentence up to 5 years and a fine up to $5000. Serious bodily injury include substantial risk of death&#44; serious personal disfigurement&#44; or loss or impairment of bodily functions.', 'Wobbler', 29, 'Continue,,,', '', 0, ''),
(103, 7, 'MB', 'Was there a passenger under the age of 14 in the car?', 'Minors', 15, 'Yes,High BAC,child passenger|No,Priors,', '', 0, ''),
(105, 4, 'EX', '<b>Possible Penalty</b><br/><br/>Jail - 10 days to 1 year<br/>Fines - $1800 to $2800<br/>License Suspension - 2 years', 'Second', 5, 'Continue,,', '', 0, ''),
(106, 4, 'EX', '<b>Possible Penalty</b><br/><br/>Jail - 120 days to 1 year<br/>Fines - $1800 to $18000<br/>License Suspension - 3 years', 'Third', 6, 'Continue,,', '', 0, ''),
(107, 4, 'EX', 'If you have had 3 or more separate DUI convictions in the past 10 years&#44; this offense will most likely be charged as a felony.<br/><br/><b>Possible Penalties</b><br/><br/>Jail - up to 3 years<br/>License Suspension - 4 years or more', 'More', 7, 'Continue,,,', '', 0, ''),
(108, 6, 'EX', '<b>Possible Penalty</b></br><br/>Jail &ndash; 30 days to 1 year<br/>Fines &ndash; up to $4000<br/>License Suspension &ndash; 180 days to 2 year', 'Second', 5, 'Continue,,,', '', 0, ''),
(109, 6, 'EX', '<b>Possible Penalty</b></br><br/>If you have had 2 or more separate DWI convictions in the past 10 years&#44; this offense will most likely be charged as a felony.<br/>Jail - 2 years<br/>Fines - up to $10000<br/>License Suspension - 180 days to 2 years', 'Third', 6, 'Continue,,,', '', 0, ''),
(110, 7, 'MC', 'How many times have you been convicted of drunk driving in the past?', 'Priors', 20, 'This is my first,First2,|One time,Second2,|Two times,Third2,|Three or more times,More,', '', 0, ''),
(111, 7, 'EX', '<b>Possible Penalty</b><br/><br/>Jail - up to 9 months<br/>Fines - $1000 to $2000<br/>License Suspension - 180 days to 1 year', 'First1', 17, 'Continue,,,', '', 0, ''),
(112, 7, 'EX', '<b>Possible Penalty</b><br/><br/>Jail - up to 1 year&#44; unless you&#39;ve had another DUI in the past 5 years&#44; then 10 days mandatory<br/>Fines - $2000 to $4000<br/>License Suspension - 1 year&#44; unless this DUI is within 5 year of a previous DUI conviction&#44; then 5 years', 'Second1', 18, 'Continue,,,', '', 0, ''),
(113, 7, 'EX', '<b>Possible Penalty</b><br/><br/>Jail - up to 1 year (mandatory 30 days if this is your third conviction within 10 years)<br/>Fines - $4000 minimum<br/>License Suspension - 2 years&#44; unless this is your third conviction with 10 years&#44; then 10 years', 'Third1', 19, 'Continue,,,', '', 0, ''),
(114, 7, 'EX', '<b>Possible Penalty</b><br/><br/>Jail - up to 5 years<br/> Fines - $2000 minimum<br/>License Suspension - for life', 'More', 24, 'Continue,,,', '', 0, ''),
(115, 7, 'EX', '<b>Possible Penalty</b><br/><br/>Jail - up to 6 months<br/>Fines - $500 to $1000<br/>License Suspension - 180 days to 1 year', 'First2', 21, 'Continue,,,', '', 0, ''),
(116, 7, 'EX', '<b>Possible Penalty</b><br/><br/>Jail - up to 9 months&#44; unless you&#39;ve had another DUI in the past 5 years&#44; then 10 days mandatory<br/>Fines - $1000 to $2000<br/>License Suspension - 1 year&#44; unless you&#39;ve had another DUI in the past 5 years&#44; then 5 years', 'Second2', 22, 'Continue,,,', '', 0, ''),
(117, 7, 'EX', '<b>Possible Penalty</b><br/><br/>Jail - up to 1 year (mandatory 30 days if this is your third conviction within 10 years)<br/>Fines - $2000 to $5000<br/>License Suspension - 2 years&#44; unless this is your third conviction with 10 years&#44; then 10 years', 'Third2', 23, 'Continue,,,', '', 0, ''),
(118, 7, 'EX', 'Have you ever refused the chemical test in the past?', 'Second Refusal', 13, 'Yes,Second Refusal1,|No,,', '', 0, ''),
(119, 7, 'EX', '<b>Refusal</b><br/><br/>If you refuse the chemical test a second time&#44; you can be charged with a separate misdemeanor of the first degree for the first offense. A misdemeanor of the first degree carries up to 1 year of jail time and a fine up to $1000. ', 'Second Refusal1', 14, 'Continue,Minors,,', '', 0, ''),
(120, 8, 'MB', 'Were you under 21 when you were arrested?', '', 1, 'Yes,Under 21,under 21|No,,', '', 0, ''),
(121, 8, 'EX', '<b>Under 21</b><br/><br/>Pennsylvania has a zero-tolerance policy towards underage drinking and driving. If your BAC was 0.02% or greater&#44; you may face a jail sentence between 48 hours and 180 days&#44; a fine between $500 and $5000&#44; and an administrative license suspension for the first conviction', 'Under 21', 2, 'Continue,,,', '', 0, ''),
(127, 8, 'IN', 'Did you get arrested within the last 10 days?', '', 3, 'Yes,DMV5,,|No,,,', '', 0, ''),
(128, 8, 'EX', '<b>DMV Hearing</b><br/><br/>You have a right to fight your license suspension. To do this you must request a DMV hearing within 10 days of your arrest. A DUI attorney will file this request for you and represent you in the process. ', 'DMV5', 4, 'Continue,,,', '', 0, ''),
(129, 8, 'MB', 'After you were arrested&#44; did you take a breath&#44; blood&#44; or urine test?', '', 5, 'Yes,Chemical,|No refused,Refusal,refusal|No not given,,', '', 0, ''),
(130, 8, 'MB', 'Which one of the following tests did you take?', 'Chemical', 24, 'Breath,Breath,breath test|Blood,,blood test|Both,Breath,breath test', '', 0, ''),
(131, 8, 'MB', 'Did you burp&#44; vomit&#44; smoke&#44; regurgitate&#44; drink&#44; smoke&#44; or eat 15 minutes before the breathalyzer?', 'Breath', 25, 'Yes,Inaccurate,inaccurate|No,,', '', 0, ''),
(132, 8, 'EX', '<b>BAC Test</b><br/><br/>Your BAC results may be inaccurate. When you burp&#44; vomit&#44; regurgitate&#44; drink&#44; smoke&#44; or eat&#44; a tiny amount of alcohol was probably introduced to your mouth. Since the breathalyzer machine assumes that it is only measuring your breath alcohol&#44; a tiny amount of mouth alcohol may have produced an inaccurate BAC measurement. Other conditions that may increase your mouth alcohol or register an inaccurate measurement include dentures&#44; diabetes&#44; and the use of alcohol-containing products such as mouthwash&#44; breath spray&#44; and cough syrup.', 'Inaccurate', 26, 'Continue,,,', '', 0, ''),
(133, 8, 'MC', 'What was your BAC?', 'Chemical', 6, 'Less than 0.08%,Injury,bac|0.08% to 0.099%,Injury,bac|0.10% to 0.159%,High,bac|0.16% or higher,Highest,bac|I don&#39;t know,,', '', 0, ''),
(134, 8, 'MB', 'Did you drink shortly before getting arrested?', 'Rising', 22, 'Yes,Rising2,rising bac defense|No,,', '', 0, ''),
(135, 8, 'EX', '<b>Rising BAC Defense</b><br/><br/>You may have a &quot;Rising BAC Defense.&quot; What matters in a DUI case is your BAC at the time of driving&#44; not your BAC at the police station. To figure this out&#44; prosecutors will try to estimate your driving BAC. Most of the time they will estimate a BAC higher than the test results because they assume that your body was burning off alcohol between the time of arrest and testing. However&#44; this assumption is false if you had a drink shortly before being arrested and/or tested&#44; because your body was still absorbing that drink. This is called the &quot;Rising BAC defense&quot; and it might be used to help your case. ', 'Rising2', 23, 'Continue,,,', '', 0, ''),
(136, 8, 'MC', 'In the past 10 years&#44; how many times have you been convicted of drunk driving?', 'Low', 8, 'This is my first,First1,penalties|One time,Second1,penalties|Two or more times,More1,penalties', '', 0, ''),
