(138, 8, 'MB', 'How were you pulled over?', '', 29, 'Traffic Stop,Traffic,evidence|DUI Checkpoint,Checkpoint,checkpoints|Accident,Accident,', '', 0, ''),
(139, 8, 'EX', '<b>Traffic Stop</b><br/><br/>You have a right to not be pulled over randomly for no reason. Police must have &quot;probable cause&quot; before pulling over a car. An officer has probable when there is a reasonable&#44; articulable suspicion that a law has been broken. In most instances&#44; breaking a traffic law is enough for a officer to legally pull you over. If an officer pulls you over illegally&#44; a lawyer will file a motion to suppress any evidence obtained from that stop and get your case dismissed.', 'Traffic', 30, 'Continue,,,', '', 0, ''),
(143, 8, 'EX', '<b>DUI Checkpoints</b><br/><br/>DUI checkpoints are governed by strict rules and regulations. The following are some&#44; but not all&#44; of the guidelines police must follow at a DUI checkpoint: 1) stops must be quick and there can be no physical search&#44; 2) there must be warning of the checkpoint. 3) checkpoints must be approved and not randomly set up by police whenever they feel like it&#44; 4) the checkpoint must be in an area where there are likely to be drunk drivers&#44; and 5) there must be a fixed formula used to determine which drivers to stop&#44; cops can&#39;t decide randomly.', 'Checkpoint', 31, 'Continue,,,', '', 0, ''),
(144, 8, 'MB', 'Was anyone injured?', 'Accident', 32, 'Yes,Wobbler,injury|No,,', '', 0, ''),
(145, 8, 'EX', '<b>Accident</b><br/><br/>A DUI with injury may increase your penalties.', 'Wobbler', 33, 'Continue,,,', '', 0, ''),
(146, 8, 'MB', 'Was there a passenger under the age of 18 in the car?', '', 27, 'Yes,Minor,child passenger|No,,', '', 0, ''),
(147, 8, 'EX', '<b>Minor Passenger</b><br/><br/>You may face additional penalties for a DUI with a passenger under the age of 18. For a first offense&#44; add at least $1000 and 100 hours of community service. For a second offense&#44; add at least $2500 and between 1 and 6 months of jail time. For a third offense&#44; add between 6 month and 2 years of jail time.', 'Minor', 28, 'Continue,,,', '', 0, ''),
(148, 8, 'EX', '<b>Possible Penalty</b><br/><br/>Probation - up to 6 months<br/>Fines - $300<br/>Alcohol highway safety school', 'First1', 9, 'Continue,Rising,,', '', 0, ''),
(149, 8, 'EX', '<b>Possible Penalty</b><br/><br/>Jail - 5 days to 6 months<br/>Fines - $300 to $2500<br/>License Suspension - 1 year<br/>1 year ignition interlock<br/>Alcohol highway safety school', 'Second1', 10, 'Continue,Rising,,', '', 0, ''),
(150, 8, 'EX', '<b>Possible Penalty</b><br/><br/>Jail - 10 days to 2 years<br/>Fines - $500 to $5000<br/>License Suspension - 1 year<br/>1 year ignition interlock<br/>Alcohol highway safety school', 'More1', 11, 'Continue,Rising,,', '', 0, ''),
