(215, 10, 'EX', '<b>Refusal</b><br/><br/>You may face automatic penalties for refusing a chemical test. This is because just by driving the law says you have given your &quot;implied consent&quot; to submit to testing if arrested for drunk driving.<br/><br/>First Offense - 1 year license suspension<br/>Second Offense - 2 year license suspension<br/>Third Offense - 2 year license suspension', 'Refusal', 23, 'Continue,,,', '', 0, ''),
(216, 10, 'MB', 'How were you pulled over?', '', 24, 'Traffic Stop,Traffic,evidence|DUI Checkpoint,Checkpoint,checkpoints|Accident,Accident,', '', 0, ''),
(217, 10, 'EX', '<b>Traffic Stop</b><br/><br/>You have a right to not be pulled over randomly for no reason. Police must have &quot;probable cause&quot; before pulling over a car. An officer has probable when there is a reasonable&#44; articulable suspicion that a law has been broken. In most instances&#44; breaking a traffic law is enough for a officer to legally pull you over. If an officer pulls you over illegally&#44; a lawyer will file a motion to suppress any evidence obtained from that stop and get your case dismissed.', 'Traffic', 25, 'Continue,,,', '', 0, ''),
(221, 10, 'EX', '<b>DUI Checkpoints</b><br/><br/>DUI checkpoints are governed by strict rules and regulations. For example&#44; cars cannot be stopped randomly. A pre&ndash;determined formula must be followed&#44; such as every fifth car is stopped. If any of these rules are broken&#44; the checkpoint may be illegal and a lawyer will file a motion to suppress any evidence obtained from that stop and get your case dismissed. ', 'Checkpoint', 26, 'Continue,,,', '', 0, ''),
(222, 10, 'MB', 'Was anyone injured?', 'Accident', 27, 'Yes,Wobbler,injury|No,,', '', 0, ''),
(223, 10, 'EX', '<b>Accident</b><br/><br/>If someone was injured in a accident caused by DUI&#44; the offense is considered an &quot;Aggravated DUI.&quot; This is a Class 4 Felony and can result in 1.5 to 3 years in prison and fines of up to $150&#44;000. Number of past offenses and severity of injury are factors used in determining the penalties imposed. ', 'Wobbler', 28, 'Continue,,,', '', 0, ''),
(224, 10, 'MB', 'Was there a passenger under the age of 15 in the car?', '', 29, 'Yes,Minor,child passenger|No,,', '', 0, ''),
(225, 10, 'EX', '<b>Minor Passenger</b><br/><br/>Driving with a passenger under the age of 15 is considered a Class 6 Felony. If convicted&#44; jail time can span from 1 day to 2 years. Fines start at $4&#44;600. Prosecutors may choose to file child endangerment charges as well.', 'Minor', 30, 'Continue,,,', '', 0, ''),
(226, 10, 'MC', 'In the past 7 years&#44; how many times have you been convicted of drunk driving?', 'Low', 11, 'This is my first,First1,penalties|One time,Second1,penalties|Two or more times,More1,penalties', '', 0, ''),
(227, 10, 'MC', '<b>Possible Penalty </b><br/><br/>Jail - minimum 24 hours to 10 days<br/>Fines - up to $1800<br/>License Suspension - 90 days to 1 year', 'First1', 12, 'Continue,Rising,,', '', 0, ''),
(228, 10, 'EX', 'When you were arrested&#44; was your license suspended or revoked because of a previous DUI conviction?', 'Chemical', 9, 'Yes,More1,|No,BAC,', '', 0, ''),
(229, 10, 'EX', '<b>Possible Penalty </b><br/><br/>Jail - minimum 30 days to 90 days<br/>Fines - up to $3500<br/>License Suspension - 1 year ', 'Second1', 13, 'Continue,Rising,,', '', 0, ''),
(230, 10, 'EX', '<b>Possible Penalty </b><br/><br/>Jail - minimum 4 months<br/>Fines - $4600 to $150000<br/>License Suspension - 1 year ', 'More1', 14, 'Continue,Rising,,', '', 0, ''),
(231, 10, 'EX', '<b>Possible Penalty</b><br/><br/>Jail - minimum 10 days to 30 days<br/>Fines - approximately $3000<br/>License Suspension - 90 days to 1 year', 'First2', 18, 'Continue,,,', '', 0, ''),
(232, 10, 'EX', '<b>Possible Penalty</b><br/><br/>Jail - minimum 60 days to 120 days<br/>Fines - up to $3750<br/>License Suspension - 1 year ', 'Second2', 19, 'Continue,,,', '', 0, ''),
