(1251, 24, 'EX', 'According to your answers&#44; you might not have a <b>well-founded fear</b> of persecution.  This is a requirement in an asylum claim and can be established in two ways:<br/><br/>1) You have experienced persecution before and circumstances have not changed in your home country.<br/><br/>2) You fear persecution if you return to your home country and there is a good probability it will happen. (8 C.F.R. ????&sect; 208.13(b)(2)).', 'Info', 4, 'Continue,,', 'Persecution', 0, ''),
(1255, 24, 'EX', 'Asylum will usually not be granted if a person&#39;s application has been<br/><br/>1) <b>previously denied</b> or<br/>2) filed after <b>one year</b> of arrival in the U.S. (8 U.S.C. ???&sect; 1158(a)(2)(B)-(C))<br/><br/>However&#44; a person may still be considered if he or she can meet an exception.', 'Denied', 21, 'Continue,Exception,', 'Procedure', 0, ''),
(1256, 24, 'EX', 'An <b>aggravated felony</b> conviction might make you ineligible for asylum. (Robleto-Pastora v. Holder&#44; 591 F.3d 1051 (2010)). The classification of what is a felony is dependent on the statues of the state where the crime was committed. (Cazarez-Gutierrez v. Ashcroft&#44; 356 F.3d 1015 (2004)).', 'Thug', 25, 'Continue,Disqualifications,', 'Disqualifications', 0, ''),
(1257, 24, 'EX', 'You might be denied asylum if you are considered a <b>danger</b> to the security of the U.S. (INA ???&sect; 208(b)(2)(A)). Similarly&#44; if you are involved with <b>terrorist activities</b>&#44; you might be barred from asylum regardless of whether you currently pose a danger to the U.S. (McAllister v. Att’y Gen.&#44; 444 F.3d 178 (2006)).', 'IRA', 27, 'Continue,,', 'Disqualifications', 0, ''),
(1258, 24, 'EX', 'If you have been offered asylum&#44; permanent residency&#44; or citizenship from another country&#44; you may be denied asylum because you are  in that country. However&#44; if your presence in that country is restricted or you have limited access to benefits&#44; then you are probably not considered firmly resettled&#44; and may be eligible for asylum.', 'Resettled', 29, 'Continue,,', 'Disqualifications', 0, ''),
(1259, 24, 'EX', 'Your prior <b>participation</b> in persecution against a person or group based on race&#44; religion&#44; nationality&#44; social group&#44; or political opinion&#44; may bar you from asylum. (INA ???&sect; 208(b)(2)(A)). To be considered as participation&#44; your actions must have furthered persecution against that group or person in some way. Mere membership in an organization that engages in persecution is not enough to bar you from asylum. (In re A-H&#44; 23 I. & N. Dec. 774 (B.I.A. 2005)).', 'Game', 32, 'Continue,,,', 'Disqualifications', 0, ''),
(1260, 24, 'EX', 'According to your answers&#44; the persecution you fear might not be <b>recognized</b> for asylum purposes.<br/><br/>The U.S. government will generally only grant asylum to persons who fear persecution based on race&#44; religion&#44; nationality&#44; political opinion&#44; or membership in a social group. (8 C.F.R. ????&sect; 208.13(b)(2)(i)(A)). Courts have also recognized other bases for persecution&#44; including gender&#44; sexual orientation&#44; and population control.', 'None', 14, 'Continue,,', 'Type', 0, ''),
(1261, 24, 'EX', 'According to your answers&#44; the government is able and willing to <b>protect</b> you from persecution. Therefore&#44; you might not be eligible for asylum.<br/><br/>One requirement of asylum is a government&#39;s failure to reasonably protect a person against persecution. (Morgan v. Holder&#44; 634 F.3d 53&#44; 59 (1st Cir. 2011)). However&#44; a government is not compelled to protect a person from all types of persecution and the core human right(s) at risk must be assessed.', 'Info2', 17, 'Continue,,', 'Who', 0, ''),
