(1291, 44, 'OP', 'Were there any witnesses?', 'Evidence', 42, 'Passenger(s) in my car,Witnesses,|Passenger(s) in other car,Witnesses,|Bystanders,Witnesses,|Other,Witnesses,|nota,,', 'Evidence', 0, ''),
