(2255, 68, 'MB', 'How many children have you had in your lifetime?', 'Married-Child', 3, '0,results,,quick=Your spouse will probably get all your property. However&#44; he/she may still have to pay court fees and expenses up to 30% of the property value.|1,child-under18,,quick=Your spouse will probably get one-third to one-half of your property. The rest of your property will probably go to your child. However&#44; they may still have to pay court fees and expenses up to 30% of the property value.|2 or more,children-under18,,quick=Your spouse will probably get one-third to one-half of your property. The rest of your property will probably be split between your children. However&#44; they may still have to pay court fees and expenses up to 30% of the property value.', '', 0, ''),
(2263, 68, 'MB', 'Is your child under 18?', 'child-under18', 5, 'Yes,results,,under=Also&#44; the wrong person could end up taking custody of your child because the government decides who takes custody. Picking a guardian for your child and writing it into a will helps ensure that your child will be properly taken care of&#44; even if the unimaginable happens.|No,results,,', '', 0, ''),
