(2268, 68, 'ZZ', 'Now that you have learned why making a will is important&#44; you may have more questions or want help making one. Online services&#44; such as LegalZoom&#44; are great for simple wills. Act today to make sure your loved ones are protected no matter what happens!\n<br/><br/><b>Limited Time Offer</b><br/><br/>\nSave 10% if you create a will with LegalZoom. Email or call for details.<br/>', 'results1', 8, '<a href=&quot;http://lztrk.com/?a=4418&c=647&p=r&s1=&quot; id=&quot;lzad&quot;><img src=&quot;http://c363102.r2.cf1.rackcdn.com/647_300x250a.jpg&quot; width=&quot;300&quot; height=&quot;250&quot; border=&quot;0&quot; /></a>,,,', '', 0, ''),
(2269, 68, 'MB', 'How many children have you had in your lifetime?', 'Single-Child', 4, '0,results,,quick=All of your property typically goes to your parents&#44; siblings&#44; or other relatives. The government will decide how your property will be divided&#44; and your property can also lose up to 30% of its value in court.|1,child-under18,,quick=All of your property typically goes to your child.  However&#44; he/she may still have to pay court fees and expenses up to 30% of the property value.|2 or more,children-under18,,quick=All of your property typically gets split between your children. However&#44; they may still have to pay court fees and expenses up to 30% of the property value.', '', 0, ''),
