(2277, 69, 'MC', 'What is your relationship with the person you are seeking a restraining order against?', '', 2, 'Closely related family member,,,type=Domestic Violence restraining order. This type of protective order is for family members&#44; current and former significant others&#44; and roommates.|Current or former spouse or significant other,,,type=Domestic Violence restraining order. This type of protective order is for family members&#44; current and former significant others&#44; and roommates.|Current or former roommate ,,,type=Domestic Violence restraining order. This type of protective order is for family members&#44; current and former significant others&#44; and roommates.|None of the above,,,type=Civil Harassment restraining order. This type of protective order is for neighbors&#44; strangers&#44; acquaintances&#44; and others that do not live in your residence.', '', 0, ''),
(2280, 69, 'MB', 'Has this person <b>physically</b> hurt you or your loved ones?', '', 3, 'Yes,PH1,,|No,,,x=0', '', 0, ''),
(2284, 69, 'MC', 'On a scale of 1 to 3&#44; how severe was the <b>worst</b> incident? ', 'PH2', 5, '1 - minor harm,,,x={x}+4|2 - bruised/choked/cut/etc.&#44; but did not need to go to the hospital,,,x={x}+6|3 - needed to go to the hospital,,,x={x}+100', '', 0, ''),
(2287, 69, 'MB', 'Has this person  <b>threatened</b> to physically hurt you or your loved ones?', '', 6, 'Yes,Credible,|No,,', '', 0, ''),
(2288, 69, 'MB', 'Could the threats realistically happen?', 'Credible', 7, 'Yes,PT,,|No,Fake,,', '', 0, ''),
(2289, 69, 'EX', '<b>Threats</b><br/><br/>Threats must be realistic in order to get a restraining order. If the threat was a joke or could not really happen&#44; then it does not help you get a restraining order.', 'Fake', 10, 'Continue,,', '', 0, ''),
(2295, 69, 'MB', 'Has this person caused you substantial emotional distress from <b>harassing</b> you or your loved ones? ', '', 11, 'Yes,Emotion1,,|No,,,', '', 0, ''),
(2298, 69, 'MB', 'Have most of the incidents taken place in or near any place you can&#39;t really <b>avoid</b>&#44; like at school&#44; work&#44; or home?', '', 13, 'Yes,Sub1,,x={x}+1|No,Sub1,,', '', 0, '{x}>0'),
(2300, 69, 'MB', 'Are you responsible for <b>children</b> that suffer due to the harm caused by this person?', 'Sub1', 14, 'Yes,Child1,,x={x}+1|No,Child1,,', '', 0, ''),
