(2664, 83, 'ZZ', '<b>Result</b><br/><br/>Since the {proptype} was acquired during the marriage&#44; and it is not a gift or inheritance&#44; it is probably community property. However&#44; there are exceptions. For example&#44; if you received a $1000 gift for your birthday and you used that money to pay for part of the {proptype}&#44; part of the {proptype} is probably separate property. The law can get confusing so it is a good idea to speak with a lawyer. ', 'During12', 16, '0,,,', '', 0, ''),
