(2689, 83, 'ZZ', '<b>Result</b><br/><br/>Since the money was acquired during the marriage&#44; and it is not a gift or inheritance&#44; it is probably community property. However&#44; there are exceptions. For example&#44; if the money is from rents of a property you owned before marriage&#44; the money might be separate property. The law can get confusing so it is a good idea to speak with a lawyer. ', 'During1Money', 17, '0,,,', '', 0, ''),
(2690, 83, 'ZZ', '<b>Result</b><br/><br/>The proportion of this money used before the marriage to pay for the {proptype} equals the percentage of the {proptype} that you own. However&#44; you may own more of the property because there are exceptions to this rule. The law can get complicated&#44; so it&#39;s a good idea to speak with a lawyer. ', 'Half', 12, '0,,,', '', 0, ''),
