(2707, 84, 'ZZ', '<b>Result</b><br/><br/>If the accident was 100% your fault&#44; then you might not be able to recover any money. {STATE} is a pure comparative negligence state&#44; which means you cannot recover if you were 100% at fault. However&#44; the specific facts of your case may make you eligible to sue. It&#39;s a good idea to speak with a lawyer to find out. ', '', 8, '0,,,', '', 0, '{f}=100'),
(2711, 84, 'ZZ', '<b>Result</b><br/><br/>If you did not suffer any monetary harm&#44; you probably cannot recover any money from the car accident. It is a good idea to talk to a lawyer to figure out whether you suffered harm that can be compensated.', '', 10, '0,,,', '', 0, '{x}=0'),
(2714, 84, 'MI', 'Enter approximate <b>dollar</b> amount of how much you spent or lost because of the car accident.', '', 9, 'Medical Bills:,,,x={1}+{2}+{3}+{4}|Auto Repair:,,,|Rental Car:,,,|Lost Wages:,,,', '', 0, ''),
