(2739, 84, 'MB', 'Have you previously hired an attorney for this car accident?', 'Attorney', 17, 'Yes,,,|No,,,d=1', '', 0, ''),
(2740, 84, 'MB', 'Do you have insurance?', '', 15, 'Yes,Insurance2,,|No,,,', '', 0, ''),
(2741, 84, 'ZZ', '<b>Result</b>\n<p>According to your answers&#44; you are probably <b>eligible</b> to sue for negligence because the accident was not your fault.</p> \n<p>You can probably recover <b>${x}</b> for harms and damages you suffered. You might be able to get more for pain and suffering. {mediation}</p>\n<p>If you want to file a lawsuit&#44; it&#39;s a good idea to hire a <b>lawyer</b>. A lawyer will help you file necessary paperwork and negotiate a settlement if that is best for you. Almost all car accident cases are taken on a contingency basis. This means you don&#39;t pay if you lose and if you win&#44; the lawyer gets a percentage of the winnings.</p>', '', 19, '0,,,', '', 0, '{f}=0'),
(2742, 84, 'ZZ', '<b>Result</b><br/><br/>You might not be able to sue for negligence because you are past the statute of limitations. The statute of limitations is a time restriction on when you can sue someone. For car accidents in {STATE}&#44; you have {SOL} from the date of the accident to file a lawsuit. However&#44; the specific facts of your case may make you eligible to sue. It&#39;s a good idea to speak with a lawyer to find out. ', 'SOL', 14, '0,,,', '', 0, ''),
